INSERT INTO goals VALUES (1,1,1,6,'Inserir aproximadamente 280 mil famílias com renda de até meio salário mínimo no Cadastro Único para atingir 773 mil famílias cadastradas','280 mil famílias inscritas no Cadastro Único',103305927.00,'228.000 famílias cadastradas','52.000 famílias cadastradas','Prioridade para implementação das ações nas Subprefeituras com maior concentração de famílias em situação de extrema pobreza e pobreza. Busca Ativa apoiada pelas áreas de interface e sociedade civil. Disponibilização de espaços públicos e equipamentos municipais para ações cadastrais.','Cadastro Único para Programas Sociais do Governo Federal (Cadastro Único): é um instrumento que identifica e caracteriza as famílias de baixa renda (renda mensal de até meio salário mínimo por pessoa ou renda mensal total de até três salários mínimos). Ele é utilizado por mais de 15 programas sociais do Governo Federal, como o Bolsa Família, Minha Casa Minha Vida, PRONATEC, Tarifa Social de Energia Elétrica, Brasil Carinhoso, etc. Busca Ativa: estratégia do Plano Brasil Sem Miséria que tem como objetivo levar o Estado ao cidadão, sem esperar que as pessoas mais pobres cheguem até o poder público. Um dos grandes desafios do Brasil Sem Miséria é alcançar aqueles que não acessam os serviços públicos e vivem fora de qualquer rede de proteção social.',5,'juventude-viva                                                                sp-carinhosa                                   pop rua','349 mil famílias inseridas no Cadastro Único de janeiro de 2013 a julho de 2014, superando a meta prevista para o final de 2016 em mais de 20%.','O número de famílias cadastradas em dezembro de 2012 era de 493 mil. Em julho de 2013 este número passou para 709.595, chegando a 922.259 em julho de 2014, data da última atualização do CadÚnico. ','350 entrevistadores contratados em novembro de 2013 para a realização de novos cadastros.','200 Agentes de Saúde e  22 Agentes de Gestão de Politicas Públicas de Unidades Básicas de Saúde (UBS) capacitados como entrevistadores para a realização de novos cadastros.','','','0000-00-00 00:00:00','2015-01-13 19:08:26'),(2,1,1,6,'Beneficiar 228 mil novas famílias com o Programa Bolsa Família','Pagamento dos benefícios do Programa Bolsa Família viabilizado',0.00,'171.000 Famílias beneficiadas','57.000 Famílias beneficiadas','A Secretaria Municipal de Assistência e Desenvolvimento Social faz toda a mobilização necessária e executa o cadastramento que viabiliza o pagamento dos benefícios do Programa Bolsa Família (articulação com outras Secretarias e agentes, capacitações, divulgações etc).','Programa Bolsa Família: O Programa Bolsa Família (PBF) é um programa de transferência direta de renda que beneficia famílias em situação de pobreza e de extrema pobreza em todo o País. O Bolsa Família integra o Plano Brasil Sem Miséria (BSM). Linha da extrema Pobreza: renda familiar per capita inferior a R$ 70 mensais. Linha da pobreza: renda familiar per capita entre R$ 70 e R$ 140 mensais.',3,'juventude-viva                                                                sp-carinhosa                                   pop rua','157 mil novas famílias beneficiadas pelo Programa Bolsa Família desde janeiro de 2013.','O número de famílias beneficiadas pelo Programa é composto pelo número de famílias incluídas menos o número de famílias que deixam de receber o benefício, seja por razões de descumprimento das regras, seja em razão da progressão de renda, podendo haver variação nula ou negativa  no número de famílias beneficiadas.','Para calcular o incremento bruto de beneficiários no Programa Bolsa Família, devemos utilizar como referência o marco zero (janeiro de 2013) e subtrair os demais períodos de levantamento da informação. Para termos o total de inclusão, soma-se os incrementos.','','','','0000-00-00 00:00:00','2015-01-13 19:10:17'),(3,1,1,6,'Implantar 60 Centros de Referência da Assistência Social - CRAS','60 CRAS em funcionamento',14532500.00,'25 CRAS','35 CRAS','Os CRAS serão construídos ou adaptados em imóveis alugados ou cedidos. Eles serão dotados de estrutura física com garantia de acessibilidade, estrutura administrativa e recursos humanos, e cada unidade terá a capacidade de referenciar até 5 mil famílias.','Centro de Referência de Assistência Social - CRAS: unidade estatal de proteção social básica do Sistema Único de Assistência Social - SUAS, que tem o objetivo de assegurar a proteção integral à famílias em situação de vulnerabilidade social.',3,'sp-mais-inclusiva','1 unidade entregue na subprefeitura Capela do Socorro e 5 unidades em fase de implantação nas subprefeituras de Itaim Paulista, Jaçanã/Tremembé, Campo Limpo, Capela do Socorro e Cidade Tiradentes. \n','1 unidade no Itaim Paulista em obras, 13 unidades com processo licitatório em andamento e outras 13 com terrenos já definidos.','80 Assistentes Sociais foram contratados  emergencialmente e capacitados para viabilizar o funcionamento das novas unidades.','Realização de concurso público para 300 assistentes sociais. Aguardando a chamada para 1º semestre 2015.','','','0000-00-00 00:00:00','2015-01-27 20:46:42'),(4,1,1,6,'Implantar 7 Centros de Referência Especializados da Assistência Social - CREAS','7 CREAS em funcionamento',2184500.00,'4 CREAS','3 CREAS','A definição da meta - 7 unidades - responde à diretriz de garantir um equipamento em cada subprefeitura da cidade. Os CREAS serão construidos ou adaptados em imóveis alugados ou cedidos. Eles terão estrutura física adequada para acolher e garantir o atendimento e condições de privacidade, sigilo e dignidade (recepção, sala de atendimento individual e em grupo, sala para administração, banheiros, copa, espaço externo, almoxarifado). A capacidade de atendimento será de aproximadamente 80 famílias/indivíduos mês por unidade.','Centro de Referência Especializado de Assistência Social - CREAS: unidade pública e estatal, que oferta serviços especializados e continuados a famílias e indivíduos em situação de ameaça ou violação de direitos (violência física, psicológica, sexual, tráfico de pessoas, cumprimento de medidas socioeducativas em meio aberto, dentre outros).',2,'sp-mais-inclusiva','2 unidades em fase de implantação nas subprefeituras de Cidade Tiradentes e Pinheiros. 1 unidade na subprefeitura do Butantã com locação aprovada e em processo de readequação do espaço. ','Projeto básico em andamento para a construção de 2 novos CREAS nas subprefeituras de Parelheiros e Cidade Ademar.','80 Assistentes Sociais foram contratados  emergencialmente e capacitados para viabilizar o funcionamento das novas unidades.','Realização de concurso público para 300 assistentes sociais. Aguardando a chamada para 1º semestre 2015.','','','0000-00-00 00:00:00','2015-01-14 21:13:25'),(5,1,1,6,'Garantir 100.000 vagas do Programa Nacional de Acesso ao Ensino Técnico e Emprego (PRONATEC)','100 mil vagas pactuadas com o Governo Federal',0.00,'40.000 vagas','60.000 vagas','Publico-alvo: Beneficiários dos programas de transferência de renda, alunos de Educação de Jovens e Adultos (EJA) inscritos no Cadastro Único e beneficiários do Seguro Desemprego. Um Grupo de Trabalho intersecretarial definirá diretrizes de execução levando em conta as necessidades específicas de populações mais vulneráveis como: juventude (observando os critérios de territórios prioritários do Plano Juventude Viva, descrito em meta específica sobre o tema), mulheres vítimas de violência, negros, índios, transsexuais, população de rua e pessoas com deficiência. O planejamento já prevê 4.000 vagas para famílias em situação de rua, conforme explicado em meta específica sobre o tema.','PRONATEC: Programa Nacional de Acesso ao Ensino Técnico e Emprego criado pelo Governo Federal, em 2011, com o objetivo de ampliar a oferta de cursos de educação profissional e tecnológica.',3,'agenda-pop-rua, sp-mais-inclusiva, juventude-viva','51.034 vagas e 38.167 matrículas efetivadas em 2013 e 2014. ','A instituição do Comitê Gestor Intersecretarial do PRONATEC em abril de 2014 permitiu a oferta de cursos e incorporação de disciplinas nas áreas estratégicas de cultura, economia criativa, saúde e tecnologia da informação e comunicação. ','Estabelecimento e habilitação de uma instituição ofertante pública municipal de cursos do PRONATEC, a FUNDAÇÃO PAULISTANA DE EDUCAÇÃO, TECNOLOGIA E CULTURA (FUNDASAMPA). Ao investir nessa fundação como uma das protagonistas da oferta de cursos de EPT, o município paulistano ganha um valiosíssimo instrumento de  romoção de suas diretrizes de atendimento – capilaridade, igualdade, inclusão, qualidade, atualidade. Ainda houveram avanços na concessão de terrenos para implantação de novos campi do IF-SP, encontrando-se em fases avançadas de pré-aprovação. ','','','','0000-00-00 00:00:00','2015-01-13 20:48:28'),(6,1,1,6,'Formalizar aproximadamente 22.500 microempreendedores individuais','22.500 microempreendedores individuais formalizados',8721206.00,'10.450 microempreendedores individuais','12.050 microempreendedores individuais','O Centro de Apoio ao Trabalho (CAT) realiza sobretudo atendimentos relacionados à intermediação de mão de obra. Porém, dentro da perspectiva de geração de renda, a formalização de micro empreendedores individuais se configura em uma nova modalidade de formalização de agentes econômicos, direcionada aos trabalhadores autônomos e que não se enquadram nos vínculos empregatícios estipulados pela CLT. Esta nova modalidade tem por objetivo a formalização e a promoção de cursos e palestras nos CAT. O público atendido prioritariamente nesses espaços referese àquele considerado de alta vulnerabilidade. Serão definidas diretrizes específicas para definição de público-alvo, levando em conta recortes de gênero, juventude, étnico-racial e pessoas com deficiência.','Microempreendedor Individual (MEI): é a pessoa que trabalha por conta própria e que se legaliza como pequeno empresário. É necessário faturar no máximo até R$ 60 mil por ano e não ter participação em outra empresa como sócio ou titular. O MEI também pode ter um empregado contratado que receba o salário mínimo ou o piso da categoria.',3,NULL,'11.081 Microempreendedores Individuais formalizados de janeiro de 2013 até novembro de 2014. ','Foram 5.825 formalizações em 2013 e 5256 de janeiro a novembro de 2014.','Os dados referentes à dezembro estão em fase de consolidação. Vale ressaltar que no período de final de agosto e setembro os CAT\'s estiveram fechados devido ao vencimento de contrato com a empresa que prestava o serviço anteriormente, sendo que nesse período foi realizado o processo licitatório para contratação de uma nova empresa.','','','','0000-00-00 00:00:00','2015-01-13 19:09:14'),(7,1,1,6,'Ampliar em 20 mil o número de matrículas na Educação de Jovens e Adultos e implantar 3 novos Centros Integrados (CIEJA)','3 CIEJAs instalados e 20.000 novas vagas de EJA abertas no município',3030198.00,'1 CIEJA implantado, 12.600 vagas de EJA criadas','2 CIEJAs implantados, 7.400 vagas de EJA criadas','Está em elaboração uma proposta de reorientação curricular que articule a educação escolar com o mundo do trabalho, da cultura e a pratica social, bem como os diferentes atendimentos oferecidos na modalidade EJA: Noturno, modular, CIEJA, CMCT e MOVA. O custo da meta apresentado refere-se à instalação dos 3 novos CIEJAs e o custo das 20 mil novas vagas no período de 1 ano.','EJA: Educação de Jovens e Adultos\nCIEJA: Centro Integrado de Educação de Jovens e Adultos\nMOVA: Movimento de Alfabetização\nCMCT: Centro Municipal de Capacitação eTreinamento',3,'historia-africa, juventude-viva','Até o fim de 2014 foram  matriculados 11.759 alunos na Educação de jovens e adultos\n','CIEJA São Mateus implantado em 2014.','','','','','0000-00-00 00:00:00','2015-01-26 23:06:42'),(8,1,1,5,'Implantar 5 Centros de Referência Especializados para a população em situação de rua (Centros POP)','5 Centros PopRua em funcionamento',1000000.00,'5 Centros PopRua','','Os Centros PopRua fazem parte do Plano Municipal da Política da População em Situação de Rua. O conjunto integrado de ações e entregas desse Plano, incluindo a implantação dos 5 Centros PopRua serão monitorados pelo Comitê Intersetorial criado pelo Decreto n. 53.795/2013.','População em situação de rua: grupo populacional heterogêneo que possui em comum a pobreza extrema, os vínculos familiares interrompidos ou fragilizados e a inexistência de moradia convencional regular, e que utiliza os logradouros públicos e as áreas degradadas como espaço de moradia e de sustento, de forma temporária ou permanente, bem como as unidades de acolhimento para pernoite temporário ou como moradia provisória (definição dada pelo Decreto\nPresidencial nº 7053/2009).\nCentros PopRua: Centro de Referência Especializado com rede de atendimento socioassistencial voltado à população adulta, oferecendo: abordagens sistemáticas nas ruas e encaminhamentos para os núcleos de serviços de convivência e centros de acolhida.',3,'agenda-pop-rua, sp-mais-inclusiva','1 unidade na Vila Maria/Vila Guilherme entregue para atendimento à população em situação de rua.','Os Centros PopRua fazem parte do Plano Municipal da Política da População em Situação de Rua. ','','','','','0000-00-00 00:00:00','2015-01-14 21:14:17'),(9,1,1,5,'Implantar 2 restaurantes comunitários','2 Restaurantes comunitários implantados',620000.00,'2 restaurante comunitário','','A implantação dos restaurantes comunitários visa garantir segurança alimentar à população em situação de rua e faz parte do Plano Municipal da Política da População em Situação de Rua. Essa ação, assim como o conjunto integrado de ações e entregas do Plano será monitorada pelo Comitê Intersetorial criado pelo Decreto n. 53.795/2013.','Restaurante comunitário: tem a finalidade de servir refeições adequadas para pessoas adultas em situação de rua de forma continuada. Deverá oferecer refeições prontas, saudáveis e de qualidade. Com atendimento prioritário aos grupos da população que se encontram em situação de insegurança alimentar contribui para a\nmelhoria da saúde e qualidade de vida.',2,'agenda-pop-rua, sp-mais-inclusiva','Identificação dos imóveis em andamento.\n','A implantação dos restaurantes comunitários visa garantir a segurança alimentar da população em situação de rua.  A SMADS está buscando parcerias com as ONGS para viabilizar a implantação em locais já existentes','','','','','0000-00-00 00:00:00','2015-01-26 22:16:24'),(10,1,1,5,'Implantar 22 Serviços de Acolhimento Institucional à população em situação de rua','22 Serviços de Acolhimento Institucional implantados',6763025.00,'13 Serviços de Acolhimento','9 Serviços de Acolhimento','A implantação dos serviços de acolhimento compõe o Plano Municipal da Política da População em Situação de Rua e será monitorado em conjunto com as demais ações do Plano pelo Comitê Intersetorial criado pelo Decreto n. 53.795/2013, em consonância com a Politica Nacional de População de Rua. O atendimento prestado deve ser personalizado e em pequenos grupos e favorecer o convívio familiar e comunitário, bem como a utilização de serviços disponíveis na comunidade local. As regras de gestão e de convivência deverão ser construídas de forma participativa e coletiva, a fim de assegurar a autonomia dos usuários, conforme perfis. Serão 12 serviços para atendimento às famílias, 8 para atendimento a adultos de ambos os sexos e 2 para carroceiros.','Serviço de Acolhimento Institucional: acolhimento em diferentes tipos de equipamentos, destinado a famílias e/ou indivíduos com vínculos familiares rompidos ou fragilizados, a fim de garantir proteção integral. A organização do serviço deverá garantir privacidade, o respeito aos costumes, às tradições e à diversidade de: ciclos de vida, arranjos, raça/etnia, gênero e orientação sexual.',3,'agenda-pop-rua, sp-mais-inclusiva','12 serviços implantados nas seguintes subprefeituras: 4 unidades na Sé, 3 na Vila Maria/Vila Guilherme, 1 na Penha, 1 na Móoca, 1 na Capela do Socorro, 1 na Casa Verde e 1 em Ermelino Matarazzo. ','1 unidade em fase de implantação de estrutura na subprefeitura de Santo Amaro e 3 unidades em em fase de licitação na subprefeitura da Mooca. ','','','','','0000-00-00 00:00:00','2015-01-13 19:15:00'),(11,1,1,6,'Implantar 12 novos Consultórios na Rua com tratamentos odontológicos e relacionados ao abuso de álcool e outras drogas','12 consultórios na rua em funcionamento com equipes multidisciplinares',24000000.00,'12 Consultórios na Rua','','','Consultório na rua: equipes de saúde móveis para atender à população em situação de risco e vulnerabilidade social, principalmente crianças e adolescentes e usuários de álcool e outras drogas.',5,'agenda-pop-rua','Meta superada: 16 consultórios entregues, 33% a mais que o previsto.','As unidades  foram entregues nos distritos: Belém, Brás, Bom Retiro, Lapa, Mooca, Pari, Pinheiros, República (2), Santa Cecília (4), Santo Amaro e Sé (2).','','','','','0000-00-00 00:00:00','2015-01-13 20:57:06'),(12,1,1,5,'Promover ações para a inclusão social e econômica da população em situação de rua','Campanha de conscientização da população sobre os direitos e vulnerabilidades sociais da população em situação de rua, acesso de pelo menos 4.000 pessoas em situação de rua ao PRONATEC ou outros programas de qualificação profissional, promovendo ingresso ao mercado de trabalho, 2.000 habitações construídas e/ou reformadas por meio do MCMV ou outros programas habitacionais de interesse social e  articulação para empregabilidade da população em situação de rua, mediante projetos de integração e promoção social e econômica incluídos nos grandes eventos da cidade.',3142313.00,'1 Campanha de Conscientização, 2 projetos de integração social e econômica, 2.000 vagas em cursos profissionalizantes - PRONATEC, 1.000 unidades habitacionais MCMV entregues','1 Campanha de Conscientização, 2 projetos de integração social e econômica, 2.000 vagas em cursos profissionalizantes - PRONATEC, 1.000 unidades habitacionais MCMV entregues','A política de garantia de direitos da população em situação de rua será tratada como uma das prioridades da gestão na ótica da garantia de\ndireitos humanos. Para isso, foi criada no âmbito da Secretaria de Direitos Humanos e Cidadania a Coordenação de Políticas para População em Situação de Rua que tem por objetivo articular a gestão transversal das ações públicas voltadas a esta comunidade, pautada na ampliação do diálogo com organizações da sociedade civil e movimentos sociais. Assim, a necessidade da criação de um colegiado, o Comitê Intersetorial da Política Municipal para a População em Situação de Rua (Comitê PopRua) para contribuir na criação do Plano Municipal desta políticas com ênfase na promoção da cidadania, no respeito dos direitos humanos, combate a todas as formas de discriminação e preconceito e à valorização da diversidade. O Plano Municipal da Política da População em Situação de Rua e seu conjunto integrado de ações e entregas serão monitorados por esse Comitê Intersetorial, criado pelo Decreto n. 53.795/2013. No custo total dessa meta não estão incluídos os dados de custo das Unidades Habitacionais e das vagas do PRONATEC. Tais custos estão incorporados nas fichas específicas de cada uma dessas metas.','População em situação de rua: Considera-se população em situação de rua o grupo populacional heterogêneo que possui em comum a pobreza extrema, os vínculos familiares interrompidos ou fragilizados e a inexistência de moradia convencional regular, e que utiliza os logradouros públicos e as áreas degradadas como espaço de moradia e de sustento, de forma temporária ou permanente, bem como as unidades de acolhimento para pernoite temporário ou como moradia provisória\" (definição dada pelo Decreto Presidencial nº 7053/2009).',3,'agenda-pop-rua','Ampliação do número de vagas e turmas do PRONATEC, totalizando 989 vagas em 34 turmas, por meio da parceria com SENAI e SENAC.','Programa Braços Abertos cadastrou 470 pessoas em 2014, com redução média do consumo de substâncias psicoativas de 50% a 70%. No geral, 86% dos participantes conseguem manter frequência regular nas frentes de trabalho de varrição e Fábrica Verde, segundo as equipes de acompanhamento, e 16 beneficiários estão trabalhando em empresas com carteira assinada. Em relação ao acesso à saúde, foram realizados mais de 45 mil abordagens, atendimentos e acompanhamentos médicos.','Implementação de 2 projetos de inclusão social e econômica da PopRua: parceria com CEDECA Interlagos para realização de oficinas de direitos humanos e cidadania no centro de acolhida Zaki Narchi; e com o CIEE para formação complementar para inserção da PopRua no mercado de trabalho.','Elaboração de proposta de pesquisa participativa para embasar o Plano Municipal de Políticas para a População em Situação de Rua.','Protocolo SAMU para atendimento da população em situação de rua revisado.','','0000-00-00 00:00:00','2015-01-13 19:05:55'),(13,1,1,4,'Implementar 4 Centros de Referência em Segurança Alimentar e Nutricional e desenvolver ações de apoio à agricultura urbana e periurbana','04 Centros de Referência de Segurança Alimentar e Nutricional e ações municipais de apoio à agricultra urbana e periurbana',10000000.00,'1 CRSAN','3 CRSAN','Os Centros de Referência de Segurança Alimentar e Nutricional são equipados com cozinha experimental, biblioteca, espaços multimídia (salas de aula)\ne anfiteatro.','Centro de Referência em Segurança Alimentar e Nutricional (CRSAN): equipamento público onde se desenvolvem atividades de formação e assessoria para pessoas que atuam em programas relacionados aos Direitos Humanos e à Alimentação Adequada como merendeiras, nutricionistas, assistentes sociais, agentes comunitários de saúde e entidades assistenciais.',3,NULL,'Centro de Referência de Vila Maria em reforma.','Adesão do Município ao Programa de Aquisição de Alimentos – PAA, do Governo Federal, que viabiliza a oferta de alimentos da Agricultura Familiar às famílias em situação de vulnerabilidade social por meio do Banco de Alimentos e do Centro de Referência de Segurança Alimentar e Nutricional.','Estimulo à comercialização de produtos oriundos do Programa de Agricultura Urbana e Periurbana – PRÓ-AGRIURBE, através de chamamento público para feiras livres orgânicas ou produtos orgânicos ou em Transição Agroecológica e reestruturação das feiras de produtos orgânicos existentes (Modelódromo, Parque do Carmo e CERET)','Outras iniciativas importantes: reestruturação da equipe de Assistência Técnica e Extensão Rural e Social;  retomada do Protocolo de Boas Práticas Agrícolas e Transição Agroecológica; participação de agricultores em eventos e seminários sobre práticas agrícolas. ','Reativação do viveiro de mudas florestais e estimulo a adequação ambiental das propriedades na região de Parelheiros. ','','0000-00-00 00:00:00','2015-01-13 21:27:48'),(14,2,1,3,'Valorizar o profissional da educação por meio da implantação de 31 polos da Universidade Aberta do Brasil (UAB)',' 31 polos da UAB instalados nos CEUs',3485000.00,'31 polos da UAB','','Os pólos de apoio presencial são as unidades operacionais para o desenvolvimento descentralizado de atividades pedagógicas e administrativas relativas aos cursos e programas ofertados à distância pelas instituições públicas de ensino superior no âmbito do Sistema UAB. Mantidos por Municípios ou Governos de Estado, os pólos oferecem a infraestrutura física, tecnológica e pedagógica para que os alunos possam acompanhar os cursos a distância. Os CEUs Rosa da China e Sapopemba (jurisdicionados à Subprefeitura de Sapopemba) atenderão também o público da Subprefeitura da Vila Prudente que não conta com unidades CEU.','Universidade Aberta do Brasil (UAB): Sistema UAB funciona como articulador entre as instituições de ensino superior e os governos estaduais e municipais, com o objetivo de atender às demandas locais por educação superior.',5,'historia-africa','Meta superada em 2014: 32 polos implantados.','8.852 vagas ofertadas para 2014,  15.315 inscritos nos cursos e  4.715 alunos matriculados nos cursos.','','','','','0000-00-00 00:00:00','2015-01-13 20:45:34'),(15,2,1,6,'Ampliar a jornada escolar de 100 mil alunos da Rede Municipal de Ensino','435 módulos de jornada extendida implantados e em funcionamento que atenderão 100 mil alunos',37447630.00,'50 mil alunos atendidos, 218 módulos implantados','50 mil alunos atendidos, 217 módulos implantados','Os módulos do Programa Mais Educação são voltados à educação básica e visam a ampliação da permanência do aluno na escola participando de atividades de acompanhamento pedagógico ligadas ao meio ambiente, lazer e esporte, cultura e artes, cultura digital e outras áreas. Cada módulo atende a 230 alunos que passam a contar com o período extendido da jornada escolar em suas unidades de ensino. A adesão ao programa depende da aprovação do plano de trabalho apresentado pelas Unidades Escolares ao MEC. As atividades previstas nos planos de trabalho visam a extensão da jornada escolar diária para 7 horas, com atividades complementares vinculadas à proposta pedagógica. O custo total da meta representa o valor necessário para manter o Programa Mais Educação para 100 mil alunos durante o período de um ano.','Programa Mais Educação: instituído pela Portaria Interministerial n.º 17/2007, integra as ações do Plano de Desenvolvimento da Educação (PDE) como uma estratégia do Governo Federal para induzir a ampliação da jornada escolar e a organização curricular, na perspectiva da Educação Integral. Módulo: O programa é desenvolvido em módulos, sendo que cada módulo atenderá um grupo de 230 alunos.',3,'juventude-viva','348 escolas aprovadas pelo MEC  ',' 72.047 inscritos no programa.','','','','','0000-00-00 00:00:00','2015-01-14 14:29:03'),(16,2,1,3,'Ampliar a Rede CEU em 20 unidades, expandindo a oferta de vagas para a educação infantil','20 unidades da Rede CEU implantadas',620000000.00,'1 CEU','19 CEUs','Cada nova unidade da Rede CEU contará com 1 CEMEI, 1 EMEF, quadra poliesportiva, teatro, playground, piscinas, biblioteca, telecentro e espaços para oficinas, ateliês e reuniões. Os espaços serão abertos à comunidade, inclusive aos finais de semana. Com a ampliação, a Rede CEU passará das 45 unidades em 2012 para 65 unidades em 2016. A diretriz fundamental que orienta a escolha das áreas é a identificação dos territórios com maior vulnerabilidade social e menor demanda atendida.','Rede CEU: Centro Educacional Unificado que se constitui em um complexo educacional, esportivo e cultural caracterizado como espaço público múltiplo.',2,'sp-mais-inclusiva, historia-africa','CEU Heliópolis em fase avançada de obras. 8 unidades em fase de licitação: Freguesia/Brasilândia, , Mooca , Penha, Itaquera (2), Vila Prudente, São Miguel e Vila Maria.','17 novos CEUs com terreno definido: Artur Alvim, Tatuapé, Vila Maria, Pq. Carmo, Freguesia do Ó, Vila Prudente, José Bonifácio, São Miguel, Sacomã, Santo Amaro, Sapopemba, Campo Limpo, Grajaú, Jaraguá (2), Tremembé e Cidade Tiradentes.','','','','','0000-00-00 00:00:00','2015-01-27 21:03:17'),(17,2,1,5,'Obter terrenos, projetar, licitar, licenciar, garantir a fonte de financiamento e construir 243 Centros de Educação Infantil','243 CEIs implantados',1280547630.00,'31 creches','212 creches','A meta será atingida com a construção de novos equipamentos com recursos do município e de parcerias com o Governo do Estado de São Paulo e com o Governo Federal. A política de expansão de vagas em creches é estruturada como um direito das crianças e das mulheres, articulada ao Programa Brasil Carinhoso e a um projeto educacional comprometido com uma educação não-sexista, não-racista e não-homofóbica. O cumprimento da meta gerará aproximadamente 53 mil novas vagas.','Centro de Educação Infantil: unidade de educação municipal para\ncrianças de 0 a 3 anos de idade',3,'sp-carinhosa, sp-mais-inclusiva','31 CEIs concluídas, 32 em obras e 122 licitadas',' 7.800 vagas até dezembro/2014.','As subprefeituras beneficiadas com novas unidades são: Campo Limpo (3), Capela do Socorro, Cidade Tiradentes, Ermelino Matarazzo (2). Freguesia/Brasilândia (2), Itaim Paulista (2), Itaquera, Mboi Mirim, Penha (2), Pinheiros, Pirituba (4), São Mateus (3), São Miguel (4), Sapopemba(2), Vila Prudente','As subprefeituras com unidades em obras são: Campo Limpo (2), Cidade Tiradentes, Ermelino Matarazzo, Itaim Paulista, M\'Boi Mirim (2), Penha e Sapopemba','','','0000-00-00 00:00:00','2015-01-14 21:27:40'),(18,2,1,6,'Construir 65 Escolas Municipais de Educação Infantil (EMEI) e um Centro Municipal de Educação Infantil (CEMEI)','65 EMEIs e 1 CEMEI implantados',295714464.00,'18 EMEIs','47 EMEIs, 1 CEMEI','A meta será atingida com a construção de novos equipamentos com recursos do município e em parceria com o Governo do Estado de São Paulo. A política de expansão de vagas em creches é estruturada como um direito das crianças e das mulheres, articulada ao Programa Brasil Carinhoso e a um projeto educacional comprometido com uma educação não-sexista, não-racista e não-homofóbica. O cumprimento da meta gerará a abertura de cerca de 30 mil novas vagas.','EMEI: Escola Municipal de Educação Infantil: unidade de educação municipal para crianças de 4 a 5 anos de idade.\nCEMEI: Centro Municipal de Educação Infantil: unidade de educação municipal para crianças de 0 a 5 anos de idade.',3,'sp-carinhosa, sp-mais-inclusiva','21 EMEIs entregues e 14 em Obras',' Criação de mais de 8.400 vagas até dezembro/2014.','\nAs subprefeituras beneficiadas com novas unidades são: Campo Limpo, Capela do Socorro, Cidade Tiradentes, Ermelino Matarazzo, Freguesia/Brasilândia (2), Ipiranga, Itaim Paulista, Itaquera, M\'boi Mirim (5), Pirituba (2), Santo Amaro, São Mateus, São Miguel (3).','','','','0000-00-00 00:00:00','2015-01-13 23:22:02'),(19,2,1,6,'Expandir a oferta de vagas para educação infantil por meio da rede conveniada e outras modalidades de parcerias','52 mil novas vagas para educação infantil na rede conveniada e por outras modalidades de parcerias',306263135.00,'22 mil vagas criadas','30 mil vagas criadas','A Rede Conveniada representa os convênios firmados com instituições não governamentais para operação e manutenção das unidades municipais. Pretende-se ainda firmar acordos e parcerias com empresas privadas, em observância ao estabelecido no art. 389 § 2º da CLT, e ainda outras parcerias como PPPs. A política de expansão de vagas em creches é estruturada como um direito das crianças e das mulheres, articulada ao Programa Brasil Carinhoso e a um projeto educacional comprometido com uma educação não-sexista, não-racista e não-homofóbica. O custo total da meta refere-se à manutenção de 52 mil vagas para educação infantil por meio da rede conveniada e outras modalidades de parcerias durante o período de 1 ano.','Rede Conveniada: Instituições não governamentais que oferecem o serviço de educação infantil.\nParcerias: Convênios e acordos com empresas privadas e Parcerias Publico Privadas- PPP.',3,NULL,'43.178 novas vagas oferecidas para a Educação Infantil até Dezembro/2014, sendo 26.846 por meio da rede conveniada e outras modalidades','121 convênios firmados em 2014, totalizando 15.185 vagas para 2014 e 692 vagas para 2015.','*Nota técnica: Justiça do Trabalho de São Paulo suspendeu a realização de novos contratos de creches conveniadas pela Prefeitura de São Paulo no mês de Abril de 2014. A situação foi normalizada após este período.','','','','0000-00-00 00:00:00','2015-01-13 22:55:41'),(20,3,1,6,'Instalar 32 unidades da Rede Hora Certa distribuídas em cada uma das Subprefeituras','32 unidades da Rede Hora Certa instaladas com ambulatório de especialidades',224000000.00,'15 unidades da Rede Hora Certa','17 unidades da Rede Hora Certa','A Rede Hora Certa compõe a atenção ambulatorial especializada definida como um conjunto de ações e serviços que visam atender aos principais problemas de saúde e agravos da população. É necessária a disponibilidade de profissionais especializados de nível superior e médio para a realização dos procedimentos tais como: cirurgia ambulatoriais, procedimentos traumato-ortopédicos, ações especializadas em odontologia, citopatologia, radiodiagnóstico, exames ultrassonográficos e outros. O principal objetivo da Rede Hora Certa é conseguir reduzir o tempo de espera para exames, consultas e procedimentos especializados, incluindo as cirurgias eletivas.','Rede Hora Certa: serviços de atenção ambulatorial especializada com recursos tecnológicos de apoio diagnóstico e terapêutico e procedimentos cirúrgicos de pequeno e médio porte.',3,'sp-mais-inclusiva','Em 2013 foram inauguradas 6 unidades: Freguesia/Brasilândia , Itaim Paulista, Lapa, M\'Boi Mirim (2) e Penha. Além disso, 4 unidades móveis já foram entregues (Brasilândia/Pirituba, Capela do Socorro/Santo Amaro, Ermelino Matarazzo/São Mateus e Sé/Lapa) para atender à demanda emergencial.','Em 2015, foi inaugurada o Hospital Dia da Rede Hora Certa São Miguel Paulista no dia 23/01/2015 juntamente com um Centro de Especialidades em Reabilitação (CER IV) e Centro de Especialidades Odontológicas (CEO III), dando origem ao Complexo de Saúde.','As 4 unidades fixas entregues em 2013 tem leitos de Hospital Dia a disposição para cirurgias ambulatoriais ali realizadas.','','','','0000-00-00 00:00:00','2015-01-13 21:53:01'),(21,3,1,5,'Desenvolver o processo de inclusão do módulo do prontuário eletrônico do paciente (PE) na rede municipal de saúde, integrada ao Sistema SIGA ','Prontuário eletrônico do paciente com o registro da história clínica, exame físico, medicamentos, resultado de exames clínicos, procedimentos, dentre outros, implantados em todos os serviços ambulatoriais e hospitalares com a informatização dos consultórios de cada serviço.',105000000.00,'Projeto Prontuário eletrônico finalizado e finalização da pré implantação','Prontuário eletrônico do paciente implantado','A inclusão do módulo prontuário eletrônico do paciente no SIGA disponibiliza as informações em tempo real para o planejamento e acompanhamento de atividades para a implantação de novos modelos assistenciais; aperfeiçoa a organização do processo de trabalho assistencial, possibilitando subsídios para a agilização de tomadas de decisão clínica e melhoria na qualidade assistencial; integra as atividades administrativas e assistenciais, permitindo redução de custos; utiliza o Cartão Nacional de Saúde como elemento integrador dos diversos níveis do sistema. O prontuário eletrônico deve estar de acordo com as orientações e determinações da Resoluções CFM Nº 1821/2007, 1638/2002.','Prontuário eletrônico do paciente: é o repositório de informações a respeito da saúde do indivíduo, de forma processável eletronicamente.\nSIGA: Sistema Integrado de Gestão e Assistência à Saúde',3,NULL,'Piloto implantado em 2 Unidades Básicas de Saúde e em 6 unidades da Rede Hora Certa.','Será utilizado o Cartão Nacional de Saúde como elemento integrador dos diversos níveis do sistema que será implantado progressivamente à medida que cada consultório clínico/cirúrgico for informatizado.','O Prontuário Eletrônico integra as atividades administrativas e assistenciais, permitindo redução de custos. Ele disponibilizará as informações dos pacientes em tempo real para o planejamento e acompanhamento de atividades, possibilitando subsídios para a agilização de tomadas de decisão clínica e melhoria na qualidade assistencial. ','','','','0000-00-00 00:00:00','2015-01-13 21:05:03'),(22,3,1,6,'Obter terrenos, projetar, licitar, licenciar, garantir a fonte de financiamento e construir 3 novos hospitais, ampliando em 750 o número de leitos do sistema municipal de saúde','3 hospitais em funcionamento',603500000.00,'','3 novos hospitais','Construção de 3 hospitais, com 250 leitos cada um, sendo eles:\n- Hospital Municipal de Parelheiros;\n- Hospital Municipal Brasilândia;\n- Construção de um novo Hospital em substituição ao Hospital Municipal Alexandre Zaio, no mesmo local.\nCom essas construções busca-se aumentar o número e a qualidade dos atendimentos à população, através de ambientes mais propícios a um atendimento\nacolhedor e humanizado.','Hospital: unidade de saúde que busca oferecer atendimento à população no diagnóstico e tratamento em ambientes de internação acolhedores e humanizados',2,'sp-mais-inclusiva','A prefeitura comprou o Hospital Santa Marina. Após reformas, o hospital será reinaugurado com atendimento na área ambulatorial, de internação\ne serviços de apoio diagnóstico terapêutico, no âmbito do Sistema Único de Saúde.','A licitação para as obras do Hospital de Parelheiros está concluída.','','','','','0000-00-00 00:00:00','2015-01-13 21:06:47'),(23,3,1,6,'Recuperar e adequar 16 hospitais municipais, com a ativação de 250 leitos','250 leitos ativados em 16 hospitais recuperados',193256000.00,'7 hospitais recuperados','9 hospitais recuperados','A recuperação dos hospitais, com ativação de leitos, inclui:\n- reformas na estrutura física\n- renovação de equipamentos e mobiliário\n- adequação do quadro de pessoal\nAtravés de reformas, ampliações e adequações necessárias a serem realizadas busca-se:\n- Garantia de segurança aos trabalhadores e usuários destas unidades;\n- Melhores condições de trabalho e atendimento, criando ambientes mais propícios a um atendimento acolhedor e humanizado;\n- Cumprimento integral das normas do Ministério da Saúde, adequando estas unidades ao preconizado pela RDC Nº 50;\n- Atender os apontamentos da Lei Federal nº 10.098 de 19/12/2000 Art.11.\n\nHospitais a serem recuperados e readequados:\n\nHospital Municipal Prof. Waldomiro de Paula\nHospital Municipal José Soares Hungria\nHospital Municipal Tide Setubal\nHospital Municipal Alípio Correa Neto\nHospital Municipal Dr. Carmino Caricchio\nHospital Municipal Dr. Arthur Ribeiro de Saboya\nHospital Municipal Sorocabana\nHospital Municipal Dr. Mario Degni\nHospital Municipal Dr. Fernando Mauro Pires da Rocha\nHospital Municipal Maternidade Escola Dr. Mario de Moraes Altenfeider Silva\nHospital Municipal Infantil Menino Jesus\nHospital Municipal Vereador José Storopoli\nHospital Municipal Cidade Tiradentes - Carmen Prudente\nHospital Municipal Benedicto Montenegro\nHospital Municipal São Luiz Gonzaga\nHospital Municipal Dr. Moysés Deustch - MBoi Mirim','Recuperação: envolve os aspectos físicos e estruturais das instalações e dos equipamentos.\nAdequação: garantir que a estrutura e funcionamento dos hospitais estejam de acordo com as normas vigentes.',3,NULL,'Hospital Dr. Carmino Caricchio (Mooca) readequado. Hospitais Tide Setúbal (São Miguel) e Dr. Ignácio Proença de Gouveia (Mooca) em obras de readequação.','Foram ativados 90 leitos no Hospital Santo Antônio em convênio entre  SUS e Beneficência Portuguesa.','','','','','0000-00-00 00:00:00','2015-01-13 21:22:32'),(24,3,1,6,'Obter terrenos, projetar, licitar, licenciar, garantir a fonte de financiamento, construir e instalar 43 novas Unidades Básicas de Saúde - segundo o modelo da UBS Integral','43 Unidade Básica de Saúde - UBS em funcionamento',236500000.00,'38 UBS integral','5 UBS integral','Diretrizes: integração da atividade programática com o atendimento não agendado; promoção da saúde de forma intersetorial e com a comunidade; organização das condições para coordenar a continuidade do cuidado com os outros pontos de atenção da rede, quando necessário.','Unidade Básica de Saúde Integral: é a porta de entrada preferencial do Sistema Único de Saúde (SUS). Contempla princípios de clínica ampliada, integralidade de ações, resolubilidade, acolhimento, humanização, gestão qualificada do cuidado e atendimento de demanda espontânea, além de apropriação e participação efetiva da comunidade, particularmente em atividades de colegiado de gestão.',3,'sp-mais-inclusiva','4 UBS entregues: Jardim Edith, Jardim Mirian II, Jardim Vera Cruz e Maringá/Talarico.','','','','','','0000-00-00 00:00:00','2015-01-13 21:23:57'),(25,3,1,6,'Reformar e melhorar 20 Prontos Socorros utilizando o modelo conceitual da Unidade de Pronto Atendimento (UPA) e implantar 5 novas UPAs','05 novas UPAS em funcionamento e  reformas em 20 equipamentos de pronto atendimento existentes (Pronto Socorro, AMA 24h), transformando-os em UPAs',237000000.00,'02 novas UPAs, Reformas em 2 serviços existentes','03 novas UPAs,  Reformas em 18 serviços existentes','As UPA serão implantadas em locais estratégicos para a atenção às urgências funcionando ininterruptamente, 24horas por dia, todos os dias da semana. Serão constituídas por equipe multiprofissional interdisciplinar compatível com seu porte e as necessidades assistenciais da região. Sua estrutura garantirá retaguarda às urgências atendidas pela Rede de Atenção Básica e também como local de estabilização de pacientes atendidos pelo SAMU 192.\n\nUPAs a serem reformadas e construídas\nUPA PS Municipal Dr. Caetano Virgilio Netto (serviço existente - ampliação)\nUPA São Jorge (construção nova)\nUPA AMA Paraisópolis (serviço existente - ampliação)\nUPA PA Municipal Jardim Macedônia (serviço existente - ampliação)\nUPA PS Municipal Dona Maria Antonieta F de Barros (serviço existente - ampliação)\nUPA PS Municipal 21 de Junho / Freguesia do Ó (serviço existente - reforma)\nUPA PS Municipal Júlio Tupy (serviço existente - ampliação)\nUPA PS Municipal Augusto Gomes de Matos (serviço existente - ampliação)\nUPA Prof. Waldomiro de Paula - Itaquera (serviço existente - construção nova)\nUPA AMA Dr. Arthur Ribeiro Saboya - Jabaquara (construção nova)\nUPA São Luiz Gonzaga (construção nova)\nUPA AMA Sorocabana (serviço existente - ampliação)\nUPA PS Municipal Prof. João Catarin Mezomo - Lapa (serviço existente - construção nova)\nUPA AMA Dr. Fernando Mauro Pires da Rocha - Campo Limpo (serviço existente - ampliação)\nUPA AMA Dr. Carmino Caricchio - Tatuapé (serviço existente - construção nova)\nUPA PS Municipal Balneário São José (serviço existente - reforma)\nUPA AMA José Soares Hungria - Pirituba (serviço existente - construção nova)\nUPA PS Municipal Lauro Ribas Braga - Santana (serviço existente - reforma)\nUPA PA Municipal São Mateus II (serviço existente - ampliação)\nUPA AMA Complexo Prates (serviço existente - ampliação)\nUPA AMA Sé (serviço existente - ampliação)\nUPA PS Municipal Dr. Álvaro Dino de Almeida (serviço existente - ampliação)\nUPA Santa Casa de São Paulo (construção nova)\nUPA PS Municipal Vila Maria Baixa (serviço existente - ampliação)\nUPA Hospital São Paulo - Vila Mariana (construção nova)\n','Unidades de Pronto Atendimento - UPA 24h: são estruturas de complexidade intermediária entre as UBS e as portas de urgência hospitalares.',3,'sp-mais-inclusiva','Inaugurada a UPA Dr. Fernando Mauro Pires da Rocha (Campo Limpo) em 12/04/2014','Inaugurada a UPA Vila Santa Catarina (Santa Marina) em 24/01/2015.','As UPA serão implantadas em locais estratégicos para a atenção às urgências funcionando ininterruptamente, 24 horas por dia, todos os dias da semana.','Elas serão constituídas por equipe multiprofissional compatível com seu porte e as necessidades assistenciais da região. ','','','0000-00-00 00:00:00','2015-01-13 21:25:02'),(26,3,1,6,'Implantar 30 Centros de Atenção Psicossocial (CAPS)','30 CAPS em funcionamento, sendo: - 13 CAPS III Álcool e Drogas; - 07 CAPS Infantil;  e 10 CAPS III Adulto',64140000.00,'15 CAPS','15 CAPS','Os CAPs são constituídos por equipe multiprofissional que atuam na ótica interdisciplinar. O cuidado no âmbito dos CAPS é desenvolvido por intermédio de Projeto Terapêutico Singular, envolvendo em sua construção a equipe, o usuário e sua família. Os atendimentos são: acolhimento inicial, acolhimento diurno e/ou noturno, atendimento individual, atenção às situações de crise, atendimento em grupo, práticas corporais, práticas expressivas e comunicativas, atendimento para a família, atendimento domiciliar e ações de reabilitação psicossocial, promoção de contratualidade, fortalecimento do protagonismo de usuários e familiares, ações de articulação de redes intra e intersetoriais, matriciamento de equipes dos pontos de atenção da atenção básica, urgência e emergência e dos serviços hospitalares de referência e todas as ações de redução de danos.','CAPS: são pontos de atenção estratégicos para o atendimento das pessoas com transtornos mentais graves e persistentes e também com\nnecessidades decorrentes do uso de crack, álcool e outras drogas, de todas as faixas etárias.',3,NULL,'2 CAPSad II transformados em CAPSad III (24 horas) em Itaquera e São Mateus.','Inaugurado o CAPS AD III Campo Limpo, em 14 de agosto de 2014, e o CAPS Infantil Campo Limpo.','O CAPS AD, importante benefício para a comunidade, funciona 24h por dia e se propõe a realizar atividades relacionadas ao acompanhamento médico, reinserção social pelo acesso ao trabalho, lazer, exercício dos direitos civis e fortalecimento dos laços familiares e comunitários. ','Especializado no cuidado de pessoas que apresentam prejuízos decorrentes do uso ou abuso de álcool, crack e outras drogas, seu público é constituído especificamente de adultos, mas o CAPS AD também pode atender crianças e adolescentes, desde que consideradas as orientações do Estatuto da Criança e do Adolescente (ECA). ','','','0000-00-00 00:00:00','2015-01-13 21:26:04'),(27,4,1,3,'Construir, requalificar ou reformar 16 equipamentos culturais','16 equipamentos culturais implantados',67508000.00,'','16 equipamentos culturais','Serão priorizadas as áreas localizadas nas regiões de maior vulnerabilidade socioeconômica, alta densidade demográfica e carência de equipamentos\nculturais públicos, mas estratégicas para a produção e difusão cultural da cidade.','Construção: edificação integral de equipamento com finalidade cultural, desde a seleção do terreno até a finalização total da obra.\nRequalificação: adaptação de edificação já existente, através de reforma, ou alteração de seu uso para atender a finalidade cultural.\nReforma: restauro ou retificação de edificação existente, caracterizada como de finalidade cultural, através de obra parcial.',2,'sp-mais-inclusiva, historia-africa','O teatro Flávio Império na subprefeitura da Penha foi reinaugurado e os teatros Arthur Azevedo na Mooca e Paulo Eiró em Santo Amaro estão em fase de obras e implantação de estruturas.','Biblioteca Cora Coralina, em Guaianases, e Camila Cerqueira César, no Butantã, estão na fase de obras de readequação. ','2 unidades em Ermelino Matarazo com licitação para obras de readequação em andamento. ','','','','0000-00-00 00:00:00','2015-01-14 19:54:35'),(28,4,1,3,'Alcançar um calendário anual de programação cultural que inclua uma virada cultural no centro, duas descentralizadas e outros pequenos e médios eventos em diferentes temáticas e regiões da cidade','4 Viradas Culturais no Centro,  8 Viradas Culturais em novas centralidades,  4 Festas de São João, 4 Festivais dos Povos do Mundo e demais atividades do Calendário Anual Cultural: Aniversário da Cidade, Maratona de Música, Viradinha das Férias, Festival de Comida, Mês da Cultura Independente, Festa Baile e São Paulo: Cidade do Samba',51362103.00,'2 Viradas Culturais no Centro,  4 Viradas Culturais em novas centralidades,  2 Festas de São João,  2 Festivais dos Povos do Mundo e demais atividades do Calendário Anual Cultural','2 Viradas Culturais no Centro,  4 Viradas Culturais em novas centralidades,  2 Festas de São João,  2 Festivais dos Povos do Mundo e demais atividades do Calendário Anual Cultural','','Calendário de eventos culturais: sistematização de agendas periódicas ou fixas de festivais, bienais feiras, fóruns e encontros, abrangendo todo o território e todos os segmentos culturais.\nEvento cultural: Atividade cultural temporária com o objetivo de difundir manifestações, estimular a criatividade e expressões populares e artísticas, ou promover debates em torno do assunto.\nEvento cultural de pequeno porte: para até 300 pessoas.\nEvento cultural de médio porte: para até 4 mil pessoas.\nEvento cultural de grande porte: para mais de 4 mil pessoas.',4,'sp-carinhosa, sp-mais-inclusiva','Criação do SP Cultura: plataforma livre, gratuita e colaborativa de mapeamento sobre o cenário cultural paulistano para conhecer as opções culturais que a cidade oferece: shows musicais, espetáculos teatrais, sessões de cinema, saraus, entre outras. Além de conferir a agenda de eventos, é possível colaborar na gestão da cultura da cidade, a partir da criação de um perfil de agente cultural. Acesse: http://spcultura.prefeitura.sp.gov.br/','Alguns dos eventos realizados em 2014: Aniversário da cidade com 24h de shows e outras atividades culturais; Virada Cultural em maio com mais de mil atrações em todas as regiões da cidade; Mês da cultura independente; Carnaval de Rua; Carnaska; Dia do Circo; Semana do Hip Hop; Arraial de São Paulo; Mês das Crianças; Consciência Negra; 23: Arte de Rua; Mês do samba; SP na Rua e Inauguração da programação cultural do Clube Tietê.','Alguns dos eventos realizados em 2013: Virada Cultural em maio com a participação de 4 milhões de pessoas e a Festa de São João no Vale do Anhangabaú e em mais 6 bairros com a participação de 1 milhão de pessoas; Festa de São João; 4 Quebradas Culturais; 2 Territórios Funk; Mês da Cultura Independente; Semana do Samba.\nTambém em 2013, foram realizados 4 Quebradas Culturais entre os meses de novembro e dezembro; 2 Territórios Funk em junho com a particpação de 150 mil pessoas; Mês da Cultura Independente em outubro, com um público estimado em 200 mil pessoas; Semana do Samba realizada em dezembro.','','','','0000-00-00 00:00:00','2015-01-13 18:56:26'),(29,4,1,3,'Viabilizar três Centros Culturais de Referência','3 Centros Culturais de Referência em funcionamento (2 novas instalações e 1 instalação viabilizada)',33000000.00,'','3 Centros Culturais','Cada Centro Cultural deverá ser construído em módulos distintos e independentes, de maneira que sua utilização possa ser iniciada enquanto a construção ainda se realiza. A previsão é de atendimento de um público estimado de 85 mil pessoas/mês, através da realização de programação cultural específica e da oferta de outros programas já desenvolvidos pela Secretaria Municipal de Cultura, como o Programa Vocacional e o Programa de Iniciação Artística (PIÁ). A implantação dos equipamentos leva em conta a necessidade de ampliar a oferta de equipamentos em duas regiões que concentram grande número de atores e iniciativas culturais, a zona sul e a zona leste. A viabilização do Centro de Formação Cultural Cidade Tiradentes também foi incorporada à meta. Por viabilização entende-se a criação de condições técnicas, orçamentárias e institucionais para a implementação de cursos e atividades culturais previstos em seu projeto, permitindo o amplo aproveitamento do espaço e do potencial formativo ali existentes.','Centro Cultural: equipamento cultural que contará com área para produção cultural para utilização dos grupos e coletivos culturais da cidade, cinema, área expositiva, centro de memória, biblioteca, centro de estudo de idiomas, espaço para arte e cultural digital e teatro.',3,'juventude-viva','Centro de Formação Cultural Cidade Tiradentes (CFCCT) readequado e em funcionamento:  programação cultural e mais de 20 tipos de cursos -  teatro, cinema, dança,  atividades físicas, entre outros.','Projetos básicos dos Centros Culturais do M\'Boi Mirim e de Itaquera concluídos.','','','','','0000-00-00 00:00:00','2015-01-13 18:57:36'),(30,4,1,3,'Criar o Programa Cultura Viva Municipal com a ativação de 300 Pontos de Cultura','300 Pontos de Cultura em funcionamento',25850000.00,'72 Pontos de Cultura','228 Pontos de Cultura','Os Pontos de Cultura são ações que integram o Programa Cultura Viva, atualmente mantido pelo Ministério da Cultura. A SMC prevê criar o Programa Cultura Viva com a ativação de 300 diferentes Pontos de Cultura considerando que os contemplados irão desenvolver suas atividades por 2 anos, prorrogáveis por igual período. Articular as ações desenvolvidas pelos Pontos de Cultura com a rede de equipamentos culturais (públicos e não públicos), atores e iniciativas culturais do entorno. Serão priorizadas as regiões com baixa estrutura de equipamentos culturais públicos, alta densidade populacional, considerando os índices de vulnerabilidade social. As definições específicas de ações ou projetos contemplados por território ocorre mediante demandas apresentadas anualmente por meio de editais.','Pontos de Cultura: núcleos culturais juridicamente constituídos por ONGs que visam potencializar iniciativas culturais já existentes, ampliando e garantindo o acesso da população à fruição, criação e produção da diversidade cultural da cidade.',3,'sp-mais-inclusiva, historia-africa, juventude-viva','85 Pontos de Cultura selecionados por edital em maio e contratados em agosto de 2014.','O Ponto de Cultura é a referência de uma rede horizontal de articulação e disseminação de iniciativas culturais, com gestão compartilhada entre poder público e sociedade civil.','','','','','0000-00-00 00:00:00','2015-01-13 18:58:39'),(31,4,1,7,'Adaptar e consolidar o Fundo Municipal de Cultura','Fundo Municipal de Cultura em funcionamento',0.00,'','1 Fundo Municipal de Cultura','O Fundo Municipal de Cultura será uma readequação do atual Fundo Especial de Promoção de Atividades Culturais - FEPAC, incorporando as resoluções e determinações do Conselho Municipal de Cultural e do Plano Municipal de Cultura. O Fundo tem a finalidade de financiar ações finalísticas da Secretaria Municipal de Cultura e sua adaptação serve para que ações-meio e políticas também estejam aptas a serem suportadas. Para o ingresso no Sistema Nacional de Cultura, também é preciso que o Fundo ganhe atribuições específicas, como a capacidade de receber transferências fundo a fundo (federal, estadual e municipal).','Fundo Municipal de Cultura: tem por objetivo fomentar projetos e ações culturais na cidade, a partir de diretrizes definidas pelo Conselho\nMunicipal de Cultura e consolidadas no Plano Municipal de Cultura. O Fundo deve permitir a transferência de recursos dos fundos de cultura estadual e federal, bem como a utilização dos recursos em diferentes ações: curadoria, desenvolvimento de projetos, programação cultural etc.',2,NULL,'Estudo para adaptação e aperfeiçoamento do atual Fundo de Cultura realizado. Sua estruturação facilitará a captação de recursos junto a fundos federais e estaduais.','A estruturação do novo Fundo Municipal de Cultura facilitará a captação de recursos junto a fundos federais e estaduais.','O Projero de Lei está em fase de consulta pública do projeto de lei que constituirá o Conselho Municipal de Cultura. ','III Conferência Municipal de Cultura e adesão ao Sistema Nacional de Cultura realizadas ','','','0000-00-00 00:00:00','2015-01-13 19:00:15'),(32,4,1,7,'Conceder 300 Bolsas Cultura para agentes culturais da cidade. ','300 Bolsas Cultura concedidas',6982917.00,'300 Bolsas Cultura','600 Bolsas Cultura','O objetivo do programa é democratizar a produção cultural a partir da remuneração de agentes que já praticam cultura numa visão ampliada. Público-Alvo: Agentes culturais que já desenvolvem práticas culturais numa acepção ampliada (isto é, não apenas ligadas às tradicionais linguagens artísticas, mas também a expressões culturais mais amplas), principalmente na periferia. Entende-se por práticas culturais periféricas não apenas aquelas realizadas em regiões geograficamente separadas das regiões mais ricas da cidade como também aquelas realizadas em condições sociais adversas e não contempladas pelo mercado.Está previsto para 2014 o lançamento do primeiro edital do programa. Serão concedidas nos anos de 2014, 2015 e 2016, 100 bolsas mensais no\nvalor de R$ 1.000,00 a agentes culturais distintos, pelo período de 12 meses, renováveis por igual período. O programa prioriza ações culturais realizadas nas regiões com baixa estrutura de equipamentos culturais públicos, alta densidade populacional, considerando os índices de vulnerabilidade social. As definições específicas de ações ou projetos contemplados por território ocorre mediante demandas apresentadas anualmente por meio de editais. O custo das renovações das bolsas concedidas em 2016 não foi considerado no Custo Total da Meta por ser pago no ano de 2017.','Bolsa Cultura: A seleção é feita por edital público e se dará em duas etapas; eliminatória seguida de sorteio. Forma de inscrição: individual. Modalidade de prestação de contas: relatório anual de atividades.',3,NULL,'150 bolsistas selecionados em agosto de 2014 por edital - Programa Agente Comunitário de Cultura.','São concedidas bolsas mensais no valor de R$ 1.000,00 a agentes culturais, pelo período de 12 meses, renováveis por igual período.','','','','','0000-00-00 00:00:00','2015-01-13 19:01:10'),(33,4,1,7,'Atingir 160 projetos anuais de fomento às linguagens artísticas','160 projetos fomentados',183733241.00,'90 projetos ao ano','160 projetos ao ano','Projetos artísticos e culturais focados na pesquisa continuada, com produtos resultantes como: espetáculos, intervenções artísticas, audiovisuais.O período de duração varia em função da ação proposta em cada projeto, não ultrapassando o prazo máximo de 2 anos. O objetivo é chegar no ano de 2016 com 160 projetos sendo financiados pelos programas de fomento, por isso as entregas previstas para o primeiro e o segundo biênio aqui apresentadas não são cumulativas.','Programa Municipal de Fomento ao Teatro: criado em 8 de janeiro de 2002 - Lei nº 13.279.\nPrograma Municipal de Fomento à Dança: criado em setembro de 2006 - Lei 14.071/05.',5,'sp-mais-inclusiva, historia-africa, juventude-viva','Em 2014, foram fomentados 164 projetos sendo 54 de teatro (dos quais 24 do Prêmio Zé Renato de Teatro - lei 15.951/14); 26 de dança; 59 do Edital Redes e Ruas de inclusão, cidadania e cultura digital e 25 do edital de Fomento ao Circo.','Em 2013, além da criação da SP cine, 120 projetos foram fomentados: 30 do teatro, 30 da dança e 60 do cinema.','','','','','0000-00-00 00:00:00','2015-01-13 19:02:07'),(34,4,1,3,'Atingir 500 projetos fomentados pelo Programa para a Valorização de Iniciativas Culturais - VAI, nas modalidades 1 e 2','500 projetos fomentados',25392425.00,'500 projetos','500 projetos','O programa prioriza ações culturais realizadas nas regiões com baixa estrutura de equipamentos culturais públicos, alta densidade populacional, considerando os índices de vulnerabilidade social. As definições específicas de ações ou projetos contemplados por território ocorre mediante demandas apresentadas anualmente por meio de editais. Os pagamentos são realizados em duas parcelas, sendo 60% na primeira e 40% na segunda parcela. Para a modalidade I o valor destinado para cada projeto é de no máximo R$ 30.000,00 (trinta mil reais) e na modalidade II o valor destinado para cada projeto é de no máximo R$ 60.000,00 (sessenta mil reais) reajustados anualmente conforme o IPCA. É importante potencializar a articulação dos grupos fomentados pelo programa VAI com a rede de equipamentos culturais (públicos e não públicos), atores e iniciativas culturais do entorno. A meta é partir de 175 apoios concedidos em 2013 para 500 projetos apoiados nos anos de 2014, 2015 e 2016.','Programa VAI: tem por finalidade apoiar financeiramente, por meio de subsídio, atividades artístico-culturais de pessoas físicas de baixa renda,\ncom faixa etária de 18 a 29 anos, oriundas de regiões do Município desprovidas de recursos e equipamentos culturais.\nPrograma VAI 2: terá por finalidade apoiar financeiramente, por meio de subsídio, atividades artístico-culturais de grupos e coletivos mais\nconsolidados, cujo escopo das atividades não permite mais seu enquadramento dentro do VAI. Os editais são anuais e o período de realização dos projetos contemplados pelo VAI são de no máximo 12 meses.',3,'sp-mais-inclusiva, historia-africa, juventude-viva','Em 2014, foram selecionados e contratados 238 projetos, sendo 175 na Modalidade 1 e 63 na Modalidade 2.','175 projetos selecionados em 2013, todos na Modalidade VAI 1.','','','','','0000-00-00 00:00:00','2015-01-13 19:03:22'),(35,5,1,2,'Obter terrenos, projetar, licitar, licenciar, garantir a fonte de financiamento e produzir 55 mil unidades habitacionais','55 mil Unidades prontas para o uso em Conjuntos Habitacionais de Interesse Social (HIS)',80000000.00,'18.950 Unidades Habitacionais','36.050 Unidades Habitacionais','Engloba a desapropriação de terrenos, a construção de unidades e a entrega destas às famílias demandantes, tendo como algumas das diretrizes de priorização o recorte de gênero, idade (5% para idosos) e a presença de pessoas com deficiência na família. Além dessas diretrizes gerais, o planejamento prevê 2.000 unidades habitacionais para famílias em situação de rua, conforme explicado em meta específica sobre o tema. Para garantir a entrega de 55.000 Unidades Habitacionais no prazo do Programa de Metas, é necessário a elaboração e execução de projetos para além da meta estabelecida, de forma a se antecipar a eventuais imprevistos. Por esse motivo, a regionalização que aqui se apresenta é superior ao quantitativo da meta.','Unidades Habitacionais de Interesse Social: unidades habitacionais definidas pelo inciso XIII do Art. 146 da Lei nº 13.430/02 (PDE) construídas em terrenos desapropriados ou em áreas públicas desafetadas.',3,'agenda-pop-rua, sp-mais-inclusiva, braços abertos','2.076 unidades habitacionais entregues em 2013 e outras 1694 entregues em 2014 totalizando 3.770 unidades habitacionais','As seguintes subprefeituras já receberam unidades habitacionais: Itaquera, Cidade Tiradentes, Penha, Butantã, Ipiranga, Jabaquara, São Mateus, Freguesia/Brasilândia, Pirituba, Campo Limpo, Santo Amaro e Pinheiros.','','','','','0000-00-00 00:00:00','2015-01-13 22:14:07'),(36,5,1,6,'Beneficiar 70 mil famílias no Programa de Urbanização de Favelas','Assentamentos dotados de infraestrutura, tendo sido eliminadas todas as áreas de risco',552047438.00,'18.150 famílias beneficiadas','51.850 famílias beneficiadas','Engloba a implantação de infraestrutura urbana nos assentamentos precários, possibilitando o acesso dos moradores aos serviços urbanos, a consolidação geotécnica e/ou remoções em áreas de risco. A regionalização aqui descrita é parcial. Outras 20.000 famílias serão beneficiadas em locais ainda a definir.','Programa Urbanização de Favelas: Qualificação urbanística e o reconhecimento formal dos assentamentos precários e/ou informais, garantindo a melhoria da qualidade de vida da população moradora.',3,NULL,'11 projetos de urbanização com obras concluídas.','21 projetos de urbanização em obra.','','','','','0000-00-00 00:00:00','2015-01-16 18:47:07'),(37,5,1,6,'Beneficiar 200 mil famílias no Programa de Regularização Fundiária','Títulos de posse ou de propriedade e emissão de autos de regularização',258807703.00,'116.073 famílias beneficiadas','83.927 famílias beneficiadas','O Programa engloba o diagnóstico fundiário, levantamentos topográficos, projetos de regularização fundiária, cadastramento e coleta de documentação. Para garantir a entrega de 200.000 Unidades Habitacionais no prazo do Programa de Metas, é necessário a elaboração e execução de projetos para além da meta estabelecida, de forma a se antecipar a eventuais imprevistos. Por esse motivo, a regionalização que aqui se apresenta é superior ao quantitativo da meta.','Regularização Fundiária: Reconhecimento formal dos assentamentos precários e/ou informais, garantindo a segurança na posse da população moradora.',3,NULL,'36.580 famílias beneficiadas até dezembro/2014.','Valor executado 2014: 78.523.716,76','','','','','0000-00-00 00:00:00','2015-01-16 21:16:13'),(38,6,1,7,'Ampliar o efetivo da Guarda Civil Metropolitana em 2.000 novos integrantes','Realização de concurso de ingresso e tomada de posse de 2.000 novos guardas civis municipais',24000000.00,'1.000 novos GCMs','1.000 novos GCMs','A ampliação do efetivo será acompanhada das diretrizes de formação em Direitos Humanos e mediação de conflitos.','',3,NULL,'336 agentes formados em 2014.','Concurso Público iniciado em outubro de 2013 teve autorização de nomeação de 500 agentes.','A ampliação do efetivo será acompanhada das diretrizes de formação em Direitos Humanos e mediação de conflitos.','','','','0000-00-00 00:00:00','2015-01-13 21:25:39'),(39,6,1,7,'Capacitar 6.000 agentes da Guarda Civil Metropolitana em Direitos Humanos e 2.000 em Mediação de Conflitos','6.000 GCMs capacitados em Direitos Humanos e  2.000 GCMs capacitados em Mediação de Conflitos',0.00,'6.000 GCMs formados em Direitos Humanos, 2.000 GCMs formados em Mediação de Conflitos','','A meta visa aprimorar a capacitação continuada dos Guardas Civis Metropolitanos, através do Centro de Formação em Segurança Urbana, mediante curso de reciclagem profissional com foco na formação em Direitos Humanos para o policiamento comunitário, inclusive para 2.000 novos GCMs para a capacitação em Mediação de Conflitos. Será constituído um grupo mobilizador estratégico para planejar sistematicamente todas as ações. Serão formados 250 agentes para que atuem como multiplicadores perante toda a GCM. A partir do trabalho do grupo mobilizador, dos educadores já formados e de organizações parceiras, toda a Guarda Municipal será capacitada através do Estágio de Qualificação Profissional. Espera-se com isso promover uma cultura de valorização profissional, a diminuição dos confrontos entre GCM e a população e a institucionalização da educação em Direitos Humanos no sistema de segurança urbana, para atuação em todo o território do município. Todos os cursos serão disponibilizados mediante parceria da Prefeitura junto às Secretarias Nacionais de Segurança Pública e Reforma do Judiciário, do Ministério da Justiça. Haverá também um Acordo de Cooperação junto à Escola Nacional de Mediação - ENAM. A meta será executada diretamente com recursos dos parceiros.','Mediação de Conflitos: é um processo autocompositivo segundo o qual as partes em disputa são auxiliadas por uma terceira parte, neutra ao conflito, sem interesse na causa,para auxiliá-las a chegar a uma composição. Este terceiro, imparcial, facilitará a negociação entre pessoas em conflito, habilitando-as a melhor compreender suas posições e a encontrar soluções que se compatibilizem aos seus interesse e necessidades.',3,'agenda-pop-rua, sp-mais-inclusiva, juventude-viva','4.892 agentes capacitados em Direitos Humanos até dezembro de 2014.','451 agentes capacitados em mediação de conflitos.','A capacitação em mediação de conflitos faz parte de um Convênio com a ENAM - Escola Nacional de Mediação, do Ministério da Justiça, não onerando o orçamento municipal.','','','','0000-00-00 00:00:00','2015-01-13 21:27:08'),(40,6,1,6,'Instalar 1 Casa da Mulher Brasileira em São Paulo','1 Casa da Mulher Brasileira em funcionamento',0.00,'1 Casa implantada','','A Casa da Mulher Brasileira contará com Delegacia especializada de atendimento à Mulher; Juizado especializado de violência doméstica e familiar contra a Mulher; Promotoria pública especializada da Mulher; Defensoria pública especializada da Mulher; atendimento psicossocial; alojamento de passagem; brinquedoteca; orientação e direcionamento para programas de auxílio e promoção da autonomia, geração de trabalho, emprego e renda, bem como integração com os demais serviços da rede de saúde e socioassistencial. Todo o custo de implantação será de responsabilidade da Presidência da República.','Casa da Mulher Brasileira: Centro de Referência integrante do Programa Mulher, Viver sem Violência do governo federal, que reunirá serviços especializados de assistência à mulher em situação de violência.',2,'sp-carinhosa, sp-mais-inclusiva','O processo de licitação para a contratação da obra foi concluído.','Adesão ao Programa “Mulher, Viver Sem Violência”, definindo  responsabilidades municipais e estaduais nos serviços da Casa da Mulher Brasileira.','Adesão ao Pacto Nacional de Enfrentamento à Violência contra as Mulheres em julho de 2013.','Como conquista do processo de venda do terreno, intermediado e viabilizado pela SMPM, foi garantida a entrega dos documentos aos condôminos dos prédios que já existiam na área. Foi atingido um total de 576 apartamentos, que há 60 anos aguardavam essa solução. Com isso, os proprietários podem regularizar seus imóveis.','Início das atividades da Unidade Móvel em abril de 2014, ação integrante do Mulher Viver sem Violência.','','0000-00-00 00:00:00','2015-01-13 21:38:31'),(41,6,1,3,'Instalar 1 Casa Abrigo e 1 Casa de Passagem para ampliar a capacidade de atendimento de proteção às mulheres vítimas de violência','1 Casa Abrigo e 1 Casa de Passagem',7986065.00,'','1 Casa Abrigo, 1 Casa de Passagem','A Casa Abrigo garante a integridade física e psicológica de mulheres e de seus dependentes, com atendimento multidisciplinar que favorece o resgate da autoestima e a reconstrução da autonomia da mulher. A permanência neste local é temporária, até que a mulher reúna condições para retomar ocurso de sua vida. A Casa de Passagem tem por objetivo garantir a integridade física e emocional das mulheres, bem como realizar diagnóstico da situação da mulher para encaminhamentos necessários. A Casa Abrigo tem capacidade para atender 5 famílias. Pretende-se com a construção de uma nova casa, aumentar o número de famílias atendidas nessa modalidade de serviço. Além da Casa Abrigo, a Casa de Passagem complementará o serviço.','Casa Abrigo: serviço de acolhimento institucional de caráter sigiloso para garantia da defesa e da proteção de mulheres em situação de violência doméstica e sexual, que estejam sob grave ameaça ou risco iminente de morte.\nCasa de Passagem: serviço de acolhimento provisório de curta duração (até 15 dias), não sigiloso, para as mulheres em situação de violência doméstica e seus filhos e filhas, que não corram risco iminente de morte.',2,'sp-carinhosa','Em processo de contratação do projeto executivo da Casa de Passagem.','Casa de Abrigo com fonte de financiamento garantida, agora em processo locação de imóvel.','Adesão ao Pacto Nacional de Enfrentamento à Violência contra as Mulheres em julho de 2013.','Processo para aquisição de materiais permanentes e de consumo para equipagem da casa abrigo em andamento.','','','0000-00-00 00:00:00','2015-01-13 21:40:26'),(42,6,1,7,'Reestruturar as Casas de Mediação nas 31 inspetorias regionais da Guarda Civil Metropolitana para promover a cultura de mediação e a solução pacífica de conflitos','Reestruturação das 31 casas de mediação já existentes nas Inspetorias regionais da GCM',380886.00,'','31 Casas de Mediação','A proposta das Casas de Mediação contribui para que a Guarda Civil Metropolitana fortaleça sua vocação comunitária e sua relação com a sociedade. As experiências das 31 casas já em funcionamento apresentam bons resultados e sua reestruturação implica em: requalificação dos mediadores em atividades e formação dos novos mediadores pela Escola Nacional de Mediação do Ministério da Justiça (ENAM/MJ); aparelhamento das casas de mediação; implementação de um sistema de monitoramento e avaliação dos serviços prestados. A formação dos líderes comunitários e a campanha ampliarão o alcance e a efetividade da mediação nas comunidades, promovendo uma cultura de resolução extrajudicial de conflitos.','Mediação de Conflitos: é um processo autocompositivo segundo o qual as partes em disputa são auxiliadas por uma terceira parte, neutra ao conflito, sem interesse na causa, para auxiliá-las a chegar a uma composição. Este terceiro, imparcial, facilitará a negociação entre pessoas em conflito,habilitando-as a melhor compreender suas posições e a encontrar soluções que se compatibilizem aos seus interesses e necessidades.',3,'juventude-viva','Em processo de aquisição de materiais de informática, mobiliário, material de escritório. Edital para reforma física das Casas de Mediação em preparação.','Os 451 GCMs capacitados em mediação de conflitos (meta 39) atuam também nas Casas de Mediação.','Já foram executados 194.187,16 reais na meta.',NULL,NULL,NULL,'2014-01-26 22:41:21','2015-01-26 22:41:21'),(43,6,1,6,'Implementar as ações do Plano Juventude Viva como estratégia de prevenção à violência, ao racismo e à exclusão da juventude negra e de periferia','Campanhas de mobilização da Rede Juventude Viva realizadas,  1 Portal em funcionamento na internet, Guia de Políticas Públicas da Juventude publicado,  2 unidades da Estação Juventude implantadas,  Mapa da Juventude publicado, Projetos locais de prevenção da violência nos territórios prioritários fomentados por edital,  Projetos especiais para fortalecimento e qualificação do sistema socioeducativo, Diretrizes e territórios prioritários para um conjunto de ações transversais indicadas.',33445244.00,'Campanhas de mobilização, 1 Portal em funcionamento na internet 2 Estações Juventude,- 1 Itinerante e 1 Complementar,  1 Guia de Políticas Públicas Mapa da Juventude Paulistana - Fase I Fomento a Projetos Especiais para fortalecimento e qualificação do sistema socioeducativo','Campanhas de mobilização,  Mapa da Juventude Paulistana - Fase 2 , Fomento a Projetos Locais via edital, Fomento a Projetos Especiais para fortalecimento e qualificação do sistema socioeducativo','Informações sobre as entregas prevista nesta meta:\n%u2022 Campanhas de mobilização: as campanhas de mobilização serão realizadas por meio de eventos artísticos e esportivos, como shows, saraus, campeonatos de skate, além de campanhas publicitárias de televisão, internet e rádio contra a cultura de violência e pela prevenção da mortalidade da juventude negra e de periferia.\n%u2022 Portal: criação de um Portal que tenha uma linguagem menos formal, mais plural e interativa, com a predominância de imagens, vídeos, textos\ncurtos e notícias. O Portal deverá fazer uma interface com o Observatório Participativo da Secretaria Nacional da Juventude.\n%u2022 Guia de Políticas Públicas da Juventude: sistematiza as políticas públicas executadas no município que tem como público alvo os jovens, em nível\nmunicipal, estadual e federal.\n%u2022 Estação Juventude: a Estação Juventude é um programa do Governo Federal que tem como principal objetivo instaurar espaços públicos de atendimento à juventude visando facilitar o acesso a políticas públicas de jovens de 15 a 29 anos, além de criar redes para emancipação da juventude, em especial para jovens de territórios com dificuldades de garantia de acesso aos direitos.\n%u2022 Mapa da Juventude: pesquisa quantitativa sobre o perfil e a situação da juventude paulistana e pesquisa qualitativa sobre as expectativas e os hábitos da juventude paulistana.\n%u2022 Projetos Locais de prevenção da violência: a ação prevê selecionar, por meio de edital, projetos da sociedade civil que tenham como ações a prevenção da mortalidade da juventude negra e de periferia, combate ao racismo e desconstrução da cultura de violência.\n%u2022 Diretrizes e territórios prioritários para um conjunto de ações transversais nos territórios prioritários: o Plano será prioritariamente implementado nos territórios da cidade com maior número de jovens negros, maiores índices de homicício contra a juventude, menor IDH, menor número de equipamentos públicos e pior situação no Sistema Intramunicipal de Direitos Humanos SIM-DH. Além das ações previstas nesta Meta, outras secretarias priorizarão os territórios onde o Plano será implantado no desenvolvimento de suas metas: Secretaria Municipal de Educação (Mais Educação); Secretaria Municipal de Desenvolvimento, Trabalho e Empreendedorismo (PRONATEC e VAI-TEC), Secretaria Municipal de Cultura (Pontos de Cultura e VAI), Secretaria Municipal de Serviços (Pontos de Iluminação Pública e Wi-Fi), Secretaria Municipal de Segurança Urbana (Capacitação da GCM); Secretaria Municipal de Saúde (Núcleos de Prevenção de Violência) e Secretaria Municipal de Coordenação de Subprefeituras (Requalificação do espaço público e melhoria de bairro). Além destes programas e ações previstas no Programa de Metas, outras também serão incluídas no Plano Juventude Viva, como o Pro Jovem e o Bolsa Trabalho. O cronograma de entrega, bem como os custos de implantação dessas ações transversais estão descritos em suas respectivas Fichas de Identidade da meta.','Plano Juventude Viva: é uma iniciativa da Secretaria Geral da Presidência da República e da Secretaria de Promoção da Igualdade Racial e reúne ações de onze Ministérios e campanhas de prevenção que visam reduzir a vulnerabilidade dos jovens à situações de violência física e simbólica, a partir da criação de oportunidades de inclusão social e autonomia; da oferta de equipamentos, serviços públicos e espaços de convivência em territórios que concentram altos índices de homicídio; e do aprimoramento da atuação do Estado por meio do enfrentamento ao racismo institucional e da sensibilização de agentes públicos para o problema. Em São Paulo a municipalização do Plano estará a cargo de treze secretarias e será monitorado pelo Comitê Gestor Juventude Viva criado por Decreto 54.511 de 25/10/2013.',3,'historia-africa, juventude-viva','Lançado edital para credenciamento de articuladores territoriais para o Plano Juventude Viva.','Iniciada mobilização para implantação do Juventude Viva em territórios da zona leste - São Miguel e São Mateus.','Realizadas 09 oficinas de mobilização juntos aos Comitês Territoriais do Plano Juventude Viva nos territórios da Freguesia do Ó, Pirituba, Perus, M´Boi Mirim, Campo Limpo e 01 Seminário da Juventude no CEU Casablanca (Campo Limpo).','Realizadas 09 oficinas de mobilização juntos aos Comitês Territoriais do Plano Juventude Viva nos territórios da Freguesia do Ó, Pirituba, Perus, M´Boi Mirim, Campo Limpo e 01 Seminário da Juventude no CEU Casablanca (Campo Limpo).','Formadas 2 turmas da Agência Jovem de Notícias - núcleos para realização de oficinas formativas de educomunicação, direitos humanos, juventude, participação cidadã e técnicas de jornalismo social e colaborativo.','Assinado convênio com Ministério da Saúde para a realização de ações formativas de servidores da Saúde e desenvolvimento de oficinas e atividades culturais com os jovens dos territórios contemplados pelo Plano Juventude Viva, em parceria com a SMS e a SMPIR.','0000-00-00 00:00:00','2015-01-13 21:45:47'),(44,6,1,6,'Implementar 2 novos espaços de convivência e 8 novos serviço de proteção social a crianças e adolescentes vítimas de violência','8 novos Serviços de Proteção Social a crianças e adolescentes vítimas de violência, abuso e exploração sexual e 2 novos Espaços de Convivência para crianças e adolescentes em situação de risco social e pessoal.',13000000.00,'8 Serviços de Proteçã,  2 Espaço de Convivência','','','Serviço de Proteção à criança e adolescente vítima de violência: (SPVV) serviço referenciado que oferece um conjunto de procedimentos técnicos especializados por meio do atendimento social e psicossocial para atendimento às crianças e aos adolescentes vítimas de violência doméstica, abuso ou exploração sexual, bem como aos seus familiares, proporcionando-lhes condições para o fortalecimento da auto-estima, superação da situação de violação de direitos e reparação da violência vivida. Espaços de convivência para crianças e adolescentes: (ECCA) serviço que visa acolher crianças e adolescentes em situação de vulnerabilidade social, oferecendo um espaço alternativo de sociabilidade entre a rua e o território de origem da família.',3,'sp-carinhosa, juventude-viva','3 serviços de proteção a vítimas de violência implantados nas subprefeituras de Jaçanã/Tremembé,  São Mateus e Guaianases.','1 em fase garantia de financiamento na Vila Prudente.','','','','','0000-00-00 00:00:00','2015-01-13 19:15:54'),(45,7,1,2,'Ampliar e modernizar 1 Centro Olímpico de Treinamento e Pesquisa e construir 1 Centro Olímpico de Iniciação e Formação ','1 Centro Olímpico de Treinamento e Pesquisa e 1 Centro Olímpico de Iniciação e Formação',435335000.00,'','2 Centros Olímpicos','Os terrenos que serão utilizados para a construção dos Centros são de administração da Secretaria Municipal de Esportes, Lazer e Recreação e atualmente são destinados para lazer e recreação.','Centro Olímpico de Treinamento e Pesquisa: Equipamento voltado ao esporte de alto rendimento, nos moldes de um clube, com foco em esportes olímpicos, tendo crianças e jovens participando das principais competições municipais, estaduais, nacionais e até internacionais, sem nenhum custo para atletas ou seus pais.\nCentro Olímpico de Iniciação e Formação: Equipamento que permite o treinamento de modalidades olímpicas em suas categorias de base/formação com recurso humanos compatíveis e metodologia utilizada pelo Centro Olímpico de Treinamento e Pesquisa.',3,'sp-mais-inclusiva','Centro Olímpico de Iniciação e Formação da Zona Leste com terreno definido e projeto básico concluído.','Ampliação e modernização do Centro Olímpico de Treinamento e Pesquisa em andamento.','','','','','0000-00-00 00:00:00','2015-01-14 21:13:09'),(46,7,1,5,'Criar 1 Parque de Esportes Radicais','1 Parque de Esportes Radicais no Parque Dom Pedro',27000000.00,'','1 Parque de Esportes Radicais','O Parque de Esporte Radicais terá uma área de 30 mil m². A Secretaria Municipal de Direitos Humanos e Cidadania, por meio da Coordenadoria de Juventude, será parceira e articuladora do público-alvo para a execução da meta.','Parque de Esportes Radicais: Skate, BMX e Patins in line, nas modalidades Street, Park e Vertical, nos níveis de Lazer, Recreação e Alto Rendimento, além de um local para receber eventos relacionados.',2,NULL,'Terreno definido na subprefeitura de Vila Maria / Vila Guilherme.','O Parque tem como proposta incentivar a prática de esportes urbanos, com grande apelo para os(as) jovens.','','','','','0000-00-00 00:00:00','2015-01-14 20:58:02'),(47,7,1,3,'Promover a prática de atividades esportivas, recreativas e de lazer por 24 horas aos finais de semanas nas 32 subprefeituras','32 equipamentos funcionando com atividades no período de 24 horas nos finais de semana',30315964.00,'21 equipamentos contemplados','32 equipamentos contemplados','Atividades de esportes, lazer e recreação (Ex. futebol, vôlei, jogos, atividades lúdicas). A equipe de suporte contará com segurança, limpeza e monitores. A capacidade de atendimento vai variar de acordo com o tamanho do equipamento, beneficiando de 400 a 2.000 pessoas.','Revirando a Virada: abertura das unidade da Secretaria Municipal de Esportes (centro educacionais, balneários, mini balneário, estádios e parques) para 24h de esportes durante os finais de semana.',3,'sp-carinhosa, juventude-viva','Em dezembro de 2014, equipamentos em 11  subprefeituras com atividades 24 horas nos finais de semana: Butantã, Campo Limpo, Freguesia do Ó/Brasilândia, Ipiranga, Itaquera, Jabaquara, Santana, São Miguel, Sé, Vila Mariana e Vila Prudente. \n','Em 2014, a 8a edição da Virada Esportiva foi realizada em setembro, com atividades espalhadas por mais de 400 endereços em todas as regiões da cidade. ','','','','','0000-00-00 00:00:00','2015-01-20 22:18:28'),(48,7,1,3,'Requalificar 50 equipamentos esportivos entre Centros Desportivos da Comunidade (CDC) e Clubes-Escola','50 equipamentos requalificados',61060000.00,'22 equipamentos requalificados','28 equipamentos requalificados','Por requalificação entende-se reforma básica e, quando possível, implantação de novos serviços e/ou equipamentos na área a ser qualificada. Há um grupo intersecretarial formado para identificar os CDCs que poderiam passar pela requalificação e para definir a integração desse Centros com equipamentos de outras áreas, como educação ou saúde, por exemplo.','Clube Desportivo da Comunidade (CDC): unidades esportivas em terrenos municipais, mas de administração indireta. A gestão do espaço é feita por entidades da comunidade local com reconhecida vocação para o trabalho esportivo, legalmente constituídos em forma de associação comunitária ou eleitos pela própria população do bairro. São menores que os equipamentos diretamente administrados pela prefeitura.\nClube Escola: tem o objetivo de oferecer ao munícipe em idade escolar a oportunidade de participar das atividades esportivas, recreativas e de\nlazer, nos Clubes Esportivos Municipais.\nClubes Esportivos Municipais: estruturas públicas que oferecem diversas atividades para a saúde, bem-estar, lazer e recreação da população de todas as regiões de São Paulo.',3,'sp-carinhosa','37 equipamentos requalificados em 24 subprefeituras.','Um dos equipamentos é o antigo Clube de Regatas Tietê, que foi reformado e reaberto para a população durante Evento Virada Esportiva em 20/09/2014.','Os 37 equipamentos requalificados estão nas subprefeituras: Aricanduva/Formosa/Carrão,Butantã,Campo Limpo,Casa Verde/Cachoeirinha,Cidade tiradentes,Freguesia/Brasilândia, Ipiranga,Jabaquara,Jaçanã/Tremembé, Lapa,M\'Boi Mirim,Mooca,Penha,Pirituba,Santana /Tucuruvi,Santo Amaro,São Mateus,São Miguel,Sé,Vila Maria/Vila Guilherme,Vila Prudente,Vila Mariana. \n','','','','0000-00-00 00:00:00','2015-01-20 22:25:01'),(49,7,1,3,'Construir 5 Centros de Iniciação Esportiva - CIE','Construção de 5 Centros de Iniciação Esportiva (CIE)',15870000.00,'','5 Centros de Iniciação Esportiva','Os CIEs são dimensionados em três modelos que se adaptam ao tamanho do terreno. MODELO I: Prevê a construção de ginásio poliesportivo com arquibancada para 195 pessoas e área de apoio com administração, vestiários, chuveiros, enfermaria, copa, depósito e academia (2.500 m²). MODELO II: Prevê a construção de ginásio poliesportivo com arquibancada para 195 pessoas, área de apoio com administração, vestiários, chuveiros, enfermaria, copa, depósito e academia e arena poliesportiva externa (3.500 m²). MODELO III: Prevê a construção de ginásio poliesportivo com arquibancada para 195 pessoas, área de apoio com administração, vestiários, chuveiros, enfermaria, copa, depósito e academia e complexo de atletismo (7.000 m²).','CIE: O CIEs são instalações públicas multiesportivas para crianças e jovens inciarem a prática de modalidades olímpicas e paraolímpicas, localizado em áreas de vulnerabilidade social, voltados à iniciação esportiva e ao esporte de alto rendimento, estimulando a detecção de talentos e a formação de atletas.',2,'sp-carinhosa, sp-mais-inclusiva, juventude-viva','4 Unidades dos Centros de Iniciação Esportiva com local definido e fonte de financiamento garantida. ','As 4 unidades previstas estarão nas subprefeituras de Freguesia do Ó/Brasilândia, Campo Limpo, Lapa e Vila Prudente. ','','','','','0000-00-00 00:00:00','2015-01-15 19:58:28'),(50,8,1,2,'Tornar acessíveis 850 mil m² de passeios públicos','850 mil m2 de passeio público acessíveis pelos Programas Caminho Seguro e Rotas Turísticas',167070000.00,'420 mil m2 de passeios públicos acessíveis','430 mil m2 de passeios públicos acessíveis','Padronização e readequação de passeios públicos em vias estruturais, em rotas estratégicas e diante de prédios municipais, com adequações em acessibilidade e um conjunto de intervenções: implantação de rampas, colocação de piso tátil, e outras medidas, implementando novo conceito de passeio público, organizando a localização do mobiliário urbano, garantindo livre circulação de pedestre e pessoas com deficiência ou mobilidade reduzida. A execução do serviço seguirá os padrões estabelecidos pela Portaria Intersecretarial 04/SMSP/SMPED publicada em 06/2008 que estabelece diretrizes executivas para passeios públicos em concreto moldado \"in loco\".','Acessibilidade: Condição para utilização, com segurança e autonomia, total ou assistida, dos espaços mobiliários e equipamentos urbanos, das edificações, dos serviços de transportes e dispositivos, sistemas e meios de comunicação e informação, por pessoa com deficiência ou mobilidade reduzida.\nCaminho Seguro: Percurso segregado da via destinado a circulação de pedestres de forma a permitir seu deslocamento com segurança e autonomia, inclusive para pessoas com deficiência e mobilidade reduzida.\nRotas Turísticas: Caminho seguro no entorno de pontos turísticos.',3,'sp-mais-inclusiva','101616,5 m² de passeios públicos tornados acessíveis na cidade.','Isso corresponde a um número 6 vezes maior que o de todo o calçamento da Rua Augusta.','','','','','0000-00-00 00:00:00','2015-01-13 22:19:20'),(51,8,1,6,'Garantir a acessibilidade para pessoas com mobilidade reduzida em 100% da frota de ônibus','%u2022 Ônibus com plataforma elevatória ou veículo de piso baixo com acesso por rampa e dispositivo de sinalização sonora, tátil e visual.',0.00,'80%','100%','Renovação da frota de ônibus realizada pela empresa contratada mediante as regras estabelecidas em contrato (pela gestora SPTrans). Todo veículo novo obrigatoriamente deve ser acessível.\n* Meta viabilizada por meio do contrato de concessão do sistema municipal de transporte.','Frota Acessível: ônibus com acesso para as pessoas com mobilidade reduzida, em duas modalidades - veículos com piso baixo e rampa de acesso ou com plataforma elevatória (e.g. \"elevador\" para veículos com degraus de acesso) e com sinalização sonora, tátil e visual para acesso de pessoas com deficiência visual e auditiva.',3,'sp-mais-inclusiva','O percentual da frota de ônibus acessível passou de 59,9% em janeiro/2013 para 76,8% em novembro/2014','A frota acessível tem capacidade para transportar diariamente cerca de 4 milhões de usuários, a população somada de Manaus e Curitiba.','A garantia de 100% de acessibilidade física na frota somente poderá ocorrer após a retomada da renovação dos contratos de concessão, cujo cronograma sofreu adiamento para possibilitar ampla discussão popular, nos conselhos de participação e Câmara Municipal','','','','0000-00-00 00:00:00','2015-01-13 21:30:00'),(52,8,1,6,'Garantir a oferta de vagas a todas as crianças beneficiárias do Benefício de Prestação Continuada da Assistência Social (BPC) e seu acompanhamento nos moldes do BPC Escola','Vagas garantidas e acompanhamento das crianças beneficiárias do BPC',0.00,'','','Programa BPC na Escola tem quatro eixos principais: 1) identificar, entre os beneficiários do BPC até 18 anos, aqueles que estão na escola e aqueles que estão fora da escola; 2) identificar as principais barreiras para o acesso e a permanência na  escola das pessoas com deficiência beneficiárias do BPC; 3) desenvolver estudos e estratégias conjuntas para superação dessas barreiras; e 4) manter acompanhamento sistemático das ações e programas dos entes federados que aderirem ao programa. A meta é garantir vagas para crianças de 0 a 5 anos (dentro da governabilidade do município) e garantir o acompanhamento em todas as idades (0 a 18) pela ação intersetorial - Educação, Assistência Social, Saúde e Direitos Humanos. O Programa BPC na Escola é uma das ações previstas no Plano Nacional dos Direitos da Pessoas com Deficiência - Plano Viiver sem Limite, pactuado entre a Prefeitura de São Paulo e Governo Federal no dia 19 de Abril de 2013.','BPC: Benefício da Política de Assistência Social que garante o pagamento de 1 salário mínimo a todas as pessoas com deficiência (em qualquer idade).\nBPC na Escola: tem como objetivo desenvolver ações intersetoriais, visando garantir o acesso e a permanência na escola de crianças e adolescentes com deficiência, de 0 a 18 anos, beneficiários do BPC.',3,'sp-carinhosa, sp-mais-inclusiva','Levantamento dos beneficiários do BPC realizado em parceria com a Secretaria Municipal de Assistência e Desenvolvimento Social. Garantia das vagas ocorrendo regularmente.','A oferta depende da procura dos pais ou responsáveis pelas crianças beneficiárias do BPC.',NULL,NULL,NULL,NULL,'0000-00-00 00:00:00','2014-10-31 03:28:06'),(53,8,1,7,'Efetivar o funcionamento da Central de Libras ','Central de Libras em funcionamento.',24500000.00,'1 central','','O atendimento deverá ser 24 horas e direcionado às pessoas surdas ou com deficiência auditiva e surdocegas, conforme estabelecido pela Lei 14.441/07. A Central atenderá toda a cidade e deverá proporcionar a comunicação dos munícipes surdos ou com deficiência auditiva e surdocegos nos serviços municipais a partir de modalidade presencial e virtual.','Tradução /Interpretação da Libras/Português: Serviço de mediação entre surdo ou com deficiência auditiva, usuário da Libras e o atendente do órgão público.\nGuia-Interpretação: Fornecimento de Guia-Intérprete para atendimento presencial ao munícipe surdocego nos serviços municipais',2,'sp-mais-inclusiva','Tecnologia de tradução, intérprete e guia-interpretação para atendimentos presenciais e telepresenciais - considerando as diferentes formas de deficiência - em fase de testes para publicação de edital para contratação.','Adesão ao Plano Nacional \"Viver sem Limite\" e instituído o Plano Municipal de Ações Articuladas para as Pessoas com Deficiência \"São Paulo mais Inclusiva\".','Adesão à Central de Interpretação de Libras - CIL do Governo Federal','Edital em fase de análise jurídica',NULL,NULL,'0000-00-00 00:00:00','2014-10-31 03:28:06'),(54,8,1,6,'Revitalizar os Centros de Formação e Acompanhamento à Inclusão (CEFAI) ampliando a oferta de vagas para crianças com necessidades especiais','13 CEFAIs revitalizados',1820000.00,'13 CEFAIs','','A ação de revitalização prevê a modernização dos equipamentos, atualização do acervo bibliográfico, produção e aquisição de novos materiais, ações de formação continuada dos professores, desenvolvimento de técnicas para o acompanhamento e supervisão do trabalho realizado nas Salas de Apoio e Acompanhamento à Inclusão.','CEFAI: Centros de formação e Acompanhamento a Inclusão - é responsável por desenvolver ações de formação e projetos, produzir materiais, orientar e supervisionar as Salas de Apoio e Acompanhamento à Inclusão (SAAI), além de dispor de acervo bibliográfico e de disponibilizar equipamentos específicos para alunos com necessidades educacionais especiais.\nSAAI: Sala de Apoio e Acompanhamento à Inclusão - atende a alunos com necessidades educacionais que podem ou não se relacionar com deficiências, limitações ou disfunções no processo desenvolvimento, assim como com situação de superdotação ou altas habilidades. Este espaço se constitui como um serviço de apoio pedagógico especializado, desenvolvido por professores especializados. A Unidade Educacional é quem requisita a instalação desta sala e disponibiliza o serviço para os alunos da própria escola ou de outras Unidades da Rede Municipal de Ensino de seu entorno, onde não exista tal atendimento.',3,'sp-carinhosa, sp-mais-inclusiva','5.600 vagas oferecidas em 2014 até agosto e 88 salas criadas de 2013 a agosto 2014.','Previsão de ampliação para 08 o número de professores de Acompanhamento e Apoio à Inclusão – PAAI em cada um dos 13 CEFAIs.','','','','','0000-00-00 00:00:00','2015-01-19 18:56:23'),(55,8,1,6,'Implantação de 10 residências inclusivas para pessoas com deficiência','10 Residências inclusivas em funcionamento',2800000.00,'6 Residências Inclusivas','4 Residências Inclusivas','O público-alvo do Serviço de Acolhimento Institucional em Residência Inclusiva são jovens e adultos com deficiência, em situação de dependência, prioritariamente aqueles atendidos pelo Benefício de Prestação Continuada - BPC, que não disponham de condições de autossustentabilidade ou de retaguarda familiar e/ou que estejam em processo de desinstitucionalização de instituições de longa permanência.','Residência Inclusiva: unidade que oferta Serviço de Acolhimento Institucional, no âmbito da Proteção Social Especial de Alta Complexidade do SUAS, conforme estabelece a Tipificação Nacional dos Serviços Socioassistenciais.',3,'sp-mais-inclusiva','3 Residências Inclusivas implantadas, sendo 2 na região de Santo Amaro e 1 na Sé.','1 Residência Inclusiva na subprefeitura da Sé com financiamento garantido e contrato de aluguel em andamento. ','','','','','0000-00-00 00:00:00','2015-01-14 21:16:05'),(56,8,1,7,'Implantação de 5 Centros Especializados de Reabilitação (CER) ','05 CER em funcionamento, com quatro modalidades de reabilitação: Auditiva, Física, Intelectual e Visual',60420000.00,'05 CER','','','Centro Especializado de Reabilitação: serviço de atendimento de pacientes, em todas as faixas etárias, que necessitam de tratamento especializado em reabilitação, diagnóstico, avaliação e orientação, dentro de uma estrutura adequada à sua condição física e mental.',2,'sp-mais-inclusiva','Foram readequados e requalificados 15 serviços existentes.','Nos CER são realizados tratamentos especializados em reabilitação, diagnóstico, avaliação e orientação.','','','','','0000-00-00 00:00:00','2015-01-26 21:41:44'),(57,9,1,7,'Criar e efetivar a Secretaria Municipal de Promoção da Igualdade Racial','Secretaria instituída e em funcionamento',0.00,'1 Secretaria','','A implementação da Secretaria tornará possível a institucionalização das politicas de promoção da igualdade racial tendo como instrumento o Plano Municipal da Igualdade Racial do município de São Paulo.','',4,'historia-africa','Secretaria Municipal de Promoção da Igualdade Racial criada em maio (Lei 15.764/2013).','III Conferência de Promoção da Igualdade Racial realizada em agosto','Evento \"Mês da Consciência Negra\" realizado em novembro de 2014','Samba reconhecido como patrimônio imaterial',NULL,NULL,'0000-00-00 00:00:00','2014-10-31 03:28:06'),(58,9,1,7,'Viabilizar a implementação das Leis Federais 10.639/2003 e 11.645/2008 que incluem no currículo oficial da rede de ensino a temática da História e Cultura Afro-Brasileira e Indígena','Professores da Rede Municipal de Ensino formados',3000000.00,'8','16','A capacitação deverá atender os profissionais da educação inicialmente nas Diretorias Regionais de Ensino onde há uma maior concentração de população negra ou indígena.','Leis Federais 10.639/2003 e 11.645/2008: Leis que incluíram no currículo oficial da rede de ensino a obrigatoriedade da temática da História e Cultura Afro-Brasileira e Indígena.',3,'historia-africa','Total de 11.120 professores capacitados para o ensino de História  e Cultura Afro-Brasileira e Indígena nas escolas e 4.840 em outras formações na temática até dezembro de 2014.','Publicados 2 volumes de uma edição especial para o município sobre História Geral da África em parceria com o MEC.','13 seminários formativos para docentes: \"A presença indígena na cidade de São Paulo\" - Programação da 1ª Mostra Cultural Agosto Indígena nos CEUs.','Série de Seminários \"Encontro com professores”, em parceria com Museu Afro Brasil. Até agora já foram realizados 7 seminários, com foco nos profissionais da rede de ensino, totalizando 350 vagas.','14 Seminários Formativos para docentes “Relações raciais e educação: aportes para práticas pedagógicas antirracistas” – Programação 2ª Mostra Cultural Novembro Negro nos CEUs.','5 Seminários Formativos para docentes “Olhares para a Imigração em São Paulo: subsídios para práticas pedagógicas voltadas à diversidade cultural”– Programação I Mostra Cultural Dezembro Imigrante nos CEUs.','0000-00-00 00:00:00','2014-10-31 03:28:06'),(59,9,1,7,'Criar e efetivar a Secretaria Municipal de Políticas Para as Mulheres','Secretaria instituída e em funcionamento',0.00,'1 Secretaria','','Construir o projeto de lei, através da elaboração do organograma, da exposição de motivos e da minuta do projeto, que irá propor a criação da Secretaria Municipal de Políticas para as Mulheres para a Câmara dos Vereadores.','',4,NULL,'Secretaria de Políticas para as Mulheres criada em maio (Lei 15.764/2013).','Constituição do Conexão Mulher – Comitê Intersecretarial de Políticas para as Mulheres da Prefeitura de São Paulo em dezembro/2013.',NULL,NULL,NULL,NULL,'0000-00-00 00:00:00','2014-10-31 03:28:06'),(60,9,1,6,'Reestruturar os 5 Centros de Cidadania da Mulher, redefinindo suas diretrizes de atuação','5 Centros de Cidadania da Mulher reestruturados',1115707.00,'','5 Centros de Cidadania','A reestruturação consiste em reformular as atividades realizadas no espaço, formar e capacitar as gestoras para que os Centros cumpram a proposta de favorecer o processo de reflexão coletiva sobre a situação e a condição das mulheres com vistas a estimular a análise e o debate sobre a desigualdade entre os gêneros e os caminhos para a sua superação, através do empoderamento e da construção da autonomia das mulheres.\nPretende-se, com isso, que estes Centros sejam espaços, primordialmente, que desenvolvam, implementem e apoiem programas e projetos voltados à construção da autonomia econômica das mulheres, inclusive em áreas que não são consideradas tradicionalmente femininas.','Centros de Cidadania da Mulher (CCM): equipamento público que se constitui como espaço de qualificação e formação da cidadania ativa, no qual as mulheres podem se organizar para defender seus direitos sociais, econômicos e culturais, propor e participar de ações e projetos que estimulem a implementação de políticas de igualdade e potencializar, por meio do controle social, os serviços públicos existentes, de tal modo a atender a suas necessidades e da sua comunidade, com vistas a superação das desigualdades de gênero.',2,'juventude-viva','Convênio assinado com o Governo Federal para financiamento do Projeto de Formação de Cooperativas para a autonomia econômica das mulheres nos 5 CCM (Parelheiros, Itaquera, Santo Amaro, Perus, Capela do Socorro)','Recursos aprovados para a compra de equipamento de informática e mobiliário para os 5 CCMs.','','','','','0000-00-00 00:00:00','2015-01-14 18:42:07'),(61,9,1,6,'Desenvolver ações permanentes de combate à homofobia e respeito à diversidade sexual','Campanha de mobilização contra a homofobia e respeito à diversidade sexual: conjunto de ações que compreende a produção e distribuição de diversos materiais como panfletos, pequenos cartões, cartazes, broches, camisetas, spots de rádio, peças de audiovisual para TV e filmetes para internet, Atividades culturais no Largo do Arouche e República, Atividades de formação continuada na rede municipal de ensino pela convivência pacífica com as diferenças, 17ª, 18ª, 19ª e 20ª Paradas do Orgulho LGBT, Ações de integração social e econômica para travestis e transexuais , 5 Centros de Combate à Homofobia em funcionamento , 5 Unidades de atendimento móvel com equipe e materiais de orientação sobre direitos e políticas públicas.',19664928.00,'1 Campanha de mobilização, 2 Paradas do Orgulho LGBT, 1 Centro de Combate à Homofobia reformulado, 1 Centro de Combate à Homofobia construído, 2 Unidades de atendimento móvel','2 Campanhas de mobilização, 2 Paradas do Orgulho LGBT, 3 Centros de Combate à Homofobia construídos, 3 Unidades de atendimento móvel','A meta envolve um conjunto articulado de entregas que se complementam. As campanhas de mobilização atuarão diretamente no combate à homofobia, promovendo o respeito à livre orientação sexual e identidade de gênero. As atividades de formação buscam combater o bullying homofóbico e a evasão escolar da população LGBT. A Parada do Orgulho LGBT de São Paulo é o maior evento desse tipo, em todo o mundo. É uma manifestação da sociedade civil, organizada pela Associação da Parada do Orgulho LGBT (APOGLBT), porém apoiada pela Prefeitura Municipal de São Paulo, por ser uma legítima manifestação democrática e de afirmação dos direitos humanos. Com a criação dos 4 novos Centros de Combate à Homofobia e a reformulação do já existente na região central, pretende-se criar uma rede de proteção às vitimas de violência homofóbica. As unidades móveis atuarão como porta de entrada para a rede de proteção às vitimas de violência homofóbica nos locais de convívio da população LGBT , aproximando os serviços públicos municipais da comunidade. O Largo do Arouche, por sua vez, é um reduto histórico da comunidade LGBT desde os anos 30 e carece de revitalização e incentivo à ocupação do espaço pela cidadania.','Diversidade Sexual: designa as várias formas de expressão da sexualidade humana\nHomofobia: ódio ou aversão que gera discriminação e/ou violência contra pessoas lésbicas, gays, bissexuais, travestis e transexuais (LGBT)',3,NULL,'Realizada a XVIII Parada do Orgulho LGBT em maio de 2014.','Aprovado, no âmbito do Conselho Municipal de Saúde, o Plano Operativo de Saúde Integral da População LGBT que prevê o referenciamento de 09 UBS para atendimento em saúde integral e disponibilização de hormonoterapia na rede básica de saúde para travestis e transexuais.','Lançado Projeto #WikiPraça: realização de ações de intervenção cultural e ocupação pela cidadania no Largo do Arouche.','Realizadas ações de formação continuada para GCM (três turmas), servidores da Saúde (sensibilização com equipes de nove unidades) e da Educação.','Realizado curso de formação política e de cidadania para beneficiárias do POT Transcidadania.','Confirmação do repasse de recursos do convênio com Governo Federal para reestruturação do Centro de Combate à Homofobia da região central.','0000-00-00 00:00:00','2015-01-14 18:44:11'),(62,9,1,6,'Implantar a Ouvidoria Municipal de Direitos Humanos','Ouvidoria em funcionamento, que contará com: Serviço de atendimento presencial com equipe interdisciplinar (advogados, assistentes sociais e psicólogos), serviço telefônico gratuito.',945418.00,'Ouvidoria implantada','','A Ouvidoria fará conexão com a Ouvidoria Nacional dos Direitos Humanos, vinculada à Secretaria de Direitos Humanos da Presidência da República, e será o interlocutor do Disque 100 em âmbito local.\nPor meio destes serviços, fará o recebimento e registro de violações a direitos humanos, orientações e encaminhamentos, assim como o monitoramento das violações. As informações da Ouvidoria poderão subsidiar a base do Centro de Informações em Direitos Humanos, relatórios e estudos para o fortalecimento das políticas públicas no município. O serviço Disque 100 fará o encaminhamento das denúncias lá recebidas. Com base nesta parceria será desenvolvido um sistema informatizado de encaminhamento de denúncias na Ouvidoria municipal, que se dará a partir de módulos temáticos de tipos de violações de direitos, por exemplo, contra crianças e adolescentes, população LGBT, idosos, denúncias de tortura e racismo.','Ouvidoria de Direitos Humanos: canal de atendimento direto à população para recebimento de denúncias sobre violações aos direitos humanos e encaminhamento à rede de garantia de direitos',2,NULL,'Firmado, como etapa preparatória à criação da ouvidoria, convênio com SDH-PR para criação de um Centro de Referência para atendimento e tratamento de casos de violação de Direitos Humanos.','Projeto de Lei de criação da Ouvidoria Municipal de Direitos Humanos em preparação.','Acordo de cooperação com a Ouvidoria Nacional e Disque 100 em fase de elaboração.','','','','0000-00-00 00:00:00','2015-01-14 18:45:15'),(63,9,1,6,'Implementar a Educação em Direitos Humanos na rede municipal de ensino','6.000 profissionais de educação formados (aproximadamente 10% do total), Guia de orientação escolar e 4 cadernos temáticos sobre EDH produzidos e distribuídos para as escolas, Prêmio Municipal de EDH, 4 Centros de Educação em Direitos Humanos em CEUs',2796442.00,'2.000 profissionais da educação formados, 2 Prêmio realizados, 4 Centros de Educação em Direitos Humanos em funcionamento','4.000 profissionais da educação formados, 2 Prêmio realizados, Guia de orientação escolar e 4 cadernos temáticos sobre EDH produzidos e distribuídos para as escolas','Por meio das entregas mencionadas, pretende-se que as escolas da rede municipal insiram EDH em seu Projeto Político-Pedagógico e efetivamente trabalhem as questões de Direitos Humanos junto a toda a comunidade escolar.\nAs formações serão oferecidas na modalidade Ensino à Distância - EaD por meio de parceria com o Ministério da Educação e universidades federais. Será feita ampla divulgação para toda a rede municipal e a adesão dos participantes será voluntária. As escolas formarão grupos de trabalho compostos por professores, funcionários e gestores.\nTambém serão produzidos um guia escolar e quatro cadernos temáticos para serem utilizados em escolas. Os materiais didáticos têm como proposta abordar as diversas formas de discriminação e violência existentes no cotidiano escolar, contribuindo para que os profissionais de educação trabalhem estes temas de forma efetiva.\nO Prêmio Municipal de EDH tem como objetivo dar visibilidade e valorizar as iniciativas e boas práticas desenvolvidas na rede. Realizado anualmente, contribuirá para o desenvolvimento de novas iniciativas e a disseminação das experiências bem sucedidas.\nPor fim, serão implantados 4 %u201CCentros de Educação em Direitos Humanos%u201D em CEUs, criando pólos de irradiação de conhecimento, material didático, pesquisa, articulação comunitária e promoção da cultura dos Direitos Humanos na rede municipal de ensino. Os custos iniciais de implementação e manutenção serão viabilizados por convênio com a Secretaria de Direitos Humanos da Presidência da República, aproveitando-se a infraestrutura já existente dos CEUs.','Educação em Direitos Humanos (EDH): promove a formação para a cidadania e a democracia, através do conhecimento e do exercício de direitos.',3,NULL,'800 educadores da rede municipal formados por meio de seminário e cursos presenciais e à distância.','2º Prêmio Municipal de Educação em Direitos Humanos realizado','Contratação de empresa para coordenação pedagógica e realização de atividades culturais nos 4 Centros de Educação em Direitos Humanos.','7º Festival Entretodos de Curta Metragem em Direitos Humanos realizado.','','','0000-00-00 00:00:00','2015-01-14 18:47:17'),(64,9,1,6,'Criar a Comissão da Verdade, da Memória e da Justiça no âmbito do Executivo municipal','Comissão criada e em funcionamento, Construção de, ao menos, 4 sítios de memória nos Cemitérios do Araçá, Perus e Vila Formosa e no Parque do Ibirapuera, Apoio técnico para identificação dos restos mortais de desaparecidos políticos, Ações de educação e cultura pelo direito à memória e à verdade apoiados.',2967535.00,'Comissão criada, 2 Sítios de Memória construídos','2 Sítios de Memória construídos','Os trabalhos da Comissão da Memória e Verdade da Prefeitura Municipal de São Paulo, em colaboração com as demais comissões da verdade com atuação no muncípio, deverão contribuir para a) o esclarecimento sobre casos de graves violações de direitos humanos ocorridas no município; b) a identificação de corpos e restos mortais de desaparecidos políticos; c) o levantamento de informações sobre esse período ocorridas na cidade de São Paulo; d) adoção de medidas e políticas públicas de educação e cultura para prevenir violação de direitos humanos, assegurar sua não repetição e promover a efetiva reconciliação. Um dos trabalhos esperados é a nominação de escolas, bibliotecas, praças, parques e vias públicas, homenageando mortos e desaparecidos políticos durante a Ditadura Militar (conforme previsto pela Lei municipal n. 15.717/2013).','Comissão da Verdade: tem como objetivo examinar e esclarecer as graves violações de direitos humanos praticadas no município de São Paulo no período de 1964 a 1988, a fim de efetivar o direito à memória e à verdade histórica, à luz da Comissão Nacional da Verdade, instituída pela Lei Federal 12.528/2011\nSítios de memória: são locais que estiveram de alguma forma relacionados às violações de direitos humanos ocorridas durante o período militar ou locais simbólicos escolhidos para prestar homenagens aos mortos e desaparecidos durante esse período. Nesses lugares serão construídos memoriais para resgatar e registrar esses fatos, entre os quais monumentos, centros de reflexão, placas de identificação, entre outros.',4,NULL,'Comissão da Memória e Verdade da Prefeitura de São Paulo criada (Lei Municipal nº 16.012, de 16 de junho de 2014) e instalada no Edifício Ramos de Azevedo em 25 de setembro de 2014, onde situa-se o Arquivo Histórico de São Paulo','Monumento em Homenagem aos Mortos e Desaparecidos Políticos da ditadura inaugurado no Parque do Ibirapuera dia 08 de dezembro de 2014','Formalizado convênio entre SMDHC, SDH-PR e UNIFESP para viabilizar a retomada da identificação dos mortos encontrados na vala clandestina de Perus.','Continuidade das ações nas áreas de educação,  cultura e mobilização social para marcar e refletir sobre o que foi o golpe por meio da realização de 12 seminários para a formação de alunos e 1.300 professores em parceria com as Diretorias Regionais de Educação.','1.000 kits do Direito à Memória e à Verdade entregues para as 13 Diretorias Regionais de Educação e bibliotecas municipais com 3 livros e 4 vídeos.','','0000-00-00 00:00:00','2015-01-14 18:54:43'),(65,9,1,6,'Criar e implantar a Política Municipal para Migrantes e de Combate à Xenofobia','Regularização das feiras culturais da Rua Coimbra (Mooca) e do Rosário (Penha), reconhecidas como verdadeiro patrimônio cultural contemporâneo de São Paulo e inclusão da Feira de Alasita no Calendário festivo da Cidade, Curso permanente de português para migrantes, Mapeamento da população migrante, Cursos de qualificação de agentes públicos para atenção ao migrante, Campanha permanente de conscientização da população e prevenção à xenofobia, com foco na promoção dos direitos dos migrantes.',2474435.00,'Regularização e promoção das 3 feiras/festividades migrantes, Cursos de qualificação, 1 Campanha de conscientização Mapeamento da população migrante','Curso de português implantado, Cursos de qualificação, 2 Campanhas de conscientização','O conjunto articulado de ações ora proposto busca dar conta do problema histórico da falta de atenção aos migrantes por parte do poder público. A regularização das feiras da Rua Coimbra e do Largo do Rosário serão realizadas por meio do diálogo com todos os setores envolvidos, para que os migrantes possam legalmente desenvolver atividades econômicas e auferir renda. A regularização também vai ao encontro da política da atual gestão de apoiar e reconhecer como verdadeiro patrimônio cultural contemporâneo de São Paulo as feiras e espaços abertos de convivência que os migrantes vêm criando e fortalecendo ao longo dos anos.\nAlém das entregas acima mencionadas, outras ações em apoio à essa população serão realizadas, com destaque para a primeira Conferência Municipal de Migrantes e a construção de um Centro Cultural da Migração, que servirá como um espaço para a difusão de suas tradições, e também como local de referência tanto para estas comunidades quanto para os brasileiros natos (os custos e entregas dessas ações estão descritas em suas respectivas metas e orçamentos próprios).','Migrante: é toda a pessoa que se transfere de seu lugar habitual de residência para outro lugar, região ou país.\nXenofobia: preconceito que engendra discriminação e/ou violência contra pessoas migrantes principalmente em razão de sua origem territorial diversa.',3,'Apoio à Festa Nacional da Bolívia no Mamorial da América Latina','Formalização do convênio entre a SMDHC e o Ministério da Justiça para estruturação e manutenção do Centro de Referência e Acolhimento do Imigrante - CRAI','Parceria com o Ministério do Trabalho para emissão imediata de carteiras de trabalho para portadores de visto humanitário','Ampliação do acordo com a Caixa Econômica Federal para promoção do acesso desburocratizado a contas bancárias e crédito para os imigrantes, com atendimento bilíngue em toda a rede de agências do município. ','Apoio à realização das festas: Alasitas (24 de janeiro), Carnaval Andino Yunsa (março), Festa Nacional da Bolívia (agosto), o Dia da Juventude Paraguaia (setembro) e o Festival Soy Latino (outubro).','Oferecimento de curso de português básico para estrangeiros no abrigo emergencial da prefeitura e estruturação de 4 turmas para curso de idioma de 160 horas através do PRONATEC, com aulas oferecidas pelo Instituto Federal e SENAC.','Lançamento do Portal Cosmópolis, espaço de publicação de pesquisas e notícias sobre imigração em São Paulo, em parceria com o Instituto de Relações Internacionais da USP - IRI/USP.','0000-00-00 00:00:00','2015-01-14 18:56:36'),(66,9,1,6,'Fortalecer os Conselhos Tutelares, dotando-os de infraestrutura adequada e oferecendo política permanente de formação','Infraestrutura básica para o funcionamento do Conselho Tutelar, buscando adequá-los ao que preconiza a Resolução n. 139 do Conselho Nacional dos Direitos da Criança e do Adolescente - CONANDA, Capacitação de 440 conselheiros (atuais e os eleitos em 2014), Novo Conselho Tutelar modelo em Itaquera.',1500000.00,'Entrega de infraestrutura aos 44 Conselhos Tutelares, 220 conselheiros capacitados, Novo Conselho Tutelar modelo em Itaquera','220 novos conselheiros capacitados','O objetivo dessa meta é garantir infraestrutura mínima e padronizada aos Conselhos Tutelares e uma política permanente de formação para melhorar seu funcionamento, com vistas à garantia integral dos direitos da criança e do adolescente e suas famílias. Como \"infraestrutura mínima\" entende-se adequar os Conselhos Tutelares da cidade de São Paulo ao que preconiza a Resolução n. 139 do Conselho Nacional dos Direitos da Criança e do Adolescente - CONANDA. Parte desta será fornecida por meio de kits de equipagem doados pela Secretaria de Direitos Humanos da Presidência da República SDH/PR. A legislação municipal de garantia de direitos trabalhistas e sociais será baseada no que preconiza a lei federal n. 12.696/12. A política de formação permanente também será estruturada a partir de parceria com a SDH/PR por meio da Escola Nacional de Formação Continuada de Conselheiros/as de Direitos e Conselheiros (as) Tutelares. Por fim, o Conselho modelo de Itaquera será a 1ª iniciativa de uma série de mudanças propostas pela SDH/PR que visam consolidar o Sistema de Garantia de Direitos de Crianças e Adolescentes e constituir-se-á em um dos legados da Copa do Mundo de 2014, contribuindo para o fortalecimento da rede de conselhos tutelares na cidade. Os recursos para a construção do novo Conselho serão disponibilizados pelo governo federal mediante convênio a ser assinado junto à Prefeitura de São Paulo.','Conselho Tutelar: Conforme previsão do Estatuto da Criança e do Adolescente, é órgão permanente e autônomo, não jurisdicional, encarregado pela sociedade de zelar pelo cumprimento dos direitos da criança e do adolescente. Entre suas atribuições estão: atender as crianças e adolescentes visando a aplicação de medidas específicas de proteção, atender e aconselhar pais ou responsáveis, requisitar serviços públicos nas áreas de saúde, educação, serviço social, previdência, trabalho e segurança e encaminhar ao Ministério Público notícia de fato contra os direitos da criança ou adolescente.',3,'sp-carinhosa, sp-mais-inclusiva','Efetivada a mudança de sede dos Conselhos Tutelares de Casa Verde e Pedreira para imóveis com melhores condições de funcionamento','Entrega de Kits do Governo Federal aos 44 Conselhos Tutelares do Município (incluindo carro, geladeira, bebedouro, impressora e 5 computadores)','Realizada a contratação de operadora de telefonia móvel que garantirá disponibilidade de telefonia para fins de plantão a todos os Conselhos Tutelares','Realizadas formações de planejamento orçamentário com Conselheiros Tutelares para fins de elaboração do orçamento de 2015.','','','0000-00-00 00:00:00','2015-01-14 18:57:34'),(67,10,1,6,'Implantar 08 novas Unidades de Referência à Saúde do Idoso (URSI)','Unidade de Referência à Saúde do Idoso em funcionamento',6400000.00,'04 URSIs','04 URSIs','As Unidades de Referência à Saúde do Idoso vem de encontro à necessidade de respostas efetivas às demandas da população idosa e estão inseridas na atenção à saúde do segmento idoso, da Política Municipal e Nacional do Idoso e nas recomendações de organismos internacionais.','Unidade de Referência à Saúde do Idoso: unidade especializada para atender à pessoa idosa na sua área de abrangência. Insere-se no nível secundário da atenção à saúde, oferecendo atendimento por equipe especializada de gerontologia e geriatria e interprofissional, com visão integral em âmbito individual e coletivo; desenvolve ações preventivas e de promoção e proteção à saúde, atividades de treinamento e capacitação de profissionais da atenção básica e pesquisas específicas na área da gerontologia.',2,NULL,'Estudo e planta modelo da URSI finalizados.','As URSIs são unidades especializadas para atender à pessoa idosa.','','','','','0000-00-00 00:00:00','2015-01-13 21:30:10'),(68,10,1,6,'Implantar 15 Centros Dia destinados à população idosa','15 Centros Dia em funcionamento',4650000.00,'6 Centros Dia','9 Centros Dia','O atendimento também pode incluir a elaboração de um Plano Individual e/ou Familiar de Atendimento, orientação e apoio nos autocuidados; apoio ao desenvolvimento do convívio familiar, grupal e social; identificação e fortalecimento de redes comunitárias de apoio; ajudas técnicas de autonomia no serviço, no domicílio, e na comunidade; apoio e orientação aos cuidadores familiares com vistas a favorecer a autonomia da dupla pessoa cuidada e cuidador familiar.\nO Centro Dia é um serviço que ainda não tem as orientações técnicas elaboradas pelo MDS, que são necessárias para o seu funcionamento. Assim também não é um serviço tipificado, portanto para sua implantação será necessário a apresentação e aprovação do COMAS-Conselho Municipal de Assistência Social.','Centro Dia: equipamento social destinado à atenção diurna de pessoas idosas em situação de dependência, em que uma equipe multidisciplinar presta serviço de proteção social especial e de cuidados pessoais, fortalecimento de vínculos, autonomia e inclusão social, por meio de ações de acolhida, escuta, informação e orientação.',2,NULL,'2 Centros Dia com a licitação em andamento, sendo um na subprefeitura do Butantã e outro na subprefeitura da Mooca.','2 Centros Dia em projeto de readequação em andamento, sendo um na subprefeitura de Ipiranga e outro na de Jaçanã/Tremembé.','','','','','0000-00-00 00:00:00','2015-01-13 19:19:12'),(69,10,1,6,'Desenvolver campanha de conscientização sobre a violência contra a pessoa idosa','4 campanhas de conscientização da violência contra a pessoa idosa, Seminários anuais de conscientização da violência contra a pessoa idosa.',480000.00,'2 Campanhas de conscientização, 2 Seminários','2 Campanhas de conscientização, 2 Seminários','A violência contra a pessoa idosa é crime. Diariamente esta população se depara com a violência em todas as instâncias e espaços de convivência da cidade - na família, nas ruas, nos serviços públicos e privados. Ela tem dificuldade de encontrar suporte para dar uma resposta a esta situação e, com frequência, se cala. Diversos são os tipos de violência contra a pessoa idosa: física, psicológica, sexual, emocional e social, abandono, negligência, financeira ou econômica e auto-negligência.\nEsta meta tem como objetivo fortalecer a luta pelos direitos da pessoa idosa, evidenciar os principais aspectos da violência no município e divulgar os meios de denúncia disponíveis. As campanhas de mídia convidam ao diálogo, à reflexão e ao debate, incentivando a participação intergeracional da sociedade, além de integrar e fortalecer as ações de enfrentamento a todo tipo de agressão. A conscientização sobre a violência contra a pessoa idosa deverá contribuir sensivelmente para a construção de uma cidade do futuro, uma cidade melhor e mais acolhedora para a pessoa que envelhece.','Campanha de conscientização da violência contra a pessoa idosa: conjunto de ações que compreende a produção e distribuição periódica de diversos materiais como panfletos, cartazes, spots de radio e peças de audiovisual.',3,NULL,'Campanha de Enfrentamento à Violência contra a Pessoa Idosa realizada em 2013 e 2014','2 Seminários de Conscientização sobre a violência contra a pessoa idosa realizados (jun e set/2013).','Estabelecida parceria com o Disque 100 do Governo Federal para obtenção de dados sobre registros de casos de violência contra a pessoa idosa.','Campanha de Enfrentamento à Violência contra a Pessoa Idosa realizada em 2013 e 2014.','Realização de 2 Diálogos (Subprefeituras de Perus e Itaquera) em parceria com SMPM, SMPED e SMPIR  sobre violência de gênero, étnica e contra a pessoa idosa e com deficiência.','','0000-00-00 00:00:00','2015-01-14 18:59:09'),(70,10,1,6,'Implantar 5 unidades de Instituições de Longa Permanência do Idoso - ILPI','5 ILPIs em funcionamento',1550000.00,'5 ILPIs','','Deve funcionar em unidade inserida na comunidade, com características residenciais e estrutura física adequada, visando o desenvolvimento de relações mais próximas do ambiente familiar e a interação social com pessoas da comunidade. As edificações devem ser organizadas de forma a atender aos requisitos previstos na regulamentação pertinente.','Instituição de Longa Permanência do Idoso - ILPI: Acolhimento para pessoas idosas com 60 anos ou mais, de ambos os sexos, com diferentes necessidades e graus de dependência, que não dispõem de condições para permanecer na família, ou para aqueles que se encontram com vínculos familiares fragilizados ou rompidos, em situações de negligência familiar ou institucional, sofrendo abusos, maus tratos e outras formas de violência, ou com a perda da capacidade de auto cuidado.',2,NULL,'Unidade Parelheiros com terreno definido e projeto básico em andamento  em área do programa habitacional \"Minha Casa, Minha Vida\"',NULL,NULL,NULL,NULL,NULL,'0000-00-00 00:00:00','2014-10-31 03:28:06'),(71,10,1,6,'Criar a Universidade Aberta da Pessoa Idosa do Município','Cursos gratuitos com grade curricular diversificada destinados à população idosa e servidores públicos que trabalham com esta população.',3107525.00,'560 alunos atendidos','1.120 alunos atendidos','Os cursos visam à promoção da saúde da pessoa idosa, oferecendo subsídios teóricos para a análise das bases conceituais que fundamentam o processo de envelhecimento humano individual e populacional e a sua inter-relação com as áreas da saúde, sociologia, artes, educação física e assistência social. Os primeiros cursos terão a duração de um ano e serão compostos por 19 professores especialistas convidados que ministrarão aulas teóricas e práticas em áreas do conhecimento como: gerontologia, biologia do envelhecimento, enfermagem, segurança alimentar, fisioterapia, educação física, história, artes (história da arte e artes plásticas), teatro e fotografia. A UAPI estará sediada no Pólo do Idoso, localizado no bairro do Cambuci e terá cursos ministrados em outros equipamentos públicos do município nos bairros do Cambuci, Brasilândia, Raposo Tavares e Sapopemba.','Universidade Aberta da Pessoa Idosa - UAPI: conjunto de cursos que visam à promoção da saúde e conscientização do processo do envelhecimento entre a população idosa e servidores públicos que trabalham com esta temática',4,NULL,'Universidade Aberta da Pessoa Idosa criada e implantados polos em 32 CEUs','Polo Cambuci com 140 alunos matriculados e 80 concluintes em 2013.','','','','','0000-00-00 00:00:00','2015-01-14 20:34:38'),(72,11,1,5,'Requalificar a infraestrutura e os espaços públicos do Centro','Espaços de convivência, de caráter multiuso',130829488.00,'','Requalificação do Vale do Anhangabaú, Requalificação do Pq. D. Pedro II,  Requalificação do Pátio do Pari, Requalificação do Mercado Municipal','Requalificar espaço público de uma centralidade urbana. A secretaria Municipal de Direitos Humanos e Cidadania, por meio de suas coordenadorias, será articuladora do público-alvo para execução da meta, devendo considerar a necessidade da presença humana permanente nesses espaços, a fim de promover uma cultura de cidadania baseada na convivência, na tolerância e na ocupação contínua dos espaços públicos.','Programa de Requalificação do Espaço Público: urbanização e qualificação de espaços públicos que configuram uma centralidade urbana apropriada pelos cidadãos.',3,'sp-carinhosa, juventude-viva','Implantação dos projetos-piloto de requalificação de usos no Largo São Francisco/Ouvidor e Largo Paissandu/São João concluída e pesquisa qualitativa realizada. Os projetos-piloto inserem-se no programa Centro Aberto.','Projeto executivo do Anhangabaú em desenvolvimento com licenças aprovadas.','','','','','0000-00-00 00:00:00','2015-01-13 18:57:35'),(73,11,1,3,'Implantar 42 áreas de conexão wi-fi aberta, com qualidade e estabilidade de sinal','42 áreas de conexão wi-fi em operação',30000000.00,'42 áreas de conexão wi-fi','','Serão instalados roteadores, antenas e concentradores capazes de fornecer acesso de qualidade à internet, com velocidade mínima de 512 kbps, podendo chegar a 2 Mbps, em praças ou outros equipamentos públicos, onde munícipes e visitantes poderão acessar livremente a internet a partir de diversos dispositivos. O número máximo de usuários simultâneos será calculado com base no fluxo de pessoas que transitam e na média de uso, garantindo qualidade e estabilidade de sinal.\n* O custo total da meta reflete os recursos necessários para manutenção de 42 áreas de wi-fi durante um ano','Área de conexão wi-fi aberta: área de acesso livre e gratuito à internet por tecnologia wi-fi, principalmente a partir de PCs, Laptops, celulares.',5,'juventude-viva, sp-aberta','105 pontos de wi-fi implantados até dezembro/14, superando a meta.','A Prefeitura seguirá ampliando a oferta de pontos de internet livre, gratuita e de qualidade. Saiba mais: acesse http://wifilivre.sp.gov.br/','Internautas navegam a 512 kbps efetivos por usuário, para download e upload. É livre mesmo: não há necessidade de cadastro ou autenticação.','','','','0000-00-00 00:00:00','2015-01-14 21:31:43'),(74,11,1,4,'Implantar 18.000 novos pontos de iluminação pública eficiente','18 mil novos pontos de Iluminação Pública instalados',40670189.00,'12.780 pontos de iluminação','5.304 pontos de iluminação','Instalação de novos postes com fiações sendo alguns subterrâneos e outros aéreos, e com lâmpadas de vapor de sódio de 70 a 250W. Inicialmente priorizar locais com altos índices de criminalidade tomando como referencia o INFOCRIM (mapeamento dos pontos de criminalidade na cidade ), o Sistema Intraurbano de Monitoramento dos Direitos Humanos, os territórios prioritários definidos no Juventude Viva e também locais de grande concentração de pessoas (equipamentos de educação e saúde, saídas e entrada das estações do metrô e trem, pontos de ônibus etc.).','Novo Ponto de Iluminação Pública Eficiente: Criação de ponto de iluminação em ruas, vielas ou praças com lâmpadas de vapor de sódio, com baixo consumo de energia elétrica.',5,'juventude-viva','Mais de 21 mil novos pontos de iluminação implantado, além dos 18.000 previstos inicialmente na meta, até setembro de 2014.','A Prefeitura está preparando uma PPP da iluminação pública para renovar todo o parque de iluminação com a reconstrução da estrutura da rede, manutenção, operação e ampliação dos pontos de iluminação e criação de um Centro de Controle Operacional.','','','','','0000-00-00 00:00:00','2015-01-14 21:32:21'),(75,11,1,2,'Realizar as obras previstas no âmbito da Operação Urbana Consorciada Água Espraiada (OUCAE)','Prolongamento da Av. Jornalista Roberto Marinho, Parque Linear,  Parque do Chuvisco,  Canalização do Córrego Água Espraiada e Córrego Pinheirinho,  Viadutos Dr. Lino de Moraes Leme e George Corbisier, Prolongamento da Av. Chucri Zaidan até a Av. João Dias,  Pontes sobre o Rio Pinheiros (Itapaiúna e Laguna).',1560000000.00,'','Obras entregues','O prolongamento da Av. Jornalista Roberto Marinho entre a Av. Dr. Lino de Moraes Leme e a Rodovia dos Imigrantes abrange um Parque de Linear de aproximadamente 271.600m2 de área e circundado por vias de trânsito local, canalização dos Córregos Água Espraiada e do Pinheirinho, construção de Habitações de Interesse Social, e a construção de 2 viadutos sobre a Av. Jornalista Roberto Marinho e/ou Parque Linear. Implantação do Parque do Chuvisco com área de aproximadamente 35.450m2, contendo quadras poliesportivas, equipamentos para a melhor idade, quadra de bocha, ciclovia, área para compostagem / hortas / pomar, quiosques, playground aquático, playground seco, arvorismo, pista de patinação, escalada, núcleo para vivência, galpão multiuso, núcleo de educação ambiental, e playground / área de apoio à Creche Municipal existente (CEI Vila Ernestina / Creche Jardim Aeroporto).\nO prolongamento da Av. Chucri Zaidan até a Av. João Dias terá inicio a cerca de 200 metros do Largo Los Andes e terminará no entroncamento da Av. João Dias, com extensão aproximada de 3.400m e que servirá de suporte a um sistema de transporte coletivo dando continuidade ao eixo formado pela Av. Luis Carlos Berrini e Av. Faria Lima, e suporte a construção de transposição sobre o rio Pinheiros entre as pontes do Morumbi e João Dias (Pontes Itapaiúna e Laguna).\n*Além das obras, a Operação Urbana Água Espraiada prevê a construção de Unidades Habitacionais de Interesse Social que estão consideradas na Meta 35','Operação Urbana Consorciada: é um instrumento de política urbana previsto na Lei nº 10.257/2001, conhecida como Estatuto da Cidade (art. 4º, inc. V, \"p\", e art. 32 e ss). O art. 32, parágrafo único, da Lei define a operação urbana consorciada como \"o conjunto de intervenções e medidas coordenadas pelo Poder Público municipal, com a participação dos proprietários, moradores, usuários permanentes e investidores provados, com o objetivo de alcançar em uma área transformações urbanísticas estruturais, melhorias sociais e a valorização ambiental\".',2,NULL,'Iniciadas as obras da Ponte Laguna e Itapaiúna','438 unidades habitacionais em construção','428 lotes em desapropriação para obras do parque linear','Ajuizadas todas as ações expropriatórias para obras da Chucri Zaidan','','','0000-00-00 00:00:00','2015-01-13 22:03:38'),(76,11,1,3,'Criar 32 programas de requalificação do espaço público e melhoria de bairro','1 Programa de requalificação criado em cada subprefeitura.',118000000.00,'','32 programas de requalificação do espaço público','A Secretaria Municipal de Coordenação de Subprefeituras contará com o apoio da Secretaria Municipal de Direitos Humanos e Cidadania, por meio de suas coordenadorias, para a articulação do público-alvo para execução da meta. Há necessidade da presença humana permanente desses espaços, a fim de promover uma cultura de cidadania baseada na convivência, na tolerância e na ocupação contínua dos espaços públicos.','Programa de Requalificação do Espaço Público: urbanização e qualificação de espaços públicos que configuram uma centralidade urbana apropriada pelos cidadãos.',3,'sp-carinhosa, juventude-viva','Cada subprefeitura será beneficiada com um programa de requalificação do espaço público e melhoria de bairro.','282 obras de requalificação do espaço público em andamento nas 32 subprefeituras.','O Programa é composto de urbanização e qualificação de espaços públicos urbanos apropriada pelos cidadãos.','O programa envolve ações de obras e outras intervenções, como zeladoria por exemplo.','','','0000-00-00 00:00:00','2015-01-13 22:25:01'),(77,12,2,2,'Criar e efetivar a Agência São Paulo de Desenvolvimento','Agência São Paulo de Desenvolvimento criada, 32 Representações da Agência São Paulo de Desenvolvimento instaladas',3932099.00,'31 Representações da Agência São Paulo de Desenvolvimento - ADESAMPA','1 Representação da Agência São Paulo de Desenvolvimento - ADESAMPA','A Agência São Paulo de Desenvolvimento será constituída por quadro técnico qualificado que irá identificar as possibilidades de projetos, emitir relatórios técnicos e orientar ações para promoção e potencialização de vocações regionais. As representações nas subprefeituras atuarão localmente, interagindo com os Núcleos de Desenvolvimento Local (representações da sociedade civil), as Casas do Empreendedor (apoio local aos empreendedores), os Centros de Tecnologia e demais projetos de desenvolvimento. Atendimento ao público com utilização da estrutura da subprefeitura. Recorte de gênero e juventude para definição de público-alvo nas ações da Agência.','Agência SP: dará apoio ao desenvolvimento de projetos e incentivos aos micro e pequenos empreendedores.\nRepresentações da Agência SP: estruturas descentralizadas de apoio aos empreendedores locais com assessoria jurídica, técnica e financeira (agentes de microcrédito), para dar celeridade ao processo de formalização, regularização, abertura de empresas e concessão de crédito.',4,NULL,'ADESampa - Agência de Desenvolvimento de São Paulo criada pela Lei 15.838/13.','30 das 32 subprefeituras com polos ADE Sampa implantados e em funcionamento. Guaianases e Sapopemba em adequação do espaço físico.','Articulação com órgãos públicos e privados das esferas federal, estadual e municipal para mapear possibilidades para consolidação de um modelo de empreendedorismo inclusivo e sustentável nos distritos.','           ','','','0000-00-00 00:00:00','2015-01-13 20:36:29'),(78,12,2,2,'Criar uma agência de promoção de investimentos para a cidade de São Paulo a partir da expansão da atuação da Companhia São Paulo de Parcerias - SPP','Escopo de atuação da Companhia São Paulo de Parcerias %u2013 SPP alterado',0.00,'Agência criada','','Projeto de Lei Municipal para alterar o escopo de atuação da Companhia São Paulo de Parcerias %u2013 SPP, adicionando a função de agência de promoção do investimento na cidade de São Paulo, com capacidade de auxiliar a administração pública na identificação de processos ineficazes, propor a adoção de medidas necessárias para a desburocratização e melhoria do ambiente de negócios no Município, a promover e buscar oportunidades de negócios, atrair novos investimentos para o Município de São Paulo. Esta meta não apresenta custo de implantação uma vez que a empresa já dispõe de estrutura da antiga SPP.','Companhia São Paulo de Parcerias - SPP: Sociedade de Economia Mista, autorizada pela Lei nº 14.517, de 16 de outubro de 2010, que tem por objeto viabilizar, garantir a implementação e atuar em outras atividades relacionadas ao Programa Municipal de Parcerias Público-Privadas.',4,NULL,'Criada a SP Negócios, como agência de fomento e promoção de negócios para a cidade.','Atuação nas áreas de Suporte ao Investidor, Estruturação de Projetos de Parceria Público-Privadas e Concessões e Melhoria do Ambiente de Negócios.','','','','','0000-00-00 00:00:00','2015-01-14 20:37:09'),(79,12,2,2,'Criar e efetivar o Programa de Incentivos Fiscais nas Regiões Leste e extremo Sul','Empresas participando do Programa de incetivos fiscais na Zona Leste e extremo sul do Município.',3000.00,'Programa de Incentivos Fiscais criado','','Os incentivos serão concedidos às empresas que se instalarem na área delimitada em lei a ser aprovada. O perímetro exato desta área depende de deliberação da Câmara Municipal. Na região do extremo Sul, os incentivos serão concedidos levando em conta as potencialidades e vocações econômicas específicas dessa\nregião, privilegiando empreendimento e serviços ligado à concepção de economia sustentável, como o ecoturismo.','Incentivos Fiscais: Redução da carga tributária concedida a certas empresas que atendem a critérios previstos em lei, com o objetivo de incentivar sua instalação em determinado local ou região.',3,NULL,'Criado o Programa de Incentivos Fiscais na Zona Leste','Empresas de tecnologia, educação, saúde, hotelaria, entre outros, que se instalarem na ZL poderão ter isenção no  IPTU,  ITBI,  ISS da construção civil e redução do ISS ao mínimo legal (2%)','Sistema on line em funcionamento desde fevereiro de 2014.','PL convertido na Lei 15.931/13, regulamentada pelo Decreto n° 57.760/14.','Incentivos fiscais à Zona Sul em estudo.','','0000-00-00 00:00:00','2015-01-14 20:38:20'),(80,13,2,2,'Criar 1 Parque Tecnológico Municipal na Zona Leste e apoiar e criação do Parque Tecnológico Estadual do Jaguaré','1 Parque Tecnológico na Zona Leste,  Apoio ao Governo do Estado de SP para a criação do Parque Tecnológico Estadual do Jaguaré',24500000.00,'Parque Tecnológico Municipal na Zona Leste','','','',2,NULL,'Concluídos o estudo de viabilidade econômica e o projeto arquitetônico para a criação do Parque Tecnológico Municipal na Zona Leste.','Em elaboração o  Decreto da Entidade Gestora e o Projeto de Lei para alteração das leis propiciando que OSPSFL tenha suas atividades também dirigidas à área de ciência, tecnologia e Inovação. ','Definição da figura jurídica de Organização Social Privada Sem Fins Lucrativos.','','','','0000-00-00 00:00:00','2015-01-13 20:59:38'),(81,13,2,2,'Implantar o Programa VAI TEC para o incentivo de desenvolvedores de tecnologias inovadoras, abertas e colaborativas ','Apoio a projetos de tecnologia inovadora e cultura digital implementados por meio de bolsas e/ou prêmios',9000000.00,'Programa VAI TEC','Programa VAI TEC','O Programa VAI TEC tem por objetivos: estimular a criação, o acesso, a formação e a participação do pequeno empreendedor e criador no desenvolvimento tecnológico da Cidade; promover a pesquisa, a difusão de tecnologias e a inovação; promover a estruturação e desenvolvimento de cadeiras produtivas formadas por micro, pequenas e médias empresas. A implementação do projeto se dará através do chamamento de edital, pelo menos uma vez por ano. O valor destinado a cada proposta será de até R$ 25.000,00.','VAI TEC: Programa de bolsas e premiação de projetos com foco na apropriação crítica de tecnologias de informação e cultura digital.',2,'sp-mais-inclusiva','VAI TEC criado pela Lei 15.838/13.','Edital Publicado em dezembro de 2014','Decreto nº 55.462/2014 de Regulamentação do VAI TEC instituído no âmbito da Agência São Paulo de Desenvolvimento - ADE SAMPA, nos termos da Lei 15.838 de 4/7/13.','           ','','','0000-00-00 00:00:00','2015-01-13 21:24:21'),(82,13,2,2,'Apoiar a implantação da UNIFESP e do IFSP nas Zonas Leste e Norte, respectivamente','Apoio à implantação da UNIFESP e do IFSP',0.00,'','','Meta abrange a doação de terrenos para a instalação das referidas instituições.','',4,NULL,'Garantida a concessão de uso de área municipal para implantação da UNIFESP Zona Leste em Itaquera.','Concessão de uso garantida também para a implantação do Instituto Federal em Pirituba.','UNIFESP Zona Leste: garantida a concessão administrativa de área municipal em Itaquera (publicação da Lei nº 15.736/2013). Instituto Federal de Pirituba: garantida a concessão administrativa de área municipal (Lei nº 15.686/2013).','Prazo de 3 anos para conclusão das obras pelo Governo Federal, a partir da aprovação dos projetos de edificação (elaboração dos projetos em andamento).',NULL,NULL,'0000-00-00 00:00:00','2014-10-31 03:28:06'),(83,14,2,2,'Criar um sistema de contrapartida para fins de implantação de áreas verdes e financiamento de terrenos para parques','Elaboração de Estudos e diagnósticos,  Discussão dos modelos propostos com a sociedade, por meio de um seminário, Criação de novos marcos legais (portarias, decretos, projetos de lei)',0.00,'','Conclusão da etapa de estudos e diagnósticos, Realização de um seminário, Criação de novos marcos legais','O Sistema de Áreas Verdes do Município (SISMAVE) é constituído pelo conjunto de espaços significativos ajardinados e arborizados, de propriedade pública ou privada, necessários à manutenção da qualidade ambiental urbana tendo por objetivo a preservação, proteção, recuperação e ampliação desses espaços. Nesse sentido, o desenvolvimento de um sistema de contrapartidas que apoie a consolidação deste sistema, com a ampliação da oferta de áreas verdes públicas à população, proporcionará a melhoria do bem estar social e ambiental na cidade.','Sistema de contrapartida: Marco legal que estabelece critérios para que grandes empreendedores privados contribuam para a ampliação de áreas verdes no município de São Paulo.',2,NULL,'Grupo de Técnico de Trabalho criado através da Portaria nº 075/SVMA/2014  com a finalidade de desenvolver os estudos e diagnósticos necessários à sua execução da meta.','Levantamento dos instrumentos urbanísticos e dos instrumentos de gestão ambiental que estabeleçam contrapartidas, previstos no Novo Plano Diretor Estratégico.','Levantamento dos incentivos fiscais previstos na legislação municipal e no Novo PDE que permitam vislumbrar o atendimento da meta.','','','','0000-00-00 00:00:00','2015-01-13 22:02:05'),(84,14,2,4,'Concluir as fases II e III do Programa de Mananciais beneficiando 70 mil famílias','Assentamentos saneados dotados de infraestrutura, tendo sido eliminadas todas as áreas de risco.',3533268058.00,'22.000 famílias beneficiadas','48.000 famílias beneficiadas','Engloba a implantação de infraestrutura urbana nos assentamentos precários, possibilitando o acesso dos moradores aos serviços urbanos, a consolidação geotécnica e/ ou remoções em áreas de risco. A regionalização aqui descrita é parcial. Outras 20.000 famílias serão beneficiadas em locais ainda a definir.','Programa de Mananciais: Qualificação urbanística e o reconhecimento formal dos assentamentos precários e/ou informais, garantindo a melhoria da qualidade de vida da população moradora em áreas de mananciais.',3,NULL,'Execução de Redes de infraestrutura concluídas para as Ruas Beira Rio, Boaventura, Boa Vista, Boa Esperança, da Paz, Marfrendes, das Palmeiras, Pernambuco, Rio Branco, Rio Doce, Rio Sul, Sta. Rosa, São João, Tupy, Vitória e Verde.','Pavimentação para a Rua Cônego José Pascoal Cristófaro concluída. Execução das Redes de água, drenagem e esgoto para as Ruas João Paulo, Carvoeiro, Berlim e São Jorge concluídas.','','','','','0000-00-00 00:00:00','2015-01-13 22:13:01'),(85,14,2,7,'Criar e efetivar um programa de incentivos fiscais para prédios verdes','Um Projeto de Lei que permita o uso dos mecanismos de isenção fiscal para o fortalecimento do uso de tecnologias verdes em edifícios.',0.00,'Programa de incentivos fiscais criado','','Esta meta não possui custo de implantação.','Incentivos Fiscais: Redução da carga tributária concedida a certas empresas e munícipes que atendem a critérios previstos em lei, com o objetivo de incentivar o uso de tecnologias verdes.',2,NULL,'O Banco Mundial atua como parceiro Assistência técnica e financeira para desenvolvimento do projeto.','GT Intersecretarial será criado para coordenar o trabalho.','','','','','0000-00-00 00:00:00','2015-01-14 20:45:26'),(86,14,2,4,'Readequar e requalificar com ações prioritárias 34 Parques e Unidades de Conservação Municipais','Obras de readequação e requalificação em 34 Parques Municipais',177262000.00,'11 parques readequados','23 parques readequados','Adequar e requalificar parques e unidade de conservação nos aspectos de acessibilidade, bebedouros, equipamentos, edificações e obras. Muitos parques se encontram depredados, sem equipamentos adequados para a população e sem acessibilidade, conforme exigências do Ministério Público. Há necessidade de contenção de margens de córregos e de encostas que estão pondo em risco edificações e usuários.\n\nParques a serem readequados:\nPq. Rodrigo de Gásperi\nPq. São Domungos\nPq. Guarapiranga\nPq. Anhanguera\nPq. Natural Varginha\nPq. Natural Itaim\nPq. Linear Rio Verde\nPq. Aterro Sapopemba\nPq. Linear Itaim\nPq. Piqueri\nPq. Pinheirinho D\'Água\nPq. Linear Córrego do Fogo\nPq. Jardim Felicidade\nPq. Cidade de Toronto\nPq. do Trote\nPq. Independência\nPq. Ibirapuera\nPq. do Bispo - Borda da Cantareira\nPq. Paraisópolis\nPq. Horto do Ipê\nPq. Morumbi Sul\nPq. CEU 3 Lagos\nPq. do Carmo - Olavo Egydio Setúbal\nPq. Raul Seixas\nPq. Chácaras das Flores\nPq. da Luz\nPq. COHAB Raposo Tavares I - Juliana de C. Torres\nPq. Linear Água Vermelha\nPq. Leopoldina - Orlando Villas-Boas\nPq. Jacques Cousteau\nPq. Linear Itararé - Sérgio Vieira de Mello\nPq. Tenente Siqueira Campos - Trianon\nPq. Chico Mendes\nPq. Linear Sapé','Readequar e requalificar: Adequar e requalificar parques implantados em aspectos prioritários, como obras de drenagem, contenção de\ncórrego, encostas e taludes em erosão, acessibilidade e edificações de apoio (sanitários e guaritas). Instalação de bebedouros em parques já\nimplantados para atendimento da solicitação do Ministério Público. Instalação e readequação de playgrounds e equipamentos de idosos para o uso da população.',3,'sp-carinhosa, sp-mais-inclusiva','7 parques com recursos para ações de readequação aprovados do Fundo Especial do Meio Ambiente e Desenvolvimento Sustentável.','Parque do Piqueri readequado;\nParques do Carmo, do Tietê, do Ceret e Dom Paulo Evaristo Arns com nova iluminação instalada pela ILUME.','Tratativas para viabilizar as ações de readequação em andamento para os 32 parques da meta.','','','','0000-00-00 00:00:00','2015-01-13 22:04:34'),(87,14,2,4,'Implantar 32 polos de Educação ambiental, capacitando e sensibilizando 120.000 cidadãos','Infraestrutura básica (projetor, cadeiras, mesas, material didático) para a implantação em 32 polos de difusão da educação ambiental em cada subprefeitura, aproveitando a potencialidade de parques e outros equipamentos, dando novos usos a espaços públicos existentes, Cursos, oficinas e atividades de sensibilização e educação ambiental e de cultura de paz',5800651.00,'32 polos, 60 mil munícipes atendidos','60 mil munícipes atendidos','O fomento e a difusão das práticas de educação ambiental visa contribuir, para que integrantes de diferentes segmentos da população, de forma criativa, critica e autônoma, construam conhecimentos sobre a situação e perspectivas socioambientais e para que se capacitem a incorporar hábitos e estilos de vida amigáveis por meio da convivência pacífica e compatíveis com a sustentabilidade da vida na cidade de São Paulo e no planeta. Para dar andamento a essas práticas, criam-se os pólos de difusão em educação ambiental e cultura de paz nos territórios de cada Subprefeitura, para descentralizar as ações de capacitação (cursos e outras atividades de longa duração) e sensibilização (atividades diversas de curta duração) na educação ambiental não formal.','Pólos de difusão de educação ambiental e cultura de paz: espaços abertos localizados em equipamentos públicos como parques e CEUs que receberão atividades promovidas pela SVMA e outros órgãos interessados, além de servir como espaço de articulação para o desenvolvimento local.',3,'sp-carinhosa, sp-mais-inclusiva, juventude-viva','9 novos polos de educação ambiental  em 2014, com 47.268 cidadãos capacitados e sensibilizados.','As subprefeituras beneficiadas foram:  Aricanduva, Mooca, Pirituba/Jaraguá, Vila Maria/Vila Guilherme, Butantã, Itaquera, M\'Boi Mirim, Santana e Sé.','Edital para contratação de serviços de OSCIPS ou ONGS, compra de materiais permanentes e de consumo para as atividades a serem desenvolvidas nos polos.','','','','0000-00-00 00:00:00','2015-01-13 22:05:45'),(88,14,2,3,'Plantar 900 mil mudas de árvores em passeios públicos, canteiros centrais e no Sistema de Áreas Verdes','900 mil mudas de árvores plantadas com recursos dos Termos de Compensação Ambiental.',20549400.00,'328.553 árvores plantadas','571.467 árvores plantadas','O plantio de mudas será realizado prioritariamente com recursos dos Termos de Compensação Ambiental. O plantio de mudas de árvores deverá alcançar todo o território de São Paulo, partindo das demandas da população local e do diagnóstico técnico de áreas que precisam mais de intervenções urbanísticas e revitalização ambiental. As ações de plantio buscarão melhorar a qualidade ambiental do local com escolha de espécies adequadas para as calçadas e que tragam uma paisagem mais confortável para os moradores. A articulação local com as Subprefeituras se dará para a implantação de calçadas acessíveis e para o planejamento das intervenções. A meta será cumprida com o atendimento das solicitações de manutenção e plantio recebidas por SACs, demandas da sociedade civil organizada, instituições públicas municipais e demais atores sociais. Para a realização também deverá ser atendida à legislação vigente, em especial quanto à acessibilidade, uso do solo e arborização, como o Manual de Arborização Urbana do Município de São Paulo.\n* - Os custos ora estimados refletem o valor estimado para o plantio de 50.112 árvores. As árvores restantes para atingir a meta serão plantadas por\nmeio de Termos de Ajustamento de Conduta.','',3,NULL,'211.650 mudas plantadas desde 2013.','As mudas já plantadas correspondem a cerca de dois terços do total de árvores de Belo Horizonte.','A SVMA realizará nova contratação de equipes exclusivas de plantio e o novo edital está em fase de elaboração pela equipe técnica responsável.','','','','0000-00-00 00:00:00','2015-01-13 22:09:49'),(89,15,2,4,'Ampliar a coleta seletiva municipal para os 21 distritos que ainda não são atendidos','21 distritos atendidos por alguma modalidade do serviço de coleta seletiva',0.00,'8 distritos atendidos','13 distritos atendidos','Complementar a abrangência da coleta seletiva nos distritos que já contam com circuitos e efetivar a coleta seletiva para os que ainda não são atendidos por nenhuma modalidade com implantação de pontos de entrega voluntária. A ampliação da coleta seletiva não possui custo de implantação e manutenção.\n* Meta viabilizada por meio do contrato de concessão dos serviços de coleta de resíduos sólidos.','Modalidades de coleta seletiva: coleta pode ser feita pelos caminhões disponibilizados pelas concessionárias, pelos caminhões alugados pela Prefeitura e cedido às cooperativas ou misto (distrito atendido por 2 modalidades).\nCircuito: trajeto pelo qual é feita a coleta seletiva.\nPonto de Entrega Voluntária: local onde o munícipe pode fazer o descarte dos resíduos recicláveis.',3,'agenda-pop-rua','11 distritos atendidos, totalizando 86 distritos.','Planos Municipais de Gestão Integrada de Resíduos Sólidos e Coleta Seletiva prontos e revisados durante a Conferência do Meio Ambiente.','Identificação e definição dos distritos com maiores demandas de resíduos recicláveis.','Universalização do atendimento nos distritos atendidios','','','0000-00-00 00:00:00','2015-01-13 21:42:04'),(90,15,2,1,'Obter terrenos, projetar, licitar, licenciar, garantir a fonte de financiamento e construir 4 novas centrais de triagem automatizadas ','4 Centrais de Triagem Automatizadas',123300000.00,'','04 centrais de triagem','As centrais de triagem automatizadas contam com dispositivos para triagem automatizada, com maior capacidade de processamento de material. Trata-se de conjunto de processos de separação automática por meio de equipamentos providos de sensores ópticos, separador magnético, separador balístico e sistemas de aspiração, entre outros, que promovem a classificação e seleção automática dos materiais, de acordo com suas características físicas. A triagem automática permite separar as frações de Politereftalato de Etileno (PET); Plástico filme; Polietileno de Alta Densidade (PEAD); Plásticos mistos; Metais ferrosos e não-ferrosos; Embalagens acartonadas para produtos líquidos e semilíquidos (tetrapak).','Central de Triagem: é o equipamento que promove a triagem do material coletado pelos caminhões a serviço da PMSP, no âmbito do Programa de Coleta Seletiva.',3,NULL,'2 centrais de triagem automatizadas inauguradas em Bom Retiro e Santo Amaro.','Capacidade de reciclagem de lixo da cidade com previsão de aumento de 1,7% para 6% com as 2 novas centrais.','2 centrais entrarão em fase de desapropriação de terreno em 2015.','','','','0000-00-00 00:00:00','2015-01-13 21:44:38'),(91,15,2,1,'Implantar 84 novos Ecopontos','84 Ecopontos implantados',57443426.00,'39 ecopontos','45 ecopontos','A concepção do ecoponto é oferecer ao munícipe uma opção para a entrega voluntária de resíduos, sobretudo os provenientes de pequenas reformas e materiais inservíveis, como sofás, colchões, eletrodomésticos. O equipamento é entregue devidamente cercado e com portão de acesso e totem de identificação, equipado com baias para o recebimento de resíduos volumosos, caçambas para resíduos da construção civil e containers para o acondicionamento de material reciclável, em uma área impermeabilizada, com iluminação e vigilância (horário de operação: 2a.feira a sábado das 6h às 22h e aos domingos e feriados das 6h às 18h). As áreas onde serão implantadas os novos ecopontos priorizam os distritos que ainda não dispõem desse equipamento.','Ecoponto: Equipamento com aproximadamente 800 m², com acesso para veículos e caminhões, localizado próximo a áreas com histórico de descarte irregular de resíduos para a recepção voluntária de pequenos volumes de resíduos da construção civil e demolição (até 1m³), resíduos volumosos (móveis inservíveis, colchões, restos de poda) e materiais recicláveis, cuja operação é realizada pelas empresas contratadas para a realização dos serviços de limpeza indivisíveis (varrição, lavagem de vias, remoção de objetos volumosos e outros).',3,'agenda-pop-rua','20 ecopontos implantados, totalizando 77 unidades em operação no município.','Ecopontos são locais de entrega voluntária de pequenos volumes de entulho (até 1m³), grandes objetos (móveis, poda de árvores, etc) e resíduos recicláveis.','','','','','0000-00-00 00:00:00','2015-01-14 22:42:26'),(92,15,2,4,'Promover a compostagem dos resíduos sólidos orgânicos provenientes das 900 Feiras Livres Municipais e dos serviços de poda da cidade','04 Centros de Compostagem modulares, 900 Feiras convertidas em feiras sustentáveis (com resíduos destinados à compostagem)',0.00,'01 Centro de compostagem modular implantado, 300 feiras convertidas em feiras sustentáveis','03 Centros de compostagem modulares implantados, 600 feiras convertidas em feiras sustentáveis','O volume de resíduos sólidos orgânicos gerados pelas feiras livres da cidade atinge cerca de 62 mil toneladas/ano (Fonte: Sistema de Controle de Resíduos Sólidos Urbanos - SISCOR, 2012). A coleta seletiva dos resíduos orgânicos das feiras livres em junção com os resíduos de poda permitem a promoção de um composto de alta qualidade para uso na agricultura urbana e periurbana de São Paulo, em perfeito atendimento ao Art.º 36, V, da Lei 12.305/10.\n* Meta viabilizada por meio de mudanças nas diretrizes de execução do contrato de concessão dos serviços de varrição e coleta de resíduos sólidos.','Resíduos sólidos orgânicos: compondo mais de 50% do lixo produzido no município, estão nessa categoria restos de frutas, verduras e legumes, folhas, sementes etc., os quais se tornam grande problema quando depositados nos aterros sanitários (gases de efeito estufa, vetores, mau cheiro e chorume tóxico). Compostagem: processo de biodecomposição controlada de resíduos orgânicos, com o objetivo de obter um composto (húmus) rico em nutrientes para uso agrícola.',3,NULL,'4 locais definidos para implantação de Centrais de Compostagem.','Projeto piloto de compostagem de restos de frutas e verduras implementado na Feira São Mateus.','Finalizados os projetos Executivos de 2 Centrais com 50 t/dia de capacidade cada e Projetos Básicos de mais 11 Centrais e Pátios (total de 288 t/d).','','','','0000-00-00 00:00:00','2015-01-13 21:58:07'),(93,16,2,2,'Projetar, licitar, licenciar, garantir a fonte de financiamento e construir 150 km de novos corredores de ônibus','Corredores de ônibus implantados com pavimento rígido, ultrapassagem nas paradas com pré-embarque, tecnologia para informação ao usuário,  Implantação de terminais para a troncalização com os bairros.',5627479056.00,'','150 km de Corredor de Ônibus implantados, 04 Terminais de Ônibus implantados','A meta inclui a implantação de vias segredadas em pavimento rigído com largura de 3,5m e 7m nas paradas para ultrapassagem, pré-embarque em todas as paradas ao longo do corredor e nos terminais e tecnologia para informação ao usuário. Prevê também a redução do número de linhas para um máximo de 3 a 5 linhas por corredor; enterrar a fiação; realizar ciclovias ao longo dos corredores.\nCorredores planejados**:\nCorredor Aricanduva - Extensão: 14 km\nCorredor Leste Radial - Extensão: 25,5 km\nCorredor Leste Itaquera - Extensão: 14,1 km\nCorredor Berrini - Extensão: 3,3 km\nCorredor Vila Natal - Extensão: 6,3 km\nCorredor Sabará - Extensão: 7,6 km\nCorredor Miguel Yunes - Extensão: 4,23 km\nCorredor Capão Redondo / Campo Limpo / Vila Sônia - Extensão: 12 km\nCorredor Perimetral Itaim Paulista / São Mateus (Ragheb Chohfi) - Extensão: 24,1 km\nCorredor Belmira Marin - Trecho 2 - Extensão: 3,8 km\nCorredor Canal Cocaia - Extensão: 10 km\nCorredor Inajar de Souza - Requalificação - Extensão: 14,6 km\nCorredor MBoi Mirim / Santo Amaro - Requalificação - Extensão: 16 km\n\nTerminais de Ônibus a serem implantados:\nTerminal Itaquera\nTerminal Novo Jd. Ângela\nTerminal Perus\nTerminal Novo Parelhereiros\n\nCorredores do Plano Viário Sul (custos previstos na ficha da meta correspondente):\nCorredor MBoi Mirim / Cachoeirinha - Extensão 5,5 km\nCorredor Guarapiranga / Guavirutuba - Extensão: 5,7 km\nCorredor Agamenon - Baronesa - Extensão: 7,5 km\nCorredor Av. Carlos Caldera Filho - Extensão: 3,3 km\nCorredor Belmira Marin - Trecho 1 - Extensão: 3,1 km\n\n*O custo total de implantação de corredores descrito no campo \"Custo Total da Meta\" corresponde a 125 km de corredores e 4 terminais. Os 25 km de corredores faltantes serão implantados no Plano Viário Sul (meta 99), e seus custos estão descritos na ficha daquela meta.\n** Para garantir a execução de 150 km de corredores no prazo do Programa de Metas, é necessário a elaboração e execução de projetos para além da meta estabelecida, de forma a se antecipar a eventuais imprevistos. Por esse motivo, a quilometragem total dos projetos aqui descritos é superior ao quantitativo da meta.\n','Corredor de Ônibus: Via exclusiva, à esquerda, para a circulação de ônibus.',3,NULL,'Entregue a ampliação do Terminal Itaquera e prolongamento do Corredor 9 de julho. Iniciadas as obras do Túnel do Corredor Leste Radial 1','37,9 km de obras em andamento, 62km com obras contratadas, 26km em licitação','','','','','0000-00-00 00:00:00','2015-01-13 21:30:55'),(94,16,2,6,'Implantar as novas modalidades temporais de Bilhete Único (Diária, Semanal e Mensal)','Um instrumento de política tarifária que permitirá aos usuários o deslocamento, sem restrição, por toda a cidade pelo período adquirido (diário, semanal ou mensal). Esse instrumento é composto por novos cartões, novos aplicativos e atualização tecnológica do Sistema Bilhete Único.',17500000.00,'Bilhete Único Mensal implantado','Bilhete Único Semanal implantado, Bilhete Único Diário implantado','A implantação das novas modalidades consiste na emissão de cartões (bilhetes) com validade no período e à atualização tecnológica de todo o sistema de bilhetagem.\n* Custo referente à infraestrutura tecnológica e física necessária para a implantação da meta, entregue em 2013','Bilhete Único Mensal: bilhete de validade mensal, com o qual o valor pago dá direito ao deslocamento por toda a cidade, sem limitação de viagens no período.\nBilhete Único Semanal: como o mensal, porém para o período de uma semana.\nBilhete Único Diário: analogamente, com validade para um dia.',4,NULL,'Passagens gratuitas para alunos do ensino fundamental e médio da rede pública, de universidade pública com renda familiar per capita de até 1,5 salário mínimo nacional e de universidade privada beneficiários do Prouni, Fies, Bolsa Universidade ou Cotas Sociais.','820.820 pessoas cadastradas até dezembro de 2014','','','','','0000-00-00 00:00:00','2015-01-13 21:39:46'),(95,16,2,2,'Implantar horário de funcionamento 24h no transporte público municipal','Linhas de ônibus operando 24h/dia com linhas noturnas ou diuturnas',0.00,'Projeto piloto','Rede de Linhas da Madrugada implantada','O planejamento inicial prevê que os ônibus noturnos percorram o mesmo trajeto das linhas do Metrô, seguindo modelos de referência internacional e facilitando a orientação do usuário. A definição precisa dos trajetos, dos intervalos entre os ônibus e das ligações entre a rede noturna planejada e já existente ainda está em planejamento pela SPTrans','Linha noturna: linha de ônibus com programação de partidas no período noturno.\nLinha diuturna: linha de ônibus com operação initerrupta (24h).',3,NULL,'Diagnóstico e concepção de linhas do transporte 24h finalizados.','Projeto piloto Transporte 24 horas em andamento: Santo Amaro, M\'Boi Mirim, Lapa, Pirituba, Sé, Mooca, Penha, Ermelino Matarazzo, São Miguel e Itaim Paulista.','','','','','0000-00-00 00:00:00','2015-01-13 21:40:48'),(96,16,2,2,'Implantar 150 km de faixas exclusivas de ônibus','150 Km de faixas exclusivas de ônibus, sinalizadas e com tratamento prioritário para o transporte coletivo',45000000.00,'150 km de Faixas Exclusivas de Ônibus','','As diretrizes do Plano Diretor Estratégico estabelecem a prioridade do transporte público. A meta prevê a instalação de mais 150 km de faixas à direita em eixos de transporte cuja frequência dos ônibus estejam acima de 40 ônibus por sentido no horário pico. Os atuais recursos de vigilância, como radares, câmeras de vigilância, sensores de massa veicular e outros, tornam possível assegurar um nível de respeito às faixas exclusivas à direita. Os conflitos com veículos nas conversões à direita, o acesso e saídas das garagens e as operações de cargas e descargas deverão ser mantidos sob controle através de fiscalização adequada. A implantação de faixas exclusivas à direita requer como medida prévia a proibição de estacionamento nesta faixa, para que a mesma seja dedicada exclusivamente aos ônibus.\n\nVias que receberão faixas exclusivas (informação completa dos trechos contemplados estará disponível no site do Programa de Metas):\n\nAv. Jabaquara / Av. Eng. Armando de Arruda Av. Luís Dumont Vilares Pereira\nR. Cesário Galeno / R. Honório Maia\nR. Gonçalo Nunes / R. Rodrigues Velho\nAv. Raimundo Pereira de Magalhães\nAv. Casa Verde / R. D. Amaral Mousinho\nAv. Auro Soares de Moura Andrade\nAv. Antártica / Av. Sumaré / Av. Paulo VI\nAv. das Nações Unidas R. Silva Bueno\nAv. Magalhães de Castro / Av. Mj. Sílvio de Magalhães Padilha (Marginal Pinheiros)\nAv. Pres. Castelo Branco / Av. Condessa Elisabeth de Robiano (Marginal Tietê)\nAv. Elísio Teixeira Leite Rótula Central\nR. Alfredo Pujol\nR. Nossa Senhora da Lapa / R. Monteiro de Melo\nR. Tomazzo Ferrara\nR. John Harrisson / R. Gago Coutinho\nAv. Itaberaba\nAv. Imirim\nAv. Zaki Narchi\nAv. Eng. Caetano Alvares\nR. Sumidouro\nR. Bom Pastor / R. Antonio Marcondes / Av. Nazaré\nAv. Amador Bueno da Veiga\nAv. Brigadeiro Luís Antonio\nAv. Águia de Haia\nR. Rodovalho Júnior\nAv. Nova Cantareira\nAv. Conselheiro Carrão\nViaduto Conselheiro Carrão\nR. Antonio de Barros\nR. Domingos Calheiros\nAv. Regente Feijó\nAv. Tucuruvi\nR. Cel. Sezefredo Fagundes\nR. Monte D´Ouro\nR. Luis Gama / R. Silveira da Mota / R. Otto de Alencar / R. Barão de Iguape\nR. Francisco Alves / R. Jeroaquara / R. Trajano\nR. Duarte de Azevedo\nAv. Conselheiro Rodrigues Alves\nViad. Domingos de Morais\nR. Loefgreen\nR. Baltazar Carrasco\nAv. Água Fria\nAv. Nordestina\nR. Dr. João Ribeiro\nR. Monte Pascal\nR. Brig. Gavião Peixoto\nR. Faustolo\nR. João XXIII\nR. Padre Benedito de Carvalho\nR. Ver. Cid Galvão\nR. Cel. Rodovalho Av. Dr. Eduardo Cotching\nAv. Corifeu de Azevedo Marques\nAv. Morvan Dias de Figueiredo (Marginal Tietê)\nAv. Pedro Alvares Cabral / Av. Ibirapuera\nR. Maria Cândida / R. Olavo Egídio\nR. do Lavapés\nR. da Independência\nAv. D. Pedro I\nAv. Cangaíba\nAv. Penha de França\nR. Clímaco Barbosa\nR. Comendador Cantinho\nR. João Teodoro\nAv. Eng. George Corbisier\nR. Ibitirama / R. e Viad. Cap.\nPacheco e Chaves / R. do\nAv. Sapopemba\nR. Heitor Penteado / Dr. Arnaldo / Av. Paulista / Av. Bernardino de Campos\nAv. Indianópolis\n\nEixo Norte-Sul (Av. Santos Dumont / Av. Tiradentes / Av. 23 de Maio / Av. Rubem Berta / Av. Moreira Guimarães / Washington Luiz / Interlagos/ Jangadeiro / Teotônio Vilela)','Faixa exclusiva de ônibus à direita: Faixa de trânsito reservada ao tráfego exclusivo de ônibus em tempo integral ou em horários pré-determinados.',5,NULL,'Já foram implementados 368,5 km até dezembro de 2014. Em 2013 foram implementadas 291,4 km, praticamente o dobro do previsto para 4 anos.','Quem optou pelo transporte público na cidade teve um ganho individual médio de 38 minutos/dia','291,4 Km em 2013: Região Central (25,8 km), Região Sul (76,4 km), Região Norte (40,0 km), Região Leste (117,9 km) e Região Oeste (31,3 km).','35,5 Km até 30/04/2014 : Região Central (0,3 km), Região Sul (12,0 km), Região Norte (6,2 km), Região Leste (11,5 km) e Região Oeste (5,5 km).','28,5 Km até 31/08/2014 : Região Central (0,4 km), Região Sul (7,4 km), Região Norte (10,4 km), Região Leste (4,0 km) e Região Oeste (6,3 km).                                                 Total implantado até agosto/14 = 355,4 Km',NULL,'0000-00-00 00:00:00','2014-10-31 03:28:06'),(97,16,2,2,'Implantar uma rede de 400 km de vias cicláveis','400 km de infraestrutura cicloviária de circulação (ciclovias, ciclofaixas, ciclorrotas, calçadas compartilhadas)',70000000.00,'52,5 km de ciclorrotas no Bike Sampa, 56,7 km de vias cicláveis no Plano Cicloviário','140,8 km de Vias Cicláveis na Expansão do Plano Cicloviário, 150 km de ciclovias junto aos novos corredores de ônibus','A meta inclui a instalação de estacionamentos para bicicletas e a implantação de um sistema de compartilhamento que será gerenciado pelo Bilhete Único.\nProjetos de vias cicláveis a serem implantados:\nPlano Cicloviário SMT/CET Setor Norte - 18,43 km de Infraestrutura Cicloviária, sendo 4,52 km de Ciclovia; 7,36 km de Ciclofaixa; 5,03 km de tráfego\nCompartilhado e 1,52 km de Rota de Bicicleta.\nPlano Cicloviário SMT/CET Setor Sul - 12,14 km de Infraestrutura Cicloviária, sendo 6,70 km de Ciclovia; 0,76 km de Ciclofaixa; 3,90 km de Tráfego\nCompartilhado e 0,78 km de Rota de Bicicleta.\nPlano Cicloviário SMT/CET Setor Leste - 26,27 km de Infraestrutua Cicloviária, sendo 7,51 km de Ciclovia; 13,46 km de Ciclofaixa; 2,18 km de tráfego\nCompartilhado e 3,12 km de Rota de Bicicleta.\nExpansão do Plano Cicloviário SMT/CET Setor Norte - 46,00 km de Infraestrutura cicloviária.\nExpansão do Plano cicloviário SMT/CET Setor Sul- 11,00 km de Infraestrutura Cicloviária.\nExpansão do Plano cicloviário SMT/CET Setor Leste - 63,00 km de Infraestrutura Cicloviária.\nProjeto Bike Sampa - Ciclorrotas compartilhadas\nCiclovias nos corredores de ônibus (custos das ciclovias nos corredores estão imbutidos nos custos do projeto de corredor e não contribuem para o\nvalor definido no campo \"Custo Total da Meta\")','Rota de Bicicleta ou Ciclorrota: Ruas já utilizadas por ciclistas que circulam nos bordos da via junto com o tráfego geral e que recebem sinalização vertical e horizontal especifica (placas e pintura de solo) alertando os motoristas sobre a presença e a prioridade a ser dada ao tráfego ciclístico, além da adoção da velocidade veicular em 30 km/h..\nCiclovia: Pista para uso exclusivo para circulação de bicicletas, segregada fisicamente do restante da via, dotada de sinalização vertical\ne horizontal especifica (placas e pintura de solo). Pode estar situada na calçada, no canteiro central de uma via ou na própria pista onde circula o tráfego geral.\nCiclofaixa: Faixa para uso exclusivo para circulação de bicicletas sem segregação física em relação ao restante da via e caracterizada por sinalização vertical e horizontal especifica (placas e pintura de solo). Normalmente situa-se nos bordos da pista por onde circula o tráfego geral, mas pode também situar-se na calçada e no canteiro central.\nCalçada Compartilhada: Calçadas onde é autorizada a circulação montada de bicicletas e que recebem sinalização vertical (placas) regulamentando esta situação.',3,NULL,'Implantados 205,1 km até dezembro de 2014.','Ciclistas terão faixas exclusivas em 12 pontes nos próximos dois anos.','Valor executado 2014: R$R$ 30.868.960,71\n','','','','0000-00-00 00:00:00','2015-01-16 21:15:07'),(98,16,2,1,'Modernizar a rede semafórica','Projeto DNA Semafórico: É composto pelo Cadastro Semafórico, Programa Olho no Semáforo e Indicador de Qualidade Semafórica Realização e tem como finalidade o diagnóstico da situação atual dos semáforos na cidade, com participação ativa da população para identificação e tratamento dos problemas,  Recuperação de 4.800 intersecções do Sistema de Sinalização Semafórica',274192935.38,'Projeto DNA Semafórico implantado, 3.654 Intersecções Semafóricas modernizadas','1.146 Intersecções Semafóricas modernizadas','Orientar a ampliação da rede de semáforos operando em tempo real ao longo dos principais corredores de transporte e trânsito do município','Automação Semafórica: programação semafórica dos cruzamentos conectada ao sistema de controle centralizado operando em tempo real.',3,'sp-mais-inclusiva','Central de Monitoramento Semafórico implementada; 4.422 cruzamentos reformados; 948 NoBreaks em operação; 579 GPRS e 325 controladores instalados','Projeto DNA Semafórico em andamento com diversas ferramentas já implementadas nos sistemas','Projeto DNA Semafórico em andamento com diversas ferramentas já implementadas nos sistemas: \n- Realizada integração do processo de falha semafórica\n- Desenvolvido sistema de obtenção de indicadores BI-SMEE\n- Desenvolvido Indicador de Qualidade Semafórico\n- Em fase de conclusão da integração dos sistemas SMEE com as empresas contratadas (gestão de falhas, banco do DNA e sistema de comunicação com a central)','','','','0000-00-00 00:00:00','2015-01-13 21:54:22'),(99,16,2,6,'Projetar, licitar, licenciar e garantir a fonte de financiamento para a execução do Plano Viário Sul','Melhoramento e duplicação de 7,5km da R. Agamenon e Estrada da Baronesa com implantação de corredor de ônibus, Prolongamento e duplicação de 5,5 km da Estrada do M\'Boi Mirim com implantação de corredor de ônibus,  Duplicação de 1,2km da Estrada da Cachoeirinha com implantação de corredor de ônibus, Prolongamento de 3,3km da Av. Carlos Caldeira Filho com implantação de corredor de ônibus e canalização do córrego Água dos Brancos, Melhoramentos e duplicação de 3,1km da Av. Dona Belmira Marin com implantação de corredor de ônibus, Melhoramento e alargamento de 4,9km da Estrada de Itapecerica, Duplicação de 6,3km da Estrada do Alvarenga, Melhoramento e duplicação de 5,7km da Av. Guarapiranga/ Estrada Guavirituba com implantação de corredor de ônibus.',1743000000.00,'30% das obras','70% das obras','Além dos melhoramentos viários, o custo e a descrição da meta inclui a implantação de 25km de corredores de ônibus que devem ser contabilizados como entrega para os 150km de corredores de ônibus. O total das intervenções de melhoramento, duplicação, prolongamento ou implantação de corredor é de 36,3km.','Plano Viário Sul: Plano de obras viárias localizadas na região do extremo sul da cidade de São Paulo.',3,NULL,'36 km de corredores do Plano Viário Sul em licitação','1º Pontilhão do rio Embu-Guaçu entregue','','','','','0000-00-00 00:00:00','2015-01-13 22:05:56'),(100,16,2,2,'Concluir obras do complexo Nova Radial','Obras Viárias Complementares ao Prolongamento da Radial Leste - 2ª Etapa (Subprefeituras Guaianases, Itaquera, Penha e São Miguel): conjunto de intervenções para acesso e apoio ao novo trecho da Radial Leste.',309999000.00,'','Nova Radial finalizada','','',3,NULL,'Viaduto Itaquera concluído em dezembro de 2013','Entregue trecho inicial do Córrego Verde junto ao Rio Jacu','Obras da Passagem Inajar-Guaçu em andamento','Tratativas para início da obra do Viaduto Guaianazes','','','0000-00-00 00:00:00','2015-01-13 22:06:48'),(101,16,2,2,'Projetar, licitar, licenciar, garantir a fonte de financiamento e construir a ponte Raimundo Pereira de Magalhães','Ponte Raimundo Pereira Magalhães construída.',220000000.00,'','Ponte construída','A Ponte da Avenida Raimundo Pereira de Magalhães será construída sobre o rio Tietê reestabelece a ligação entre a parte norte da avenida com o bairro da Lapa e a Avenida Marginal do Tietê, numa extensão de cerca de 200 metros, além de viário complementar.','',2,NULL,'Projeto da obra concluído','Preparação para audiência pública e licitação em andamento','','','','','0000-00-00 00:00:00','2015-01-13 22:07:44'),(102,16,2,6,'Ampliar o Programa de Proteção à Vida atendendo as  32 subprefeituras com ações de segurança e de educação','Programa Proteção ao Pedestre, com ações educativas, de engenharia e de fiscalização.',12000000.00,'22 novos locais atendidos','10 novos locais atendidos','Reduzir em 10% / ano o número de acidentes de trânsito com pedestres, ampliando o programa de proteção ao pedestre para toda a cidade, enfatizando corredores de ônibus periféricos, subcentros comerciais e pólos geradores de pedestres (regiões com alto índice de atropelamentos) com a implementação de ações de educação, engenharia e fiscalização.','Programa de Proteção ao Pedestre: programa cujo objetivo é criar a cultura de respeito ao pedestre, resgatando os valores de proteção ao pedestre, de maneira a ampliar a segurança destes e reduzir os índices de acidentalidade por atropelamentos',3,NULL,'17 grandes avenidas e 11 locais de concentração de pedestres tiveram ações preventivas entre 2013 e 2014.','Redução de 10% dos atropelamentos entre 2012 e 2013','Ações preventivas em 17 grandes avenidas com redução do número de orientadores de travessia para 255 em novembro/14.\n','','','','0000-00-00 00:00:00','2015-01-13 22:00:37'),(103,16,2,2,'Construir a Alça do Aricanduva','Alça construída',10000000.00,'','Alça construída','A alça permitirá o acesso à Marginal Tietê evitando a entrada no bairro da Penha.','',2,NULL,'Projeto da obra concluído','Laudos de desapropriação em elaboração','A alça tem por objetivo permitir o acesso à Marginal Tietê evitando a entrada no bairro da Penha.','','','','0000-00-00 00:00:00','2015-01-13 22:08:20'),(104,17,2,2,'Intervir em 79 pontos de alagamentos por meio do Programa de Redução de Alagamentos - PRA','Intervenções em 79 pontos de alagamentos realizadas',133000000.00,'79 pontos','','O Programa compreende a execução de serviços para redução dos pontos de alagamento e margens de córrego com situação crítica quanto à interdição de tráfego e erosão ou solapamento. Os locais de execução dos serviços foram definidos e priorizados em estudos realizados pela SIURB, SMSP, Subprefeituras e CET. O programa está organizado em lotes regionais que reúnem intervenções em ruas / logradouros por subprefeitura: Lote I - Sul (Capela do Socorro, Ipiranga, Jabaquara, Santo Amaro); Lote II - Oeste/Centro/ Sudeste (Móoca, Lapa, Sé, Pinheiros); Lote III - Norte/ Noroeste (Casa Verde, Freguesia do Ó, Jaçanã/Tremembé, Vila Maria/Vila Guilherme, Pirituba, Santana); Lote IV - Leste (Ermelino Matarazzo, Itaquera, Itaim Paulista, São Miguel); Lote IV - Leste (Ermelino Matarazzo, Itaquera, Itaim Paulista, São Miguel).','Programa de Redução de Alagamentos – PRA: prevê minimizar alagamentos em vários pontos da cidade, em função de insuficiências do sistema existente de drenagem ou de margens de córregos com solapamentos. As obras e serviços previstos no PRA são pontuais e de rápida implantação, servindo como complemento aos macro-programas de drenagem da cidade.',3,NULL,'27 intervenções em pontos de alagamentos concluídas','26 intervenções em obras','Valor executado 2014: R$R$ 36.830.628,90\n','','','','0000-00-00 00:00:00','2015-01-16 21:14:50'),(105,17,2,2,'Realizar intervenções de controle de cheias em bacias dos córregos: Ponte Baixa, Zavuvus, Sumaré/Água Preta, Aricanduva, Cordeiro, Praça da Bandeira, Av. Anhaia Mello, Freitas/Capão Redondo, Paraguai/Éguas, Riacho do Ipiranga, Tremembé, Ribeirão Perus e Paciência e desenvolver o projeto para intervenção nos córregos do Itaim Paulista','Canalização de 15,4km de córregos, construção de 8 reservatórios e 2 parques lineares com um total de 560.000m² de área verde.',3300000000.00,'9 reservatórios implantados, 394.000 m² de parque linear implementados, 1 caixa de equalização implantada, 11.370 metros canalizados','20 reservatórios implantados (2 em processo de revisão - Reservatórios do Anhangabaú),  1.266.000 m² de parque linear implementados, 2 caixas de interligação implantadas, 3 caixas de equalização implantadas, 14.391 metros canalizados','1. PONTE BAIXA (Subprefeitura do M\'Boi Mirim) - Canalização de 3.080m do Córrego e implantação de 1 reservatório.\n2. ZAVUVUS (Subprefeituras de Santo Amaro e Cidade Ademar) - Canalização de 3.520m do Córrego Zavuvus com implantação de 2 reservatórios e um parque linear de 200.000m².\n3. SUMARÉ E ÁGUA PRETA (Subprefeitura Lapa) - Canalização de 8.800m do Córrego.\n4. ARICANDUVA (Subprefeitura Aricanduva e São Mateus) - Implantação de 2 reservatórios e um parque linear de 360.000m² na área do Córrego.\n5. PRAÇA DA BANDEIRA (Subprefeitura Sé) - Implantação do reservatório do Anhangabaú.\n6. ANHAIA MELLO (Subprefeitura Vila Prudente/Sapopemba) - Implantação de 2 reservatórios\n7. Ribeirão Perus (Subprefeitura Perus) - Canalização de 110m do Córrego com implantação de 5 reservatórios e um parque linear de 1.100.000 m².\n8. Riacho do Ipiranga (Subprefeitura Ipiranga) - Canalização de 2.200 m do Córrego com implantação de um reservatório.\n9. Paciência (Subprefeitura Jaçana/Tremembé) - Canalização de 2.400m com implantação de um reservatório no Córrego Paciência.\n10. Tremembé (Subprefeitura Jaçana/Tremembé) - Canalização de 2.500 m com implantação de 6 reservatórios no Córrego.\n11. Morro do S - Freitas/Capão Redondo (Subprefeitura Campo Limpo) -\n12. Cordeiro (Subprefeitura Cidade Ademar e Santo Amaro) - Canalização de 2.200m do Córrego Alcatrazes e 270m de canalização do Córrego Cordeiro com implantação de 6 reservatórios, 4 caixas de equalização de vazão e 2 caixas de interligação de galerias.\n13. Paraguai/Éguas (Subprefeitura Santo Amaro e Vila Mariana) - Implantação de um reservatório.\n14. Ribeirão Água Vermelha, Ribeirão Lajeado, Córrego Itaim, Córrego Tijuco Preto e afluentes (Subprefeitura Itaim Paulista) - Elaboração de projeto básico e viabilização do inicio da intervenção\nOs custos relacionados às obras acima incluem gastos com as desapropriações necessárias à execução da obra.','Intervenções de macrodrenagem: obras de apoio à drenagem associadas à bacia ou à sub-bacia hidrográfica',3,NULL,'Córregos Ponte Baixa, Sumaré/Água Preta e Cordeiro com obras em andamento.','Entregue trecho da canalização do Córrego Ponte Baixa entre o Canal da Guarapiranga e a Av. Guido Caloi.','Entregue trecho da canalização do Córrego Ponte Baixa entre o Canal da Guarapiranga e a Av. Guido Caloi.','A meta prevê a canalização de 15,4km de córregos, a construção de 8 reservatórios e a construção de 2 parques lineares, com 560 mil m² de área verde.','Obras do Córrego Aricanduva em licitação. Córregos Ipiranga, Tremembé, Paciência, Ribeirão Perus e Paraguai/Éguas com pré qualificação publicadas','','0000-00-00 00:00:00','2015-01-13 22:10:53'),(106,17,2,2,'Desenvolver o programa de drenagem e manejo das águas pluviais, com a criação de uma instância municipal de regulação, articulação e monitoramento da drenagem urbana','1 Programa de drenagem criado, 1 Instância municipal de drenagem.',20076242.00,'','Programa de drenagem, Instância municipal de drenagem','Será realizada a elaboração de estudos de 6 seis bacias hidrográficas inscritas no território do município, com objetivo básico de recuperação dos cursos d%u2019água e de suas bacias hidrográficas, de modo a integrá-las ao tecido urbano com sustentabilidade ambiental. Tal estudo engloba o levantamento realizado de informações básicas das bacias hidrográficas, diagnóstico hidrológico e hidráulico e desenvolvimento dos modelos computacionais de simulação hidráulica, proposição de medidas estruturais e não estruturais de implantação imediata, de curto, médio e longo prazos, execução de anteprojetos de intervenções, viabilidade ambiental das obras propostas; proposição de aprimoramento institucional. O Programa prevê também a institucionalização de uma instância municipal que articule os órgãos que atuam na questão da drenagem urbana.','Bacia hidrográfica: é uma área de captação natural da água de precipitação que faz convergir o escoamento para um único ponto de saída.',2,NULL,'Diagnósticos de 16 bacias hidrográficas em elaboração, a partir dos estudos hidrológicos realizados pela SIURB.','Projeto de Lei para Criação da Entidade das Águas finalizado.','','','','','0000-00-00 00:00:00','2015-01-13 18:56:48'),(107,18,3,3,'Criar 32 Centros de Atendimento ao Cidadão - CAC','Centros de Atendimento ao Cidadão funcionando em cada subprefeitura.',55000000.00,'','32 CACs','Adequação do espaço físico, modernização do atendimento e ampliação dos serviços oferecidos.','Centros de Atendimento ao Cidadão – CAC: é a modernização de toda a infraestrutura das atuais Praças de Atendimento que irá incluir adequação do espaço físico, otimização e ampliação dos serviços atendidos, integração dos sistemas de atendimento oferecidos.',2,NULL,'Sistema de Gerenciamento de Atendimento já em funcionamento na Subprefeitura da Mooca, com o objetivo principal de gerenciar filas e fluxos de atendimento.','Expansão dos serviços nas Praças de Atendimento das Subprefeituras com projeto elaborado.\n','Em elaboração Política de Atendimento aos Munícipes, visando superação da fragmentação e definição de diretrizes gerais.','A implantação ocorrerá em módulos simultâneos em todas as subprefeituras.','Finalização do Termo de Referencia para contratação de empresa para realização do levantamento e planejamento do layout das praças de atendimento, considerando: Infraestrutura Física, Infraestrutura Lógica, Mobiliário, Acessibilidade.','Em desenvolvimento um Sistema de Gerenciamento de Atendimento, com objetivo principal de gerenciar filas e fluxos de atendimento nas praças das Subprefeituras. ','0000-00-00 00:00:00','2015-01-13 22:31:33'),(108,18,3,7,'Ampliar e modernizar os serviços oferecidos por meio do 156','Serviço de atendimento ao cidadão reestruturado, tanto na parte externa do serviço como nos fluxos internos das demandas dos cidadãos.',50000000.00,'','156 modernizado','Os serviços de atendimento ao cidadão encontram-se hoje desarticulados e sem um fluxo adequado para que as respostas sejam dadas num período de\ntempo adequado ao cidadão. A ampliação e reestruturação destes canais visam garantir um atendimento ágil e eficaz das demandas dos cidadãos.','156: É a Central telefônica da Prefeitura de São Paulo que fornece informações sobre os serviços públicos municipais.',3,NULL,'Desde março de 2013, a população recebe a confirmação do agendamento de consultas na Rede Hora Certa pelo serviço 156.','Edital para contratação de nova empresa gestora em preparação.','Diagnóstico dos fluxos internos do serviço e integração com outros canais concluídos, o que é fundamental para dar mais agilidade e precisão ao atendimento.','','','','0000-00-00 00:00:00','2015-01-14 20:46:26'),(109,18,3,7,'Criar a Subprefeitura de Sapopemba','Subprefeitura de Sapopemba criada',0.00,'Subprefeitura de Sapopemba criada','','A Subprefeitura de Sapopemba deverá responder as atribuições e responsabilidades definidas pela lei nº 13.399 de 01/08/2002 de criação das Subprefeituras. Sua criação aumentará a capilaridade do Estado, aproximando-o da população.','Subprefeitura: Criadas em pela lei 13.399, são unidades do poder público municipal responsáveis pela maioria dos equipamentos públicos, como clubes da comunidade (antigos CDMs) e clubes da cidade. Têm o papel de receber pedidos e reclamações da população, solucionar os problemas apontados; preocupam-se com a educação, saúde e cultura de cada região, tentando sempre promover atividades para a população. Além disso, elas cuidam da manutenção do sistema viário, da rede de drenagem, limpeza urbana, vigilância sanitária e epidemiológica, entre outros papéis que transformam, a cada dia, essas regiões da cidade em locais mais humanizados e cheios de vida.',4,NULL,'Subprefeitura de Sapopemba criada (Lei 15.764/2013), a 32ª da cidade.','Sede já definida no endereço \"Av. Sapobemba, 9064 - Jardim Grimali. Inauguração da sede da Subprefeitura de Sapopemba no dia 24/01/15.','','','','','0000-00-00 00:00:00','2015-01-13 22:33:03'),(110,18,3,4,'Integrar os sistemas de informação dos diversos órgãos municipais (Guarda Civil Metropolitana, Companhia de Engenharia de Tráfego, SAMU, Defesa Civil)  e implantar a Central de Operações da Defesa Civil para a gestão de riscos e respostas a desastres ','Sistema de informações das diversas instituições com base de dados integrada, Implantação de uma Central de operações e atendimento da Defesa Civil no tocante a sua infra-estrutura e equipamentos para alimentação de um sistema em um banco de dados integrados com diversas centrais setoriais e emergência da Cidade de São Paulo',30000000.00,'','Sistema de Informação integrado, Central de Operações da Defesa Civil','A implantação da Central de Operações da Defesa Civil permitirá aos órgãos envolvidos o aperfeiçoamento dos processos, com agilização no atendimento à população nas situações de emergência e no planejamento estratégico. Nesse sentido, os esforços para seu funcionamento compreende o desenvolvimento do projeto, a implantação de infraestrutura e do Centro, a qualificação dos profissionais, a instalação dos sistemas de integração e dos equipamentos e a definição de protocolos de atendimento para os órgãos de emergência. E, ainda o desenvolvimento de uma base de dados da Defesa Civil para coleta, sistematização e compartilhamento com a sociedade','Central de operações: Centro onde se coordena as ações de prevenção e resposta a desastres e calamidades.',2,NULL,'Termo de Referência e Especificação Técnica do serviço de integração em revisão. ','Centro de Controle Operacional Integrado (CCOI) e sede administrativa já alocados na Central de Operações da Defesa Civil.','Transferência total do 199 para o CCOI, inclusive com operações conjuntos do 199 e SGOC (Sistema de Gerenciamento Ocorrências).','','','','0000-00-00 00:00:00','2015-01-13 22:36:20'),(111,18,3,7,'Implantar um Sistema de Informação Geográfica, com dados abertos e livre consulta pelo público','Sistema de Informação Geográfica implantado.',10700000.00,'','Sistema de Informação Geográfica','O SIG-SP está institucionalizado pelo Decreto nº 50.736/2009. O SIG gerido pela SMDU, envolverá informações disponibilizadas pelas secretarias e órgão externos, relacionados com atividades de expressão territorial. Será desenvolvido em padrões compatíveis com os sistemas livres e de mercado, aderentes à Infraestrutura Nacional de Dados Espaciais (INDE), bem como à Open Geospatial Consortium (OGC).\nComo sistema corporativo, produz e reproduz informação de maneira inteligente com o apoio das geotecnologias. No âmbito de SMDU e SPUrbanismo, produzirá um sistema integrado dos bancos de dados existentes, agregando a informação geográfica como componente de suas análises, seja em ambiente interno (módulo I de integração) ou externo (Infolocal).','Sistema de Informação Geográfica (SIG): Conjunto de pessoas, organizações, dados, equipamentos e programas de coleta, processamento, análise e disseminação da informação geográfica.\nInfraestrutura de Dados Espaciais (IDE): Conjunto integrado de tecnologias; políticas; mecanismos e procedimentos de coordenação e monitoramento; padrões e acordos, necessário para facilitar e ordenar a geração, o armazenamento, o acesso, o compartilhamento, a disseminação e o uso dos dados geoespaciais de origem federal, estadual, distrital e municipal.',3,NULL,'Download do Mapa Digital da Cidade disponível ao público.','Concluído Plano de Integração das Bases de Dados e Sistemas Existentes.','Sistema GeoSampa em operação para toda a Prefeitura.','','','','0000-00-00 00:00:00','2015-01-13 19:01:13'),(112,18,3,4,'Criar 400 Núcleos de Defesa Civil','Banco de dados com as informações inerentes as lideranças e áreas de riscos,  Treinamento das lideranças cadastradas para em caso de ocorrências adotarem providências no sentido de alertar os demais moradores da comunidade e contatar a Defesa Civil',21000.00,'250 NUDECs','150 NUDECs','Para a criação de 400 novos NUDECs, será realizado o mapeamento das áreas pelo IPT, cadastramento de pessoas da comunidade e treinamento. O mapeamento será priorizado para as áreas de risco 4 - perigo eminente (morro/encosta).','Núcleos de Defesa Civil: grupos locais cuja finalidade é desenvolver um processo de orientação permanente junto à população',3,NULL,'267 núcleos recadastrados.','O NUDEC é o elo mais importante do Sistema de Defesa Civil. Integra todo o Sistema de Defesa Civil, empresas, estabelecimentos de ensino, comunidade e instituições de segurança pública. ','Elaboração de um senso dos 267 NUDECS existentes visando suas atualizações (janeiro de 2015 a março de 2015). Edital visando proposta de uma nova chamada pública para os NUDECS restantes.','','','','0000-00-00 00:00:00','2015-01-21 18:07:52'),(113,19,3,6,'Criar o Conselho da Cidade, o Conselho Municipal de Transportes e mais 6 novos Conselhos Temáticos','Conselhos criados e em atuação',0.00,'Conselho da Cidade, Conselho Municipal de Transportes','06 novos Conselhos Temáticos','Os Conselhos Previstos são: Desenvolvimento Econômico e Social (Conselho da Cidade); Igualdade Racial; Esporte, Lazer e Recreação; Políticas paraas Mulheres; Defesa do Consumidor; Transparência Pública e Combate à Corrupção; Comunicação.','Conselhos: órgão colegiado envolvendo membros da sociedade civil e do governo para apoio à gestão de políticas públicas.',3,'sp-aberta','Criados o Conselho da Cidade; o Conselho Municipal de Transportes; e o Conselho Municipal do Esporte, Lazer e Recreação','Conselho Municipal de Transparência e Controle Social em votação na Câmara dos Vereadores.','Assinado decreto nº 55.352, de 23 de julho de 2014, que institui o Comitê Intersecretarial de Participação Social.','Política Municipal de Participação Social e Sistema Municipal de Participação Social em construção.','Criados a Comissão de Erradicação do Trabalho Escravo e o Comitê Intersetorial da População em Situação de Rua. Conselho dos Migrantes está em fase de elaboração.','','0000-00-00 00:00:00','2015-01-14 20:48:29'),(114,19,3,6,'Criar Conselhos Participativos nas 32 Subprefeituras','Os Conselhos de Representantes efetivados em cada subprefeitura',0.00,'32 Conselhos Participativos','','','Conselhos Participativos das Subprefeituras: são espaços institucionalizados de tomada de decisão e de controle social no que se refere às ações empreendidas pelos governos locais, seja no processo de elaboração, no processo de implantação, execução, seja no processo de avaliação e monitoramento.',4,NULL,'Criação dos conselhos participativos por meio da Lei n. 15.764/13 e regulamentados pelos Decretos nº 54.156/13, 54.360/13 e 54.457/13. ','Trata-se de um organismo autônomo da sociedade civil. O papel da Prefeitura é apenas dar condições para seu funcionamento.','Eleição de 1.113 conselheiros - dez/2013 (posse em 25/jan/14). ','Eleição de 20 conselheiros representantes de imigrantes realizada em mar/2014 (posse em 28/04/14). Decretos nº 54645/13 e 54855/14.','Início dos Cursos de Formação de Conselheiros em Maio de 2014. ','Meta não orçamentária.','0000-00-00 00:00:00','2015-01-14 20:49:15'),(115,19,3,7,'Realizar 44 Conferências Municipais Temáticas','Grandes conferências temáticas realizadas, com participação direta da sociedade civil',6768928.00,'22 Conferências Municipais Temáticas','22 Conferências Municipais Temáticas','Cada conferência pressupõe no mínimo o seguinte conjunto de ações: elaboração de edital de convocação e regulamento, realizações de préconferências regionais, mobilização da sociedade civil e do governo, definição de infra-estrutura, elaboração de relatoria, publicização do relatório final e eleição de delegados, que devem ter recursos garantidos para participação nas conferências estaduais e na federal (se for o caso). Para 2013 já estão previstas as seguintes conferências municipais: Cidade, Cultura, Educação, Promoção da Igualdade Racial, Meio Ambiente, Assistência Social, Migrantes, Participação e Atenção às Drogas, Segurança Alimentar e Nutricional e Saúde.','Conferências municipais: espaços de participação direta da sociedade civil para apresentação de proposições para formulação e acompanhamento de políticas públicas (controle social). Em geral são uma etapa prévia à realização de conferências nas esferas estadual e federal',3,'sp-aberta','4 conferências realizadas em 2014 até Abril: 2ª Conferência de Proteção e Defesa Civil; 3ª Conferência de Economia Solidária; 4ª Conferência de Saúde do Trabalhador e 1ª Conferência Sobre Ruídos, Vibrações e Perturbações Sonoras.','9 conferências realizadas em 2013: Cidade; Cultura; Meio Ambiente; Assistência Social; Saúde; Educação; Promoção da Igualdade Racial; Atenção às Drogas; e Imigrantes.','As conferências municipais temáticas são espaços de participação social direta para a apresentação de propostas e o controle social de políticas públicas.','','','','0000-00-00 00:00:00','2015-01-14 20:51:08'),(116,19,3,7,'Implantar o Gabinete Digital, como instrumento de transparência e participação social','Portal na internet implantada com funcionalidades interativas',930300.00,'Gabinete Digital','','Portal na internet com as seguintes funcionalidades básicas: Agenda Colaborativa, Perguntas e Respostas da Prefeitura, Fórum de Discussão Pública via internet e interface com as redes sociais. Outras funcionalidades podem ser desenvolvidas de acordo com as necessidades detectadas.','Gabinete Digital: Portal na internet que permite a participação do cidadão e interação direta com a equipe da Prefeitura.',3,'sp-aberta','Ciclo de entrevistas com 13 secretários municipais e com o prefeito realizadas e transmitidas via streaming pelo site saopauloaberta.prefeitura.sp.gov.br','O objetivo é fomentar a participação, a transparência e o o controle social da administração municipal.','Reunião aberta \"Diálogos em Rede\", com a participação de movimentos sociais estudantes universitários','Instituído Grupo de Trabalho temático para discutir a regulamentação do PL 226/2014, que trata de Dados em Formato Aberto, e um Comitê Intersecretarial de Governo Aberto na Prefeitura de São Paulo','15 encontros realizados nas subprefeituras para formação de 575 conselheiros participativos sobre o Governo Aberto','Café Hacker sobre o Gabinete Digital realizado durante o Arena Net Mundial em Abril de 2014.','0000-00-00 00:00:00','2014-10-31 03:28:06'),(117,19,3,7,'Fortalecer os Órgãos Colegiados Municipais, dotando-os de infraestrutura e gestão adequadas para a realização das atribuições previstas em lei.','Infraestrutura básica para funcionamento adequado dos órgãos colegiados, de acordo com suas funções e rotinas',600000.00,'','','O objetivo dessa meta é garantir infraestrutura mínima e padronizada para que os órgãos colegiados realizem suas atividades, tais como: audiências, reuniões, monitoramento das políticas, mobilização social, registro de pautas, elaboração de atas, agendas e relatórios e disponibilização de informações (fortalecendo a dimensão da transparência e incentivando a adoção de novos mecanismos de cidadania digital). A depender da rotina de funcionamento (alguns têm reuniões periódicas, outros funcionamento diário), dos equipamentos já existentes e da quantidade de participantes, a infraestrutura poderá ser individual ou compartilhada entre vários órgãos. Para tanto será feito inicialmente um diagnóstico que irá detalhar de forma mais precisa as necessidades de cada um deles. Prevê-se como estrutura mínima: 1 sala para gabinete/administrativo e 1 sala para reunião/atividades diversas, 1 computador com acesso à internet e microfone, livros, datashow, equipamento de som para palestra, 1 notebook, impressora colorida, móveis para sala de reunião, telefone %u2013 aparelho e linha (ou ramal), materiais educativos\nimpressos, material de escritório e informática.','Órgãos Colegiados Municipais: compreendem os conselhos,comitês e comissões, que congregam cidadãos e Poder Público em representação a segmentos populacionais para construção de políticas públicas. São responsáveis por acompanhar políticas públicas pertinentes a sua temática, bem como promover a participação social, podendo ainda fazer propositura de planos de ação e a gestão de fundos.',2,'sp-carinhosa, sp-aberta','Revisão da legislação do Conselho de Juventude e envio de projeto de lei à Câmara de Vereadores.','Abertura de inscrições para curso de educação fiscal para conselheiros da SMDHC.','Diagnóstico inicial sobre a configuração dos órgãos colegiados municipais realizado no âmbito do GT de participação social. ','Realização de 02 audiências para a reestruturação do Conselho Municipal LGBT.','','','0000-00-00 00:00:00','2015-01-14 20:55:27'),(118,19,3,7,'Implementar o Observatório de Indicadores da Cidade de São Paulo','Portal web com um sistema de indicadores da prefeitura e da cidade acompanhado de análises setoriais relevantes para a elaboração e avaliação de políticas públicas',1515000.00,'Portal web implantado','','','Portal web com um sistema de indicadores da prefeitura e da cidade acompanhado de análises setoriais relevantes para a elaboração e avaliação de políticas públicas',4,'sp-carinhosa, sp-aberta','Portal do ObservaSampa criado com indicadores sobre a cidade e o Programa de Metas.','Acesse: observasampa.prefeitura.sp.gov.br','','','','','0000-00-00 00:00:00','2015-01-14 20:57:12'),(119,19,3,7,'Implementar o Ciclo Participativo de Planejamento e Orçamento ','Realização de eventos presenciais participativos (Audiências Públicas, Plenárias, Seminários etc.), Criação do Conselho de Planejamento e Orçamento Participativos (CPOP), Criação de um portal eletrônico para acompanhamento das atividades de planejamento e orçamento ',0.00,'Realização de eventos presenciais participativos (Audiências Públicas, Plenárias, Seminários etc.),  Criação do Conselho de Planejamento e Orçamento Participativos (CPOP), Criação de um Portal Eletrônico (http://planejasampa.prefeitura.sp.gov.br)','Realização de eventos presenciais participativos (Audiências Públicas, Plenárias, Seminários etc.)','Para ampliar os mecanismos efetivos de controle da sociedade sobre a administração pública é necessário assegurar aos cidadãos as condições de participação no debate público sobre a cidade e na priorização e decisão acerca do planejamento e dos orçamentos públicos. O Ciclo Participativo de Planejamento e Orçamento visa garantir a participação popular na elaboração e acompanhamento do Programa de Metas, do Plano Plurianual (PPA), das Leis de Diretrizes Orçamentárias (LDOs) e das Leis Orçamentárias Anuais (LOAs), por meio da participação presencial em Audiências Públicas, Plenárias, Seminários etc., pela criação do Conselho de Planejamento e Orçamento Participativos (CPOP) e por meio de um Portal Eletrônico.','Programa de Metas: documento descrevendo as prioridades dos 4 anos da gestão do governo municipal, explicitando as ações estratégicas, os\nindicadores e as metas quantitativas para cada um dos setores da Prefeitura. Deve ser apresentado em até 90 dias após a posse do Prefeito eleito.\nPlano Plurianual - PPA: é o principal instrumento de planejamento público e determina a orientação estratégica e as prioridades do governo\ntraduzidas em programas e ações. O Projeto de Lei deve ser enviado ao Legislativo até o dia 30 de Setembro do primeiro ano do mandato, deve\nser votado pelo Legislativo até o fim do ano e vale para os 4 anos seguintes.\nLei de Diretrizes Orçamentárias - LDO: é o instrumento que conecta o PPA com o Orçamento Anual, estabelecendo as Diretrizes e orientando a\nelaboração da Lei Orçamentária Anual. Na LDO são fixadas as prioridades e metas para o ano seguinte, bem como previsões de alterações na legislação tributária e de metas e riscos fiscais. O Projeto de Lei deve ser enviado ao Legislativo até o dia 15 de Abril e deve ser votado até o dia 30 de Junho de cada ano.\nLei Orçamentária Anual - LOA: é a proposta orçamentária anual de todos os órgãos da administração, prevendo a Receita e fixando a Despesa para o ano seguinte. O Projeto de Lei deve ser enviado ao Legislativo até o dia 30 de Setembro e deve ser votado até o final de cada ano.\nConselho de Planejamento e Orçamento Participativos - CPOP: será criado um Conselho para acompanhar a execução dos instrumentos de planejamento e orçamento, com representantes territoriais das Subprefeituras, representantes temáticos dos diversos setores damPrefeitura e representantes do Poder Público.',4,'sp-aberta','99 audiências públicas (todas as subprefeituras contempladas) e 11 mil participações na construção do CPPO em 2013','Criado o Conselho Participativo de Orçamento e Planejamento - CPOP, com representantes da sociedade civil, do Executivo e do Legislativo municipais.','Em 2014 foram realizadas 32 audiências públicas para discutir o orçamento de 2015, com mais de 2.300 participações e 675 contribuições colhidas.','','','','0000-00-00 00:00:00','2015-01-14 20:59:16'),(120,20,3,1,'Revisar o Plano Diretor Estratégico','Projetos de Lei apresentados à Câmara Municipal para revisão do Plano Diretor Estratégico',0.00,'Plano Diretor Estratégico','','Os projetos de lei serão construídos de forma participativa, mediante audiências públicas e outros instrumentos pertinentes ao processo de participação cidadã. O processo de revisão e aprovação do Plano Diretor Estratégico não envolve custo de implantação e manutenção.','Marco Regulatório: é o conjunto de instrumentos de planejamento e gestão urbana que serve para definir as diretrizes das políticas públicas e\ncontrolar o desenvolvimento da cidade.\nPlano Diretor Estratégico: é o instrumento básico da política de desenvolvimento e expansão urbana do município. Deve ordenar o cumprimento das funções sociais da cidade e das propriedades urbanas, integrar ao processo de planejamento municipal e orientar o plano plurianual, as diretrizes orçamentárias e o orçamento anual.',4,NULL,'Em 31 de Julho de 2014 foi promulgada a Lei nº.16.050, que aprova a Política de Desenvolvimento Urbano e o Plano Diretor Estratégico do Município de São Paulo e revoga a Lei nº 13.430/2002.','O Plano foi fruto do Projeto de Lei nº 688/13, do Executivo, aprovado na forma de Substitutivo do Legislativo, pela Câmara Municipal, em sessão de 2 de julho de 2014.','Após aprovação do Plano Diretor Estratégico Lei nº.16.050/14 foi iniciado o processo de implementação, como a aplicação dos instrumentos indutores da função social da cidade.','','','','0000-00-00 00:00:00','2015-01-13 19:06:25'),(121,20,3,1,'Revisar a Lei de Parcelamento, Uso e Ocupação do Solo','Projeto de Lei apresentado à Câmara Municipal',7900000.00,'Lei de Parcelamento, Uso e Ocupação do Solo','','Será realizada a avaliação da lei vigente e proposição de projeto de lei de sua revisão por meio de um processo participativo envolvendo a sociedade e os diversos segmentos sociais.','Marco Regulatório: é o conjunto de instrumentos de planejamento e gestão urbana que serve para definir as diretrizes das políticas públicas e\ncontrolar o desenvolvimento da cidade.\nLei de parcelamento, uso e ocupação do solo: também conhecida como lei de zoneamento, trata das regras de quanto, como e onde podem ser construídas determinadas atividades no território municipal. É um instrumento que estabelece parâmetros objetivos para o cumprimento da função social da propriedade com base no que for estabelecido no Plano Diretor.',2,NULL,'Concluído caderno de explicação da lei vigente e consolidado o caderno de proposta de revisão.','Disponibilização da proposta para consulta pública na internet.','Realização de 32 oficinas regionais para debate da proposta.','Debate da proposta no Conselho Municipal de Política Urbana. ','Divulgação de material e agenda no site da SMDU.','','0000-00-00 00:00:00','2015-01-13 20:37:12'),(122,20,3,1,'Revisar os Planos Regionais Estratégicos','Projeto de Lei apresentados à Câmara Municipal para revisão dos Planos Regionais Estratégicos',2100000.00,'','Planos Regionais Estratégicos','Os projetos de lei serão construídos de forma participativa, mediante audiências públicas e outros instrumentos pertinentes.','Marco Regulatório: é o conjunto de instrumentos de planejamento e gestão urbana que serve para definir as diretrizes das políticas públicas e controlar o desenvolvimento da cidade.\nPlano Regional Estratégico: Instrumento de planejamento urbano baseado no Plano Diretor Estratégico com abrangência no território de cada subprefeitura do Município de São Paulo.',2,NULL,'Metodologia de revisão dos Planos Regionais elaborada, em fase final de produção de bases.','Montagem e organização da equipe que organizará a elaboração dos Planos Regionais.','','','','','0000-00-00 00:00:00','2015-01-13 20:49:37'),(123,20,3,5,'Aprovar as Operações Urbanas Mooca/Vila Carioca, a revisão da Operação Urbana Água Branca e iniciar os estudos do projeto Arco Tietê','Projetos de Lei apresentados à Câmara Municipal estabelecendo as áreas e mecanismos que comporão as operações urbanas citadas.',14350000.00,'Operação Urbana Água Branca aprovada','Operação Urbana Mooca/Vila Carioca aprovada, Operação Urbana Arco Tietê aprovada','','Operação Urbana: instrumentos da política urbana que visam a promover melhorias em regiões pré - determinadas da cidade através de parcerias entre o Poder Público e a iniciativa privada. Cada área objeto de Operação Urbana tem uma lei específica estabelecendo as metas a serem cumpridas, bem como os mecanismos de incentivos e benefícios.',3,NULL,'Operação Urbana Água Branca Concluída;\nAudiências públicas do Licenciamento Ambiental da OUC Bairros do Tamanduateí (Arco Tamanduateí) concluídas.','Entrega dos estudos de chamamento público do Arco Tietê para análise da equipe técnica.','','','','','0000-00-00 00:00:00','2015-01-13 20:55:11');
