INSERT INTO objectives VALUES (1,'Desenvolvimento Social','Superar a extrema pobreza na cidade de São Paulo, elevando a renda, promovendo a inclusão produtiva e o acesso a serviços públicos para todos','0000-00-00 00:00:00','0000-00-00 00:00:00'),(2,'Educação','Melhorar a qualidade da Educação e ampliar o acesso à Educação Infantil com a expansão da rede de equipamentos e a criação de 150 mil novas vagas','0000-00-00 00:00:00','0000-00-00 00:00:00'),(3,'Saúde','Ampliar o acesso, aperfeiçoar a qualidade, reduzir as desigualdades regionais e o tempo de espera e fortalecer a atenção integral das ações e serviços de saúde','0000-00-00 00:00:00','0000-00-00 00:00:00'),(4,'Cultura','Ampliar o acesso da população à cultura, por meio de equipamentos e ações, a partir da sua descentralização no território','0000-00-00 00:00:00','0000-00-00 00:00:00'),(5,'Habitação','Garantir acesso a moradia adequada','0000-00-00 00:00:00','0000-00-00 00:00:00'),(6,'Segurança','Implantar um Programa Territorializado de Prevenção e Proteção às Vítimas da Violência','0000-00-00 00:00:00','0000-00-00 00:00:00'),(7,'Esporte e Lazer','Promover a prática de atividades esportivas, recreativas e de lazer','0000-00-00 00:00:00','0000-00-00 00:00:00'),(8,'Pessoas com Deficiência','Promover, ampliar e qualificar ações voltadas à efetivação dos direitos das pessoas com deficiência','0000-00-00 00:00:00','0000-00-00 00:00:00'),(9,'Direitos Humanos e Cidadania','Promover uma cultura de cidadania e valorização da diversidade, reduzindo as manifestações de discriminação de todas as naturezas','0000-00-00 00:00:00','0000-00-00 00:00:00'),(10,'População Idosa','Promover a inclusão e a garantia dos direitos da população idosa','0000-00-00 00:00:00','0000-00-00 00:00:00'),(11,'Espaços Públicos','Requalificar e promover a ocupação dos espaços públicos','0000-00-00 00:00:00','0000-00-00 00:00:00'),(12,'Desenvolvimento Econômico','Promover o crescimento econômico e a geração de postos de trabalho na cidade de São Paulo','0000-00-00 00:00:00','0000-00-00 00:00:00'),(13,'Tecnologia e Inovação','Promover a cidade de São Paulo como centro de tecnologia e Inovação','0000-00-00 00:00:00','0000-00-00 00:00:00'),(14,'Meio Ambiente','Proteger os recursos naturais da cidade, conservando as áreas de mananciais, ampliando o sistema de áreas verdes, preservando os recursos hídricos e monitorando as áreas de risco','0000-00-00 00:00:00','0000-00-00 00:00:00'),(15,'Resíduos Sólidos','Ampliar a coleta seletiva de resíduos secos e orgânicos com a inclusão de catadores de materiais recicláveis e reutilizáveis','0000-00-00 00:00:00','0000-00-00 00:00:00'),(16,'Mobilidade','Melhorar a mobilidade urbana universal, dando prioridade aos meios públicos de transporte','0000-00-00 00:00:00','0000-00-00 00:00:00'),(17,'Drenagem','Reduzir a ocorrência de enchentes e alagamentos','0000-00-00 00:00:00','0000-00-00 00:00:00'),(18,'Atendimento ao Cidadão','Aproximar a Prefeitura do cidadão, descentralizando e modernizando a gestão, aumentando a qualidade dos espaços e serviços e reduzindo o tempo de espera no atendimento','0000-00-00 00:00:00','0000-00-00 00:00:00'),(19,'Participação e Transparência','Promover a participação, a transparência e o controle social na administração pública municipal','0000-00-00 00:00:00','0000-00-00 00:00:00'),(20,'Desenvolvimento Urbano','Realizar o marco regulatório do desenvolvimento urbano de forma participativa','0000-00-00 00:00:00','0000-00-00 00:00:00');
