imento da meta ao final da gestão, o percentual total da frota acessível não é utilizado para determinar o índice de andamento da meta, uma vez que no início da gestão não se partiu de 0% de acessibilidade na frota, e sim de 59,9%. Ou seja, a meta não poderia iniciar já com 59,9% de seu cumprimento.','Calcula-se o andamento da meta pela representação do avanço em relação aos 40,1 pontos percentuais (100%- 59,9% iniciais) necessários para atingir acessibilidade total da frota. Por exemplo: se a frota acessível passou de 59,9% para 65,8% (diferença de 5,9%), como em 2013, o andamento da meta foi de 14,7%, que é o quanto 5,9% representam em um universo possível de 40,1% de progresso.','Meta viabilizada mediante o contrato de concessão dos serviços do transporte',NULL,NULL,'','2014-10-31 03:29:25','2014-10-31 03:29:25'),(1763,'Vagas a crianças beneficiárias do Benefício de Prestação Continuada da Assistência Social (BPC)',52,8,NULL,NULL,'0','0',50.00,0.00,0.00,0.00,0.00,NULL,'O custo de disponibilização de vagas é absorvido pelo orçamento de operação e manutenção das unidades de ensino da Secretaria Municipal da Educação.','O número de alunos atendidos de 2014 será informado em Dezembro por SMADS.',NULL,NULL,NULL,'803','2014-10-31 03:29:25','2014-10-31 03:29:25'),(1764,'Revitalização do Centro de Formação e Acompanhamento à Inclusão (CEFAI) - Butantã',54,8,'Butantã','Rua Manuel Jacinto, 249 – Vila Morse','-23.591033','-46.728145',100.00,0.00,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,'0','2014-10-31 03:29:25','2014-10-31 03:29:25'),(1765,'Revitalização do Centro de Formação e Acompanhamento à Inclusão (CEFAI) - Campo Limpo',54,8,'Capão Redondo','Rua Nossa Senhora do Bom Conselho, 65 – Jardim Laranjal','-23.647815','-46.756528',100.00,0.00,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,'0','2014-10-31 03:29:25','2014-10-31 03:29:25'),(1766,'Revitalização do Centro de Formação e Acompanhamento à Inclusão (CEFAI) - Capela do Socorro',54,8,'Capela do Socorro','Rua Deputado 